(18, 1, '2020-04-30 10:43:29', '2020-04-30 08:43:29', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La <em>Young Men\'s Christian Association</em> (YMCA) joue un grand rôle dans la diffusion du basketball à travers les États-Unis et le Canada, mais aussi dans le reste du monde. Le premier match européen est disputé en 1893 à Paris, dans le quartier de Montmartre. À la même époque, des matchs sont organisés à Tianjin (Chine), en Inde, au Japon et en Perse. Dès 1895, le sport est pratiqué dans plusieurs lycées de jeunes filles. Toutefois, la YMCA ne parvient pas à préserver l\'esprit originel du basketball, qui devient de plus en plus violent et est pratiqué par des bandes de jeunes bagarreurs. Pour permettre le respect des règles de jeu, la première ligue professionnelle, la <em>National Basketball League</em>, est fondée aux États-Unis en 1898 avec six équipes. Les premiers champions sont les <em>Trenton Nationals</em>, suivis des <em>New York Wanderers</em>, des <em>Bristol Pile Drivers</em> et des <em>Camden Electrics</em>. La ligue est dissoute en 1904. De nombreux championnats sont alors organisés.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout début du <abbr title=\"20ᵉ siècle\">XX<sup>e</sup></abbr> siècle, le basketball devient peu à peu une activité courante dans de nombreuses universités américaines, notamment grâce à l\'action de James Naismith. Le premier match interuniversitaire est disputé le 9 février 1895 entre l\'université Hamline et l\'école d\'agriculture de l\'université du Minnesota ; cette dernière remporte le match sur le score de 9 points à 3. La première équipe universitaire est fondée en 1896 au <em>Geneva College</em> de Pittsburgh. Naismith lui-même entraîne pendant six ans l\'équipe de l\'université du Kansas, avant de laisser la place à Phog Allen. Amos Alonzo Stagg introduit le basketball à l\'université de Chicago tandis qu\'Adolph Rupp, un ancien élève de Naismith, connaît le succès en tant qu\'entraîneur de l\'université du Kentucky.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Dès 1897, l\'<em>Amateur Athletic Union</em> prend le contrôle de la gestion du basketball à la YMCA. En 1901, de nombreuses universités commencent à financer des matchs, dont l\'université de Chicago, Columbia, le Dartmouth College, l\'université du Minnesota, l\'Académie navale d\'Annapolis, l\'université du Colorado et Yale. Le premier match universitaire au Canada a lieu le 6 février 1904 et oppose l\'université McGill à l\'université Queen\'s. En avril 1905, des représentants de quinze universités créent le <em>Basket Ball Rule Committee</em> (<q>Comité de règlementation du basket-ball</q>) afin de superviser le basketball universitaire. La même année, sur la suggestion du président Theodore Roosevelt qui estimait que les blessures étaient trop fréquentes dans le football américain, se forme l’<em>Intercollegiate Athletic Association</em>. Elle absorbe le comité en 1909, et devient en 1910 la NCAA - la principale fédération américaine de sport universitaire actuelle.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Peu avant le début de la Première Guerre mondiale, la NCAA et l’<em>Amateur Athletic Union</em> se disputent ainsi le contrôle des règles</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">du jeu. Après l\'entrée en guerre des États-Unis en 1917, les forces armées américaines contribuent à la diffusion du basketball sur le continent européen : plusieurs entraîneurs sportifs étaient présents aux côtés des troupes. Naismith a lui-même passé deux ans en France avec la YMCA à cette époque.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":19,\"width\":810,\"height\":642,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Kansas_U_team_1899.jpg\" alt=\"\" class=\"wp-image-19\" width=\"810\" height=\"642\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">L\'équipe de l\'université du Kansas en 1899, avec leur entraîneur James Naismith (rang du haut, à droite).</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Développement aux États-Unis et au Canada', '', 'publish', 'open', 'open', '', 'developpement-aux-etats-unis-et-au-canada', '', '', '2020-04-30 14:45:02', '2020-04-30 12:45:02', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?p=18', 0, 'post', '', 0),
