(20, 1, '2020-04-30 10:43:29', '2020-04-30 08:43:29', '<!-- wp:paragraph -->\n<p>La <em>Young Men\'s Christian Association</em> (YMCA) joue un grand rôle dans la diffusion du basketball à travers les États-Unis et le Canada, mais aussi dans le reste du monde. Le premier match européen est disputé en 1893 à Paris, dans le quartier de Montmartre. À la même époque, des matchs sont organisés à Tianjin (Chine), en Inde, au Japon et en Perse. Dès 1895, le sport est pratiqué dans plusieurs lycées de jeunes filles. Toutefois, la YMCA ne parvient pas à préserver l\'esprit originel du basketball, qui devient de plus en plus violent et est pratiqué par des bandes de jeunes bagarreurs. Pour permettre le respect des règles de jeu, la première ligue professionnelle, la <em>National Basketball League</em>, est fondée aux États-Unis en 1898 avec six équipes. Les premiers champions sont les <em>Trenton Nationals</em>, suivis des <em>New York Wanderers</em>, des <em>Bristol Pile Drivers</em> et des <em>Camden Electrics</em>. La ligue est dissoute en 1904. De nombreux championnats sont alors organisés.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Au tout début du <abbr title=\"20ᵉ siècle\">XX<sup>e</sup></abbr> siècle, le basketball devient peu à peu une activité courante dans de nombreuses universités américaines, notamment grâce à l\'action de James Naismith. Le premier match interuniversitaire est disputé le 9 février 1895 entre l\'université Hamline et l\'école d\'agriculture de l\'université du Minnesota ; cette dernière remporte le match sur le score de 9 points à 3. La première équipe universitaire est fondée en 1896 au <em>Geneva College</em> de Pittsburgh. Naismith lui-même entraîne pendant six ans l\'équipe de l\'université du Kansas, avant de laisser la place à Phog Allen. Amos Alonzo Stagg introduit le basketball à l\'université de Chicago tandis qu\'Adolph Rupp, un ancien élève de Naismith, connaît le succès en tant qu\'entraîneur de l\'université du Kentucky.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dès 1897, l\'<em>Amateur Athletic Union</em> prend le contrôle de la gestion du basketball à la YMCA. En 1901, de nombreuses universités commencent à financer des matchs, dont l\'université de Chicago, Columbia, le Dartmouth College, l\'université du Minnesota, l\'Académie navale d\'Annapolis, l\'université du Colorado et Yale. Le premier match universitaire au Canada a lieu le 6 février 1904 et oppose l\'université McGill à l\'université Queen\'s. En avril 1905, des représentants de quinze universités créent le <em>Basket Ball Rule Committee</em> (<q>Comité de règlementation du basket-ball</q>) afin de superviser le basketball universitaire. La même année, sur la suggestion du président Theodore Roosevelt qui estimait que les blessures étaient trop fréquentes dans le football américain, se forme l’<em>Intercollegiate Athletic Association</em>. Elle absorbe le comité en 1909, et devient en 1910 la NCAA - la principale fédération américaine de sport universitaire actuelle.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Peu avant le début de la Première Guerre mondiale, la NCAA et l’<em>Amateur Athletic Union</em> se disputent ainsi le contrôle des règles du jeu. Après l\'entrée en guerre des États-Unis en 1917, les forces armées américaines contribuent à la diffusion du basketball sur le continent européen : plusieurs entraîneurs sportifs étaient présents aux côtés des troupes. Naismith a lui-même passé deux ans en France avec la YMCA à cette époque.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":19,\"width\":810,\"height\":642,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Kansas_U_team_1899.jpg\" alt=\"\" class=\"wp-image-19\" width=\"810\" height=\"642\"/><figcaption>L\'équipe de l\'université du Kansas en 1899, avec leur entraîneur James Naismith (rang du haut, à droite).</figcaption></figure>\n<!-- /wp:image -->', 'Développement aux États-Unis et au Canada', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2020-04-30 10:43:29', '2020-04-30 08:43:29', '', 18, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/18-revision-v1/', 0, 'revision', '', 0),
(17, 1, '2020-04-30 10:30:32', '2020-04-30 08:30:32', '<!-- wp:paragraph -->\n<p>Le basket-ball est inventé en décembre 1891 par James Naismith, professeur d\'éducation physique canado-américain au <em>Springfield College</em>, dans l\'État du Massachusetts (États-Unis). Lors d\'une journée de pluie, Naismith tente d\'assurer malgré tout son cours de sport, et essaie de développer un sport d\'intérieur pour maintenir la condition physique de ses élèves entre les saisons de football américain et de baseball, pendant les longs hivers de la Nouvelle-Angleterre. Il souhaite leur trouver une activité où les contacts physiques sont restreints, afin d\'éviter les risques de blessure.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Après avoir écarté certains jeux trop violents ou peu appropriés à une pratique en salle, il reprend l\'idée d\'un ancien jeu de balle maya (le <em>Pok-ta-pok</em>) et place deux caisses de pêches sur les rampes du gymnase, à 3,05 mètres de hauteur (dix pieds). Le but du jeu est de faire pénétrer un ballon dans ces caisses en bois pour marquer un <q>panier</q>. Contrairement aux paniers actuels, la caisse de pêches dispose d\'un fond : la balle devait donc être récupérée manuellement après chaque <q>panier</q> inscrit. Afin d\'éviter d\'avoir à rechercher systématiquement la balle, le fond du panier est évidé pour pouvoir l\'extraire avec une longue perche. Naismith établit rapidement treize règles principales (les Treize règles originelles) pour rendre le jeu praticable ; la majorité sont encore en vigueur. Ces règles comportent notamment l\'interdiction de courir en tenant la balle (marcher) et de <q>donner des coups d\'épaule, de tenir, de pousser ou de faire tomber de quelconque manière</q> l\'adversaire. Elles définissent en outre la durée d\'une partie : quatre quarts-temps de quinze minutes, avec une pause de cinq minutes entre elles.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Ce sport est baptisé basket-ball, ce qui signifie littéralement en anglais « ballon panier ». Il est d\'abord pratiqué avec un ballon de football, puis avec des balles de couleur brune. Le tout premier match public de basket-ball est joué le 11 mars 1892 entre des élèves d\'une classe d\'étudiants de la <em>Springfield Christian Training Association</em> et leurs enseignants. Les étudiants gagnent 5-1 ; le seul panier marqué par les enseignants est celui du célèbre entraîneur de football américain Amos Alonzo Stagg. La même année, le jeu est adapté pour être joué par des femmes. Le premier match féminin se déroule en 1893 au <em>Smith College</em> de Northampton, dans le Massachusetts. Dès 1897-1898, le nombre de joueurs par équipe est fixé à cinq. À l\'occasion d\'une démonstration au Y.M.C.A. de New York en avril 1892, la discipline gagne une première mention dans The New York Times. Il est présenté comme <q>un nouveau sport de balle, un substitut du football sans ses aspects brutaux</q>. Les premiers articles sur ce sport en France datent de 1897. Dans ce dernier pays, il est d\'abord plutôt considéré comme un sport féminin et se fait encore appeler « balle au panier ».</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 1906, les caisses en bois sont finalement remplacées par des anneaux en métal fixés à des panneaux. La balle passe ainsi à travers un arceau et retombe au sol lorsqu\'un panier est inscrit. Le panneau sert quant à lui à éviter que la balle n\'atterrisse dans les tribunes, et permet d\'effectuer des tirs avec rebond. Dans son journal, découvert en 2006 par sa petite-fille, James Naismith fait part de ses appréhensions quant au jeu qu\'il a inventé, et indique qu\'il y a introduit certaines règles d\'un jeu enfantin médiéval, le <em>Duck on a Rock</em>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Au début de son histoire, le basket-ball est surtout porté sur le jeu offensif et la défense est reléguée au second plan. La défense est alors la phase passive du basket-ball, où les joueurs attendent l\'échec de l\'adversaire ; elle a depuis acquis un rôle comparable à celui de l\'attaque. Par ailleurs, la passe et le tir étaient les seules manières de déplacer la balle vers le panier. En effet, le dribble n\'existait pas dans le basket-ball originel, hormis lors d\'une éventuelle passe à un coéquipier avec rebond au sol : il était rendu difficile par la forme asymétrique des premiers ballons. Il est devenu essentiel dans le jeu à partir des années 1950, lorsque les ballons manufacturés eurent une forme régulière et les qualités de rebond nécessaires<sup><a href=\"https://fr.wikipedia.org/wiki/Aide:R%C3%A9f%C3%A9rence_n%C3%A9cessaire\"><abbr title=\"référence\"></a></sup>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le sport prend diverses appellations en fonction des pays. En espagnol, il est nommé <em>baloncesto</em> (Espagne) ou <em>básquetbol</em> (Argentine); en italien <em>pallacanestro</em> ; et en tchèque <em>košíková</em>.</p>\n<!-- /wp:paragraph -->', 'Histoire du basket-ball', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2020-04-30 10:30:32', '2020-04-30 08:30:32', '', 1, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/1-revision-v1/', 0, 'revision', '', 0),
