in de l’écosystème WordPress. L’équipe de traduction de WordPress en français a décidé de lancer son [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:8293:\"\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-1024x579.jpg\" alt=\"\" class=\"wp-image-1587\" srcset=\"https://fr.wordpress.org/files/2020/04/wptd-2020-1024x579.jpg 1024w, https://fr.wordpress.org/files/2020/04/wptd-2020-300x170.jpg 300w, https://fr.wordpress.org/files/2020/04/wptd-2020-768x435.jpg 768w, https://fr.wordpress.org/files/2020/04/wptd-2020-1536x869.jpg 1536w, https://fr.wordpress.org/files/2020/04/wptd-2020.jpg 1953w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></figure>\n\n\n\n<p>En raison des circonstances actuelles, de nombreux WordCamps ont été annulés ou reportés à l’automne, comme par exemple le WordCamp Paris qui devait se tenir vendredi prochain. Mais la communauté s’organise… plusieurs évènements en ligne commencent à fleurir au sein de l’écosystème WordPress.</p>\n\n\n\n<p>L’équipe de traduction de WordPress en français a décidé de lancer son premier WordPress Translation Day FR, et il aura lieu le vendredi 17 avril 2020 à partir de 13h&nbsp;!</p>\n\n\n\n<h2>Comment participer</h2>\n\n\n\n<p>L’évènement se déroulera en visioconférence sur le logiciel Zoom. Vous pouvez déjà vous y inscrire gratuitement&nbsp;:</p>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button is-style-fill\"><a class=\"wp-block-button__link has-text-color has-background\" href=\"https://zoom.us/meeting/register/vJQodeqhqjsopEDTK3ILgH2gYgFoDGQtdQ\" style=\"background-color:#1d7ab0;color:#ffffff;border-radius:7px\" target=\"_blank\" rel=\"noreferrer noopener\">S’inscrire au WP Translation Day FR</a></div>\n</div>\n\n\n\n<p>Afin de coordonner nos actions nous vous demandons aussi de rejoindre le Slack WordPress FR. Pour vous inscrire gratuitement, si ce n’est déjà fait, <a href=\"https://wpfr.net/slack\">il vous suffit de remplir ce formulaire</a>. Vous recevrez alors une invitation par e-mail. Nous vous attendons dans le canal <em>#wptranslationday</em>&nbsp;!</p>\n\n\n\n<span id=\"more-1576\"></span>\n\n\n\n<h2>Le WordPress Translation Day FR, qu’est-ce que c’est&nbsp;?</h2>\n\n\n\n<p>Habituellement, un <em>WordPress Translation Day</em>, ce sont 24 heures pendant lesquelles les différentes équipes de traduction de chaque langue contribuent ensemble à la traduction de l’écosystème&nbsp;: cœur WordPress, extensions, thèmes, ainsi que tous les sites WordPress.org. Cela se déroule sur 24 heures et sur tous les fuseaux horaires, avec des conférences données en direct dans toutes les langues.</p>\n\n\n\n<p>Le 17 avril prochain, nous vous proposerons une version allégée du <em>WordPress Translation Day</em> mondial. Il s’agira de contribuer ensemble à la traduction de WordPress, pendant une demi-journée (vendredi après-midi à partir de 13h), en visioconférence.</p>\n\n\n\n<h2>Pourquoi participer à cet évènement</h2>\n\n\n\n<p>WordPress est un projet open source que nous sommes nombreuses et nombreux à utiliser. Qui dit open source dit contribution. Il y a différentes manières de contribuer au projet WordPress : entre autres, en améliorant le cœur du CMS, en organisant des évènements (meetups, WordCamps) mais aussi en traduisant WordPress lui-même, ses extensions, ses thèmes ou encore sa documentation. Alors vous aussi contribuez !</p>\n\n\n\n<p>L’équipe de traduction de WordPress en français sera ravie de vous accueillir. Pour en savoir plus sur son organisation, n’hésitez pas à consulter le <a href=\"https://fr.wordpress.org/team/handbook\">guide dédié</a> ou encore <a href=\"https://fr.wordpress.org/team\">le blog officiel de l’équipe</a>.</p>\n\n\n\n<h2>Le programme</h2>\n\n\n\n<p>C’est très simple&nbsp;: rendez-vous à partir de 13 heures sur la conférence Zoom. Si vous ne pouvez pas vous libérer dès 13 heures, n’hésitez pas à nous rejoindre en cours de route&nbsp;!</p>\n\n\n\n<div class=\"wp-block-buttons aligncenter\">\n<div class=\"wp-block-button is-style-fill\"><a class=\"wp-block-button__link has-text-color has-background\" href=\"https://zoom.us/meeting/register/vJQodeqhqjsopEDTK3ILgH2gYgFoDGQtdQ\" style=\"background-color:#1d7ab0;color:#ffffff;border-radius:7px\" target=\"_blank\" rel=\"noreferrer noopener\">S’inscrire à la visio-conférence Zoom</a></div>\n</div>\n\n\n\n<p>Après une petite introduction de la part des responsables de la traduction de WordPress, chacun pourra contribuer à la traduction des extensions ou des thèmes de son choix. Nous vous présenterons également le travail en cours sur la traduction de la documentation de WordPress en français.</p>\n\n\n\n<h2>Faites passer l’info !</h2>\n\n\n\n<p><a href=\"https://fr.wordpress.org/files/2020/04/communique-presse-wptranslationday-fr.pdf\">Communiqué de presse version PDF</a></p>\n\n\n\n<p>Bannière grand format :</p>\n\n\n\n<ul><li><a href=\"https://fr.wordpress.org/files/2020/04/wptd-2020.jpg\" target=\"_blank\" rel=\"noreferrer noopener\">Télécharger la bannière</a></li><li>Code d&rsquo;intégration HTML</li></ul>\n\n\n\n<pre class=\"wp-block-preformatted\">&lt;a href=\"https://fr.wordpress.org/2020/04/10/rejoignez-le-premier-wordpress-translation-day-fr-en-visioconference-le-17-avril-2020/\"&gt;&lt;img src=\"https://fr.wordpress.org/files/2020/04/wptd-2020.jpg\" alt=\"WordPress Translation Day FR, le 17 avril à partir de 13h\" /&gt;&lt;/a&gt;</pre>\n\n\n\n<p>Badges pour site web :</p>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\" style=\"flex-basis:30%\">\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator.jpg\" alt=\"\" class=\"wp-image-1585\" srcset=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator.jpg 400w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator-300x300.jpg 300w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator-150x150.jpg 150w\" sizes=\"(max-width: 400px) 100vw, 400px\" /></figure>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<p>Code d&rsquo;intégration HTML :</p>\n\n\n\n<pre class=\"wp-block-preformatted\">&lt;a href=\"https://fr.wordpress.org/2020/04/10/rejoignez-le-premier-wordpress-translation-day-fr-en-visioconference-le-17-avril-2020/\"&gt;&lt;img src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-translator.jpg\" alt=\"WordPress Translation Day FR, le 17 avril à partir de 13h\" /&gt;&lt;/a&gt;</pre>\n</div>\n</div>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\" style=\"flex-basis:30%\">\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga.jpg\" alt=\"\" class=\"wp-image-1583\" srcset=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga.jpg 545w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga-300x300.jpg 300w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga-150x150.jpg 150w\" sizes=\"(max-width: 545px) 100vw, 545px\" /></figure>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<p>Code d&rsquo;intégration HTML :</p>\n\n\n\n<pre class=\"wp-block-preformatted\">&lt;a href=\"https://fr.wordpress.org/2020/04/10/rejoignez-le-premier-wordpress-translation-day-fr-en-visioconference-le-17-avril-2020/\"&gt;&lt;img src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-orga.jpg\" alt=\"WordPress Translation Day FR, le 17 avril à partir de 13h\" /&gt;&lt;/a&gt;</pre>\n</div>\n</div>\n\n\n\n<div class=\"wp-block-columns\">\n<div class=\"wp-block-column\" style=\"flex-basis:30%\">\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-apero.jpg\" alt=\"\" class=\"wp-image-1581\" srcset=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-apero.jpg 486w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-apero-300x300.jpg 300w, https://fr.wordpress.org/files/2020/04/wptd-2020-badge-apero-150x150.jpg 150w\" sizes=\"(max-width: 486px) 100vw, 486px\" /></figure>\n\n\n\n<p></p>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<p>Code d&rsquo;intégration HTML :</p>\n\n\n\n<pre class=\"wp-block-preformatted\">&lt;a href=\"https://fr.wordpress.org/2020/04/10/rejoignez-le-premier-wordpress-translation-day-fr-en-visioconference-le-17-avril-2020/\"&gt;&lt;img src=\"https://fr.wordpress.org/files/2020/04/wptd-2020-badge-apero.jpg\" alt=\"WordPress Translation Day FR, le 17 avril à partir de 13h\" /&gt;&lt;/a&gt;</pre>\n</div>\n</div>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:127:\"https://fr.wordpress.org/2020/04/10/rejoignez-le-premier-wordpress-translation-day-fr-en-visioconference-le-17-avril-2020/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:1;a:6:{s:4:\"data\";s:74:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:8:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:30:\"WordPress 5.4 « Adderley »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:59:\"https://fr.wordpress.org/2020/04/01/wordpress-5-4-adderley/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:67:\"https://fr.wordpress.org/2020/04/01/wordpress-5-4-adderley/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 01 Apr 2020 08:52:37 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1551\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:355:\"Chaque version majeure améliore l’éditeur de blocs. Pour WordPress 5.4 nous avons fait plus fort&#160;: Plus de moyens de donner vie aux articles et aux pages avec vos meilleures images Plus de moyens d’attirer et de fidéliser vos visiteurs grâce à la richesse des médias intégrés depuis les principaux services du web Plus de moyens [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:54:\"https://wordpress.org/news/files/2020/03/textcolor.mp4\";s:6:\"length\";s:6:\"440616\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:56032:\"\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/03/adderley.png\" alt=\"\" class=\"wp-image-1552\" srcset=\"https://fr.wordpress.org/files/2020/03/adderley.png 768w, https://fr.wordpress.org/files/2020/03/adderley-300x300.png 300w, https://fr.wordpress.org/files/2020/03/adderley-150x150.png 150w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<div class=\"wp-block-group\"><div class=\"wp-block-group__inner-container\">\n<p style=\"background-color:#216bce;color:#ffffff\" class=\"has-text-color has-background has-normal-font-size\"><strong>Construisez davantage avec les blocs. Plus vite et plus facilement.</strong><br><br>Nous vous proposons une meilleure expérience d’administration de contenus web avec l’éditeur amélioré de <strong>WordPress 5.4</strong>.<br><br>Nommée <em><strong>«&nbsp;Adderley&nbsp;»</strong></em> en l’honneur du cornettiste de jazz Nat Adderley, la dernière version de WordPress est maintenant disponible en téléchargement.</p>\n</div></div>\n\n\n\n<span id=\"more-1551\"></span>\n\n\n\n<p>Chaque version majeure améliore l’éditeur de blocs. Pour WordPress 5.4 nous avons fait <em>plus</em> fort&nbsp;:</p>\n\n\n\n<ul><li>Plus de moyens de donner vie aux articles et aux pages avec vos meilleures images</li><li>Plus de moyens d’attirer et de fidéliser vos visiteurs grâce à la richesse des médias intégrés depuis les principaux services du web</li><li>Plus de moyens de concrétiser votre vision de votre site web et de concevoir vos blocs à l’endroit idéal &#8211; et cela même si un type de bloc particulier est nouveau pour vous</li><li>Des processus plus efficaces</li><li>Plus de vitesse partout, de sorte que lorsque vous construisez des sections ou des galeries, ou que vous rédigez simplement une ligne de poésie, vous pourrez ressentir à quel point votre travail s’accélère</li></ul>\n\n\n\n<p>Plus, plus plus… Du positif dont nous avons tous besoin en ces temps compliqués.</p>\n\n\n\n<p style=\"color:#000000\" class=\"has-text-color has-background has-very-light-gray-background-color\">Malgré les difficultés actuelles, la sortie de la version 5.4 de WordPress (et de sa traduction en français) a pu être maintenue grâce à l&rsquo;investissement de milliers de contributeurs à travers le monde, que cela concerne le développement de WordPress 5.4 ou les contributrices et contributeurs ayant traduit WordPress en français <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f499.png\" alt=\"💙\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /><br><br>Nous les remercierons en bas de cet article. En attendant, place aux évolutions majeures de WordPress 5.4&nbsp;!</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/Squares.jpg\" alt=\"\" class=\"wp-image-1553\" srcset=\"https://fr.wordpress.org/files/2020/04/Squares.jpg 768w, https://fr.wordpress.org/files/2020/04/Squares-300x150.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<h2>Deux nouveaux blocs et des améliorations sur tous les blocs existants</h2>\n\n\n\n<ul><li>Deux blocs tout neufs : Les liens sociaux et les boutons rendent rapide et facile l’ajout de fonctionnalités interactives.</li><li>De nouvelles façons d&rsquo;utiliser la couleur : Dégradés dans les blocs des boutons et de couverture, accès par la barre d’outils aux options de couleur dans les blocs de texte enrichi, et pour la première fois, options de couleur dans les blocs de groupe et de colonnes.</li><li>La version 5.4 rationalise l&rsquo;ensemble du processus de placement et de remplacement de média dans chaque bloc. Elle fonctionne désormais de la même manière dans presque tous les blocs !</li><li>Le bloc Média + Texte permet maintenant de lier un document joint disponible en téléchargement.</li></ul>\n\n\n\n<figure class=\"wp-block-video\"><video controls src=\"https://wordpress.org/news/files/2020/03/textcolor.mp4\"></video></figure>\n\n\n\n<h2>Une interface et une navigation plus claires, et plus facile à utiliser au clavier</h2>\n\n\n\n<ul><li>Une navigation dans les blocs plus claire via le navigateur de l’éditeur, et une sélection plus facile des blocs.</li><li>Pour quand vous avez besoin de naviguer avec le clavier, mieux tabuler et vous concentrer. De plus, vous pouvez tabuler sur la colonne latérale de presque tous les blocs.</li><li>Et en vitesse&nbsp;! Le chargement de l’éditeur est 14&nbsp;% plus rapide et le temps d’attente avant la saisie est 51&nbsp;% moins long&nbsp;!</li><li>Les astuces ont disparu. À leur place, une fenêtre de guide de bienvenue s’affiche lorsque vous en avez besoin et uniquement lorsque vous en avez besoin.</li><li>Sachez en un coup d’œil si vous êtes en mode modification de bloc ou navigation. Ou bien, si vous avez une vision limitée, votre lecteur d’écran vous indiquera dans quel mode vous êtes.</li></ul>\n\n\n\n<p>Bien entendu, si vous souhaitez travailler avec les derniers outils et fonctionnalités, installez l’<a href=\"https://wordpress.org/plugins/gutenberg/\">extension Gutenberg</a>. Vous serez la première personne à utiliser les nouvelles fonctionnalités excitantes de l&rsquo;éditeur de blocs, avant que quiconque ne les ait vues.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/Rectangles-and-circles.jpg\" alt=\"\" class=\"wp-image-1554\" srcset=\"https://fr.wordpress.org/files/2020/04/Rectangles-and-circles.jpg 768w, https://fr.wordpress.org/files/2020/04/Rectangles-and-circles-300x150.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<h2>Votre droit fondamental&nbsp;: la confidentialité</h2>\n\n\n\n<p>5.4 aide à résoudre divers problèmes de protection de la vie privée dans le monde. Ainsi, lorsque les utilisateurs et les parties prenantes posent des questions sur le respect de la réglementation ou sur la manière dont votre équipe traite les données des utilisateurs, il devrait être beaucoup plus facile d&rsquo;obtenir des réponses correctes.</p>\n\n\n\n<p>Voici quelques améliorations notables&nbsp;:</p>\n\n\n\n<ul><li>Désormais, les exportations de données personnelles comprennent les informations sur les sessions des utilisateurs et les données de localisation des utilisateurs à partir du widget des événements communautaires. Plus, une table des matières !</li><li>Suivez l’évolution du traitement des demandes d’exportation et d’effacement grâce aux outils de protection de confidentialité.</li><li>De plus, de petites améliorations ont été apportées aux outils de confidentialité pour leur donner un aspect plus net. Vos yeux vous remercieront&nbsp;!</li></ul>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2020/04/Mixed.jpg\" alt=\"\" class=\"wp-image-1555\" srcset=\"https://fr.wordpress.org/files/2020/04/Mixed.jpg 768w, https://fr.wordpress.org/files/2020/04/Mixed-300x150.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<h2>Pour les développeuses et les développeurs</h2>\n\n\n\n<h3>Ajout de champs personnalisés aux éléments de menu &#8211; nativement</h3>\n\n\n\n<p>Deux nouvelles actions vous permettent d’ajouter des champs personnalisés aux menus – sans extension et sans utiliser de «&nbsp;walkers&nbsp;» personnalisés.</p>\n\n\n\n<p>Sur l’écran d’administration des menus, l’action&nbsp;<code>wp_nav_menu_item_custom_fields</code>&nbsp;se déclenche juste avant les boutons de déplacement des éléments du menu de navigation.</p>\n\n\n\n<p>Dans l’outil de personnalisation,&nbsp;<code>wp_nav_menu_item_custom_fields_customize_template</code>&nbsp;se déclenche à la fin du modèle contenant les champs de formulaire de gestion du menu.</p>\n\n\n\n<p>Vérifiez votre code et voyez où ces nouvelles actions peuvent remplacer votre code personnalisé, et si vous êtes préoccupé par la duplication, ajoutez une vérification pour la version de WordPress.</p>\n\n\n\n<h3>Concernant les blocs&nbsp;: une mise en forme plus facile, de nouvelles APIs et contenus embarqués</h3>\n\n\n\n<ul><li>La mise en forme des blocs est&nbsp;<strong>radicalement</strong>&nbsp;simplifiée. Fini les marges externes négatives et les marges internes par défaut&nbsp;! Vous pouvez maintenant mettre en forme les blocs comme vous le souhaitez. De plus, une refactorisation du code généré nous a permis de supprimer plusieurs divs d’encapsulation redondantes.</li><li>Si vous créez des extensions, vous pouvez maintenant enregistrer des collections de vos blocs avec des espaces de noms tranversaux aux catégories. Une bonne façon de donner de la visibilité à votre marque.</li><li>Laissez les utilisateurs en faire plus avec deux nouvelles APIs&nbsp;: variations de bloc et dégradés.</li><li>Dans les contenus embarqués, l’éditeur de bloc prend maintenant en charge TikTok et CollegeHumor a été retiré.</li></ul>\n\n\n\n<p>Il y a bien d’autres choses faites pour les développeuses et les développeurs dans WordPress 5.4. Pour en découvrir davantage et apprendre à tirer parti de ces modifications pour vos sites, vos thèmes ou vos extensions, consultez le&nbsp;guide technique de WordPress 5.4&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-francais\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"l2kIfJreLx\"><a href=\"https://fr.wordpress.org/2020/03/04/les-changements-techniques-a-venir-dans-wordpress-5-4/\">Les changements techniques à venir dans WordPress 5.4</a></blockquote><iframe title=\"« Les changements techniques à venir dans WordPress 5.4 » &#8212; Français\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://fr.wordpress.org/2020/03/04/les-changements-techniques-a-venir-dans-wordpress-5-4/embed/#?secret=l2kIfJreLx\" data-secret=\"l2kIfJreLx\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Merci aux personnes qui ont bâti WordPress 5.4 <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f499.png\" alt=\"💙\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></h2>\n\n\n\n<p>Cette version de WordPress a été coordonnée par&nbsp;<a href=\"http://ma.tt/\">Matt Mullenweg</a>, <a href=\"https://profiles.wordpress.org/francina\">Francesca Marano</a> et <a href=\"https://dream-encode.com/blog/\">David Baumwald</a>. Ils ont été épaulés par une l’équipe de direction suivante&nbsp;:</p>\n\n\n\n<ul><li><strong>Coordinateur technique du cœur WP&nbsp;</strong>: Sergey Biryukov (<a href=\"https://profiles.wordpress.org/sergeybiryukov/\"><strong>@sergeybiryukov</strong></a>)</li><li><strong>Coordinateur technique de l&rsquo;éditeur&nbsp;</strong>: Jorge Filipe Costa (<strong><a href=\"https://profiles.wordpress.org/jorgefilipecosta/\">@jorgefelipecosta</a></strong>)</li><li><strong>Coordinateur du design de l’éditeur</strong>: Mark Uraine (<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://profiles.wordpress.org/mapk/\"><strong>@mapk</strong></a>)</li><li><strong>Coordinatrice générale du design&nbsp;</strong>: Tammie Lister (<strong><a href=\"https://profiles.wordpress.org/karmatosed/\">@karmatosed</a></strong>)</li><li><strong>Coordinateur de la documentation&nbsp;</strong>:&nbsp;Jb Audras (<a href=\"https://profiles.wordpress.org/audrasjb/\"><strong>@audrasjb</strong></a>)</li><li><strong>Chargée de communication&nbsp;</strong>: Mary Baum (<strong><a href=\"https://profiles.wordpress.org/marybaum/\">@marybaum</a></strong>)</li></ul>\n\n\n\n<p>Tout au long du cycle de développement, <strong>552 contributrices et contributeurs</strong> ont participé au projet&nbsp;en contribuant à <strong><a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.4&amp;group=component&amp;max=500&amp;col=id&amp;col=summary&amp;col=status&amp;col=owner&amp;col=type&amp;col=priority&amp;col=milestone&amp;order=priority\">361</a>&nbsp;tickets sur Trac</strong>&nbsp;et&nbsp;<strong>1226 pull requests sur GitHub</strong> <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f499.png\" alt=\"💙\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Voici la liste complète de toutes les personnes qui ont contribué au développement du cœur WordPress pour sa version 5.4, dénommée <em>«&nbsp;Adderley&nbsp;»</em>&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/0v3rth3d4wn/\">0v3rth3d4wn</a>,&nbsp;<a href=\"https://profiles.wordpress.org/123host/\">123host</a>,&nbsp;<a href=\"https://profiles.wordpress.org/1naveengiri/\">1naveengiri</a>,&nbsp;<a href=\"https://profiles.wordpress.org/dd32/\">@dd32</a>,&nbsp;<a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>,&nbsp;<a href=\"https://profiles.wordpress.org/abhijitrakas/\">Abhijit Rakas</a>,&nbsp;<a href=\"https://profiles.wordpress.org/abrightclearweb/\">abrightclearweb</a>,&nbsp;<a href=\"https://profiles.wordpress.org/acosmin/\">acosmin</a>,&nbsp;<a href=\"https://profiles.wordpress.org/adamsilverstein/\">Adam Silverstein</a>,&nbsp;<a href=\"https://profiles.wordpress.org/adamboro/\">adamboro</a>,&nbsp;<a href=\"https://profiles.wordpress.org/addiestavlo/\">Addie</a>,&nbsp;<a href=\"https://profiles.wordpress.org/adnanlimdi/\">adnan.limdi</a>,&nbsp;<a href=\"https://profiles.wordpress.org/shaikhaezaz80/\">Aezaz Shaikh</a>,&nbsp;<a href=\"https://profiles.wordpress.org/aftabmuni/\">Aftab Ali Mu