les.wordpress.org/spaceshipone/\">Timothée Brosille</a>,&nbsp;<a href=\"https://profiles.wordpress.org/timothyblynjacobs/\">Timothy Jacobs</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tkama/\">Tkama</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tmanoilov/\">tmanoilov</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tmatsuur/\">tmatsuur</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tobifjellner/\">tobifjellner (Tor-Bjorn Fjellner)</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tomgreer/\">Tom Greer</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tjnowell/\">Tom J Nowell</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tommix/\">tommix</a>,&nbsp;<a href=\"https://profiles.wordpress.org/skithund/\">Toni Viemerö</a>,&nbsp;<a href=\"https://profiles.wordpress.org/toro_unit/\">Toro_Unit (Hiroshi Urabe)</a>,&nbsp;<a href=\"https://profiles.wordpress.org/torres126/\">torres126</a>,&nbsp;<a href=\"https://profiles.wordpress.org/zodiac1978/\">Torsten Landsiedel</a>,&nbsp;<a href=\"https://profiles.wordpress.org/itowhid06/\">Towhidul Islam</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tristangemus/\">tristangemus</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tristanleboss/\">tristanleboss</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tsuyoring/\">tsuyoring</a>,&nbsp;<a href=\"https://profiles.wordpress.org/dinhtungdu/\">Tung Du</a>,&nbsp;<a href=\"https://profiles.wordpress.org/desaiuditd/\">Udit Desai</a>,&nbsp;<a href=\"https://profiles.wordpress.org/grapplerulrich/\">Ulrich</a>,&nbsp;<a href=\"https://profiles.wordpress.org/upadalavipul/\">upadalavipul</a>,&nbsp;<a href=\"https://profiles.wordpress.org/utsav72640/\">Utsav tilava</a>,&nbsp;<a href=\"https://profiles.wordpress.org/vaishalipanchal/\">Vaishali Panchal</a>,&nbsp;<a href=\"https://profiles.wordpress.org/valentinbora/\">Valentin Bora</a>,&nbsp;<a href=\"https://profiles.wordpress.org/varunshanbhag/\">varunshanbhag</a>,&nbsp;<a href=\"https://profiles.wordpress.org/veminom/\">Veminom</a>,&nbsp;<a href=\"https://profiles.wordpress.org/vinita29/\">Vinita Tandulkar</a>,&nbsp;<a href=\"https://profiles.wordpress.org/virgodesign/\">virgodesign</a>,&nbsp;<a href=\"https://profiles.wordpress.org/vsamoletov/\">Vlad. S.</a>,&nbsp;<a href=\"https://profiles.wordpress.org/vortfu/\">vortfu</a>,&nbsp;<a href=\"https://profiles.wordpress.org/waleedt93/\">waleedt93</a>,&nbsp;<a href=\"https://profiles.wordpress.org/webmandesign/\">WebMan Design | Oliver Juhas</a>,&nbsp;<a href=\"https://profiles.wordpress.org/websupporter/\">websupporter</a>,&nbsp;<a href=\"https://profiles.wordpress.org/westonruter/\">Weston Ruter</a>,&nbsp;<a href=\"https://profiles.wordpress.org/earnjam/\">William Earnhardt</a>,&nbsp;<a href=\"https://profiles.wordpress.org/williampatton/\">William Patton</a>,&nbsp;<a href=\"https://profiles.wordpress.org/wpgurudev/\">wpgurudev</a>,&nbsp;<a href=\"https://profiles.wordpress.org/alexandreb3/\">WPMarmite</a>,&nbsp;<a href=\"https://profiles.wordpress.org/wptoolsdev/\">wptoolsdev</a>,&nbsp;<a href=\"https://profiles.wordpress.org/xedinunknown-1/\">xedinunknown-1</a>,&nbsp;<a href=\"https://profiles.wordpress.org/yale01/\">yale01</a>,&nbsp;<a href=\"https://profiles.wordpress.org/collet/\">Yannicki</a>,&nbsp;<a href=\"https://profiles.wordpress.org/yordansoares/\">Yordan Soares</a>,&nbsp;<a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a>,&nbsp;<a href=\"https://profiles.wordpress.org/zachflauaus/\">zachflauaus</a>,&nbsp;<a href=\"https://profiles.wordpress.org/tollmanz/\">Zack Tollman</a>,&nbsp;<a href=\"https://profiles.wordpress.org/zebulan/\">Zebulan Stanphill</a>,&nbsp;<a href=\"https://profiles.wordpress.org/zaffarn/\">Zee</a>, et&nbsp;<a href=\"https://profiles.wordpress.org/zsusag/\">zsusag</a>.</p>\n\n\n\n<h2>Merci à celles et ceux qui ont traduit WordPress 5.4 en français&nbsp;! <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f1eb-1f1f7.png\" alt=\"🇫🇷\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></h2>\n\n\n\n<p>Voici enfin les 18 traductrices et traducteurs qui vous ont permis par leurs contributions d’utiliser WordPress 5.4 en français, dès que cette version a été mise en ligne&nbsp;:</p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/ajoah\">Aurélien Joahny</a>,&nbsp;<a href=\"https://profiles.wordpress.org/benoti\">Benoti</a>,&nbsp;<a href=\"https://profiles.wordpress.org/bigfoot1231\">bigfoot1231</a>,&nbsp;<a href=\"https://profiles.wordpress.org/btpub\">Bruno Tritsch</a>,&nbsp;<a href=\"https://profiles.wordpress.org/clementpolito\">Clément Polito</a>, <a href=\"https://profiles.wordpress.org/wolforg\">Didier Wolforg</a>,&nbsp;<a href=\"https://profiles.wordpress.org/eddystile\">Eddy Boels</a>, <a href=\"https://profiles.wordpress.org/fxbenard\">FX Benard</a>,&nbsp;<a href=\"https://profiles.wordpress.org/flobogo\">flobogo</a>, <a href=\"https://profiles.wordpress.org/audrasjb\">Jb Audras</a>,&nbsp;<a href=\"https://profiles.wordpress.org/jdy68\">Jenny Dupuy</a>,&nbsp;<a href=\"https://profiles.wordpress.org/leprincenoir\">Samy Kantari</a>,&nbsp;<a href=\"https://profiles.wordpress.org/marineevain\">Marine EVAIN</a>,&nbsp;<a href=\"https://profiles.wordpress.org/maximebj\">Maxime Bernard-Jacquet</a>,&nbsp;<a href=\"https://profiles.wordpress.org/maxpertici\">Maxime Pertici</a>,&nbsp;<a href=\"https://profiles.wordpress.org/larrach\">Rachel Peter</a>,&nbsp;<a href=\"https://profiles.wordpress.org/crash_47\">Thomas Piron</a>, et&nbsp;<a href=\"https://profiles.wordpress.org/spaceshipone\">Timothée Brosille</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"https://fr.wordpress.org/2020/04/01/wordpress-5-4-adderley/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:2;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:54:\"Les changements techniques à venir dans WordPress 5.4\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://fr.wordpress.org/2020/03/04/les-changements-techniques-a-venir-dans-wordpress-5-4/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:99:\"https://fr.wordpress.org/2020/03/04/les-changements-techniques-a-venir-dans-wordpress-5-4/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 04 Mar 2020 10:21:30 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1536\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:385:\"La sortie de&#160;WordPress 5.4&#160;est prévue le 31 mars 2020 !&#160;💙 Dirigée par Matt Mullenweg, coordonnée par Francesca Marano et en tout une équipe de direction de 8 personnes, la version 5.4 de WordPress proposera des améliorations techniques du CMS et de nombreuses évolutions sur l’éditeur, Gutenberg. Bien entendu, il sera aussi question de corriger un [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:30020:\"\n<p>La sortie de&nbsp;<strong>WordPress 5.4</strong>&nbsp;est prévue le 31 mars 2020 !&nbsp;<img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f499.png\" alt=\"💙\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Dirigée par Matt Mullenweg, coordonnée par Francesca Marano et en tout une équipe de direction de 8 personnes, la version 5.4 de WordPress proposera des améliorations techniques du CMS et de nombreuses évolutions sur l’éditeur, Gutenberg. Bien entendu, il sera aussi question de corriger un grand nombre de bugs et d&rsquo;effectuer des petites améliorations qui profiteront à tout un chacun.</p>\n\n\n\n<p>En tant qu’utilisatrice ou utilisateur, vous pourrez profiter de nouveaux blocs, de nombreuses améliorations de l&rsquo;éditeur, de nouveaux contenus embarqués (embeds), et d’amélioration de l’expérience d’administration de WordPress.</p>\n\n\n\n<p>En tant que développeuse ou développeur, WordPress 5.4 apportera&nbsp;<a href=\"https://core.trac.wordpress.org/query?type=enhancement&amp;type=feature+request&amp;milestone=5.4&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">122</a>&nbsp;améliorations et nouvelles fonctionnalités et <a href=\"https://core.trac.wordpress.org/query?type=defect+(bug)&amp;milestone=5.4&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">210</a>&nbsp;correctifs. Bien entendu, tout cela induit des changements de code dans le cœur du CMS, ce qui pourrait vous demander d’effectuer des modifications dans le code de votre site, de vos thèmes ou de vos extensions.</p>\n\n\n\n<p>Dans cet article, nous nous concentrerons justement sur les changements techniques majeurs de cette nouvelle version.</p>\n\n\n\n<span id=\"more-1536\"></span>\n\n\n\n<h2>Accessibilité</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;focuses=~accessibility&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=keywords&amp;order=priority\">14 modifications</a>&nbsp;liées à l’accessibilité dans WP 5.4, notons particulièrement des modifications sur l&rsquo;ordre de chargement de la barre d&rsquo;administration dans le DOM, sur les widgets Calendrier et Derniers commentaires, sur l&rsquo;écran de gestion des Menus, et des correctifs de bugs reportés par l’audit d’accessibilité effectué l&rsquo;année dernière par <a href=\"https://wpcampus.org/audit/\">WPCampus</a>.</p>\n\n\n\n<h2>Éditeur / Gutenberg</h2>\n\n\n\n<p>Le développement de l&rsquo;éditeur a continué son développement rapide depuis la version 5.0 de WordPress. Aujourd&rsquo;hui, la version 7.5 de Gutenberg a été intégrée dans WordPress 5.4, ce qui fait 10 versions de Gutenberg de différence avec la version qui avait été intégrée dans WordPress 5.3 en novembre dernier ! WordPress 5.4 comprend donc les versions <a href=\"https://make.wordpress.org/core/2019/10/02/whats-new-in-gutenberg-2-october/\">6.6</a>, <a href=\"https://make.wordpress.org/core/2019/10/16/whats-new-in-gutenberg-16-october/\">6.7</a>, <a href=\"https://make.wordpress.org/core/2019/10/30/whats-new-in-gutenberg-30-october/\">6.8</a>, <a href=\"https://make.wordpress.org/core/2019/11/13/whats-new-in-gutenberg-13-november/\">6.9</a>, <a href=\"https://make.wordpress.org/core/2019/11/27/whats-new-in-gutenberg-27-november/\">7.0</a>, <a href=\"https://make.wordpress.org/core/2019/12/11/whats-new-in-gutenberg-11-december/\">7.1</a>, <a href=\"https://make.wordpress.org/core/2020/01/09/whats-new-in-gutenberg-8-january/\">7.2</a>, <a href=\"https://make.wordpress.org/core/2020/01/22/whats-new-in-gutenberg-22-january/\">7.3</a>, <a href=\"https://make.wordpress.org/core/2020/02/05/whats-new-in-gutenberg-5-february/\">7.4</a>  et <a href=\"https://make.wordpress.org/core/2020/02/12/whats-new-in-gutenberg-12-february/\">7.5</a> de Gutenberg, et même des correctifs et améliorations de performances de la version <a href=\"https://make.wordpress.org/core/2020/02/26/whats-new-in-gutenberg-26-february/\">7.6</a> qui ont trouvé le moyen de se glisser discrètement dans WP 5.4 ! <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f60e.png\" alt=\"😎\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>L’article <a href=\"https://wordpress.org/news/2020/02/wordpress-5-4-beta-1/\">WordPress 5.4 Beta 1 (en anglais)</a> met en avant plusieurs des nouvelles fonctionnalités de l&rsquo;éditeur. Notons particulièrement que depuis WordPress 5.3, une réduction impressionnante du temps de chargement de l&rsquo;éditeur de 14 % a été rendue possible, et surtout une réduction du temps à attendre avant de pouvoir saisir du contenu de l&rsquo;ordre de 51 % !</p>\n\n\n\n<p>Ci-dessous, vous trouverez des liens vers des notes pour les développeur·euse·s, en anglais. Il s&rsquo;agit de changements concernant&nbsp;:</p>\n\n\n\n<h3>L&rsquo;ajout de deux nouveaux blocs&nbsp;: réseaux sociaux et ensemble de boutons</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"2NTN582pDm\"><a href=\"https://make.wordpress.org/core/2020/02/27/new-or-updated-blocks-in-wordpress-5-4/\">New Blocks in WordPress 5.4</a></blockquote><iframe title=\"&#8220;New Blocks in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/27/new-or-updated-blocks-in-wordpress-5-4/embed/#?secret=2NTN582pDm\" data-secret=\"2NTN582pDm\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Une mise à jour du composant <code>button</code></h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"mk8tJvOZto\"><a href=\"https://make.wordpress.org/core/2020/02/13/an-updated-button-component-in-wordpress-5-4/\">An updated Button component in WordPress 5.4</a></blockquote><iframe title=\"&#8220;An updated Button component in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/13/an-updated-button-component-in-wordpress-5-4/embed/#?secret=mk8tJvOZto\" data-secret=\"mk8tJvOZto\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Le mode plein écran maintenant activé par défaut dans l&rsquo;éditeur</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"my2UZdpvKd\"><a href=\"https://make.wordpress.org/core/2020/03/03/fullscreen-mode-enabled-by-default-in-the-editor/\">Fullscreen mode enabled by default in the editor</a></blockquote><iframe title=\"&#8220;Fullscreen mode enabled by default in the editor&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/03/fullscreen-mode-enabled-by-default-in-the-editor/embed/#?secret=my2UZdpvKd\" data-secret=\"my2UZdpvKd\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Les collections de blocs</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"BYrzIoQ0SR\"><a href=\"https://make.wordpress.org/core/2020/02/27/block-collections/\">Block Collections</a></blockquote><iframe title=\"&#8220;Block Collections&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/27/block-collections/embed/#?secret=BYrzIoQ0SR\" data-secret=\"BYrzIoQ0SR\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Des raccourcis clavier personnalisables</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"6CjdcZyw0T\"><a href=\"https://make.wordpress.org/core/2020/02/19/block-editor-keyboard-shortcuts-in-wordpress-5-4/\">Block Editor Keyboard Shortcuts in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Block Editor Keyboard Shortcuts in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/19/block-editor-keyboard-shortcuts-in-wordpress-5-4/embed/#?secret=6CjdcZyw0T\" data-secret=\"6CjdcZyw0T\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>La nouvelle API permettant de contrôler les variations de styles de blocs</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"bRNMKN0TQZ\"><a href=\"https://make.wordpress.org/core/2020/02/27/introduce-block-variations-api/\">New: the block variations API</a></blockquote><iframe title=\"&#8220;New: the block variations API&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/27/introduce-block-variations-api/embed/#?secret=bRNMKN0TQZ\" data-secret=\"bRNMKN0TQZ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>La nouvelle API permettant aux thèmes de contrôler l&rsquo;utilisation des dégradés CSS</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"3ZHQCbOFji\"><a href=\"https://make.wordpress.org/core/2020/03/02/new-gradient-theme-apis/\">New gradient theme APIs</a></blockquote><iframe title=\"&#8220;New gradient theme APIs&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/02/new-gradient-theme-apis/embed/#?secret=3ZHQCbOFji\" data-secret=\"3ZHQCbOFji\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Le tout nouveau package <code>@wordpress/create-block</code></h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"MUdiFGa3su\"><a href=\"https://make.wordpress.org/core/2020/02/28/new-wordpress-create-block-package-for-block-scaffolding/\">New @wordpress/create-block package for block scaffolding</a></blockquote><iframe title=\"&#8220;New @wordpress/create-block package for block scaffolding&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/28/new-wordpress-create-block-package-for-block-scaffolding/embed/#?secret=MUdiFGa3su\" data-secret=\"MUdiFGa3su\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Les changements de balisage et de styles CSS générés par l&rsquo;éditeur</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"EhdivLKc1s\"><a href=\"https://make.wordpress.org/core/2020/03/02/markup-and-style-related-changes/\">Markup and style-related changes</a></blockquote><iframe title=\"&#8220;Markup and style-related changes&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/02/markup-and-style-related-changes/embed/#?secret=EhdivLKc1s\" data-secret=\"EhdivLKc1s\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Les mises à jour générales de l’API de l&rsquo;éditeur</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"cQnR3xLr1V\"><a href=\"https://make.wordpress.org/core/2020/03/02/general-block-editor-api-updates/\">General Block Editor API Updates</a></blockquote><iframe title=\"&#8220;General Block Editor API Updates&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/02/general-block-editor-api-updates/embed/#?secret=cQnR3xLr1V\" data-secret=\"cQnR3xLr1V\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>L’outil de personnalisation (Customizer)</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Customize&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=owner&amp;col=type&amp;col=priority&amp;col=milestone&amp;order=priority\">14 modifications</a> de l’outil de personnalisation (appelé Customizer en anglais), notons principalement que WordPress 5.4 va grandement améliorer l’accessibilité des éléments sélectionnables (état <code>focus</code> notamment) dans la lignée des nombreuses améliorations déjà approtées par WordPress 5.3. Notons également l&rsquo;ajout de documentation concernant les fonctions et crochets (en anglais « hooks », il s&rsquo;agit des actions et filtres disponibles dans l&rsquo;API WordPress) existants, la suppression de la balise meta <code>apple-touch-icon-precomposed</code> qui est maintenant dépréciée, et l&rsquo;amélioration de la logique de sélection d&rsquo;éléments de menus.</p>\n\n\n\n<p>Veuillez noter que certaines classes PHP inutilisées par le cœur WordPress sont maintenant formellement dépréciées et ne devront donc plus être utilisées&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"xZtLy14mXx\"><a href=\"https://make.wordpress.org/core/2020/02/12/formal-deprecation-of-some-unused-customizer-classes-in-wordpress-5-4/\">Formal deprecation of some unused Customizer classes in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Formal deprecation of some unused Customizer classes in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/12/formal-deprecation-of-some-unused-customizer-classes-in-wordpress-5-4/embed/#?secret=xZtLy14mXx\" data-secret=\"xZtLy14mXx\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Menus</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Menus&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=type&amp;col=priority&amp;col=focuses&amp;col=keywords&amp;order=priority\">5 modifications</a>&nbsp;concernant le composant Menus, il convient de noter que WordPress 5.4 améliore l&rsquo;accessibilité au clavier du panneau de sélection des éléments qui iront dans vos menus, et que des améliorations de l&rsquo;interface ont été réalisées.</p>\n\n\n\n<p>Si vos extensions ajoutent des champs personnalisés aux éléments de menus, alors vous pourriez avoir besoin de mettre à jour votre code afin d’utiliser le nouveau crochet <code>wp_nav_menu_item_custom_fields</code>:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"nijtmI8vPD\"><a href=\"https://make.wordpress.org/core/2020/02/25/wordpress-5-4-introduces-new-hooks-to-add-custom-fields-to-menu-items/\">New hooks let you add custom fields to menu items</a></blockquote><iframe title=\"&#8220;New hooks let you add custom fields to menu items&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/25/wordpress-5-4-introduces-new-hooks-to-add-custom-fields-to-menu-items/embed/#?secret=nijtmI8vPD\" data-secret=\"nijtmI8vPD\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Confidentialité et données privées</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Privacy&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=type&amp;col=priority&amp;col=focuses&amp;col=keywords&amp;order=priority\">15 modifications</a> concernant ce composant de WordPress, voici les changements les plus notables :</p>\n\n\n\n<ul><li>Les exports de données personnelles incluent maintenant les jetons de session, les emplacements des évènements communautaires auxquels on s&rsquo;est intéressé dans le tableau de bord, leur localisation et – surtout – les métadonnées personnalisées des utilisateurs et utilisatrices.</li><li>Les exports de données personnelles incluent également un fichier JSON et une table des matières.</li><li>De nouveaux filtres sont disponibles pour modifier les en-têtes de tous les e-mails relatifs aux données privées.</li><li>Les tableaux de listing des demandes relatives aux données privées ont été améliorés.</li><li>La fonction <code>wp_get_user_request_data()</code> a été totalement remplacée par la fonction <code>wp_get_user_request()</code> pour une meilleure compréhension.</li></ul>\n\n\n\n<p>Toutes ces modifications sont détaillées dans une seule note de développement&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"dAZ0ZV3kAT\"><a href=\"https://make.wordpress.org/core/2020/03/02/privacy-updates-in-5-4/\">Privacy Updates in 5.4</a></blockquote><iframe title=\"&#8220;Privacy Updates in 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/02/privacy-updates-in-5-4/embed/#?secret=dAZ0ZV3kAT\" data-secret=\"dAZ0ZV3kAT\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Changements concernant l’API REST</h2>\n\n\n\n<p>Sur les <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=REST+API&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=type&amp;col=priority&amp;col=focuses&amp;col=keywords&amp;order=priority\">22 modifications</a>&nbsp;liées à l&rsquo;API REST, les points suivants sont particulièrement importants&nbsp;:</p>\n\n\n\n<ul><li>WordPress 5.4 prend maintenant en charge la valeur <code>OR</code> du paramètre <code>relation</code> des requêtes de taxonomies</li><li>Ajout de l&#8217;embarquement (embed) sélectif de liens</li><li>Modifications de la méthode <code style=\"font-size: 16px\">WP_REST_Server</code></li></ul>\n\n\n\n<p>Les modifications importantes de l&rsquo;API REST sont listées dans cet article&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"MhTK4AOGpc\"><a href=\"https://make.wordpress.org/core/2020/02/29/rest-api-changes-in-5-4/\">REST API Changes in 5.4</a></blockquote><iframe title=\"&#8220;REST API Changes in 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/29/rest-api-changes-in-5-4/embed/#?secret=MhTK4AOGpc\" data-secret=\"MhTK4AOGpc\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Codes courts / shortcodes</h3>\n\n\n\n<p>WordPress 5.4 va introduire <code>apply_shortcodes()</code> en tant qu&rsquo;alias de <code>do_shortcode()</code>. Les développeuses et développeurs sont invités à utiliser la nouvelle fonction. L&rsquo;ancienne restera toutefois conservée pour assurer la rétro-compatibilité.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"8NM6hMeUZT\"><a href=\"https://make.wordpress.org/core/2020/02/13/wordpress-5-4-introduces-apply-shortcodes-as-an-alias-for-do-shortcode/\">WordPress 5.4 introduces apply_shortcodes() as an alias for do_shortcode()</a></blockquote><iframe title=\"&#8220;WordPress 5.4 introduces apply_shortcodes() as an alias for do_shortcode()&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/13/wordpress-5-4-introduces-apply-shortcodes-as-an-alias-for-do-shortcode/embed/#?secret=8NM6hMeUZT\" data-secret=\"8NM6hMeUZT\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Widgets</h2>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;component=Widgets&amp;milestone=5.4&amp;col=id&amp;col=summary&amp;col=status&amp;col=type&amp;col=priority&amp;col=focuses&amp;col=keywords&amp;order=priority\">9 modifications</a>&nbsp;concernant les Widgets, WordPress 5.4 améliore l&rsquo;accessibilité et l&rsquo;ergonomie de l&rsquo;écran de gestion des Widgets et introduit des modifications sur les Widgets Derniers commentaires et Calendrier.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"zzVyhi6nOU\"><a href=\"https://make.wordpress.org/core/2020/02/12/changes-related-to-calendar-widget-markup-in-wordpress-5-4/\">Changes related to Calendar Widget markup in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Changes related to Calendar Widget markup in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/12/changes-related-to-calendar-widget-markup-in-wordpress-5-4/embed/#?secret=zzVyhi6nOU\" data-secret=\"zzVyhi6nOU\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Autres modifications à destination des développeur·euse·s</h2>\n\n\n\n<h3>Simplification de la mise en place d&rsquo;environnements de développement en local sur WordPress</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"KBWeyVMK0l\"><a href=\"https://make.wordpress.org/core/2020/03/03/wp-env-simple-local-environments-for-wordpress/\">wp-env: Simple Local Environments for WordPress.</a></blockquote><iframe title=\"&#8220;wp-env: Simple Local Environments for WordPress.&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/03/03/wp-env-simple-local-environments-for-wordpress/embed/#?secret=KBWeyVMK0l\" data-secret=\"KBWeyVMK0l\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Modification sur le traitement des requêtes d&rsquo;affichage de favicons</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"r61Qy7GJml\"><a href=\"https://make.wordpress.org/core/2020/02/19/enhancements-to-favicon-handling-in-wordpress-5-4/\">Enhancements to favicon handling in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Enhancements to favicon handling in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/19/enhancements-to-favicon-handling-in-wordpress-5-4/embed/#?secret=r61Qy7GJml\" data-secret=\"r61Qy7GJml\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Et pour finir, un petit florilège de modifications diverses et variées</h2>\n\n\n\n<p>Un article regroupe également des modifications importantes variées, dont  notamment&nbsp;:</p>\n\n\n\n<ul><li>Une meilleure information sur les erreurs au niveau de <code style=\"font-size: 16px\">wp_login_failed</code></li><li>L&rsquo;ajout de l&rsquo;ID du site dans le filtre multisite <code style=\"font-size: 16px\">newblog_notify_siteadmin</code></li><li>Un nouvel embed vidéo pour TikTok</li><li>La suppression de l&#8217;embed CollegeHumor</li><li>Le stockage de l&rsquo;URL d&rsquo;origine des médias attachés dans la méta <code style=\"font-size: 16px\">_source_url</code> </li><li>Le chargement de la barre d&rsquo;administration en utilisant <code style=\"font-size: 16px\">wp_body_open</code></li><li>La suppression des ID dupliqués dans le widget Derniers commentaires</li><li>Un nouveau paramètre dans l&rsquo;action <code style=\"font-size: 16px\">lostpassword_post</code> de <code style=\"font-size: 16px\">retrieve_password()</code></li><li>Les en-têtes de thèmes prennent maintenant en charge les instructions  “Requires at least” et “Requires PHP”</li><li>La capacité <code style=\"font-size: 16px\">delete_posts</code> ne déclenchera plus d&rsquo;avertissements PHP pour les types de publications personnalisés</li></ul>\n\n\n\n<p>Tout est détaillé en anglais sur cette note de développement&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"GTxbJT1rBG\"><a href=\"https://make.wordpress.org/core/2020/02/26/miscellaneous-developer-focused-changes-in-wordpress-5-4/\">Miscellaneous Developer Focused Changes in WordPress 5.4</a></blockquote><iframe title=\"&#8220;Miscellaneous Developer Focused Changes in WordPress 5.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2020/02/26/miscellaneous-developer-focused-changes-in-wordpress-5-4/embed/#?secret=GTxbJT1rBG\" data-secret=\"GTxbJT1rBG\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p>Pour rappel, la sortie de WordPress 5.4 est prévue le 31 mars 2020. Vous pouvez d’ores et déjà la tester en version <em>Release Candidate</em> en installant l’extension officielle WordPress Beta Tester puis en allant dans ses réglages et en cochant la case <em>« Beta »</em> / version de développement puis en mettant à jour votre installation de façon classique.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-plugin-directory\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"iswXokV2Ox\"><a href=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a></blockquote><iframe title=\"« WordPress Beta Tester » &#8212; Plugin Directory\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/embed/#?secret=iswXokV2Ox\" data-secret=\"iswXokV2Ox\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p></p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://fr.wordpress.org/2020/03/04/les-changements-techniques-a-venir-dans-wordpress-5-4/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"14\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:3;a:6:{s:4:\"data\";s:74:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:8:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:26:\"WordPress 5.3 « Kirk »\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:55:\"https://fr.wordpress.org/2019/11/13/wordpress-5-3-kirk/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:63:\"https://fr.wordpress.org/2019/11/13/wordpress-5-3-kirk/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 13 Nov 2019 08:36:45 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1493\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:111:\"Nommée «Kirk» en l\'honneur du jazzman Rahsaan Roland Kirk, WordPress 5.3 est disponible en téléchargement.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:9:\"enclosure\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"url\";s:55:\"https://wordpress.org/news/files/2019/11/navigation.mp4\";s:6:\"length\";s:7:\"3382373\";s:4:\"type\";s:9:\"video/mp4\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:59153:\"\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/5.3-album-cover.png\" alt=\"\" class=\"wp-image-1494\" srcset=\"https://fr.wordpress.org/files/2019/11/5.3-album-cover.png 768w, https://fr.wordpress.org/files/2019/11/5.3-album-cover-300x300.png 300w, https://fr.wordpress.org/files/2019/11/5.3-album-cover-150x150.png 150w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<p style=\"background-color:#bd3854;color:#ffffff\" class=\"has-text-color has-background has-medium-font-size\">Une expérience éditoriale soignée avec l’éditeur amélioré de WordPress 5.3&nbsp;!<br>Nommée «&nbsp;Kirk&nbsp;» en l&rsquo;honneur du multi-instrumentaliste de jazz Rahsaan Roland Kirk, la dernière version de WordPress est disponible en téléchargement.</p>\n\n\n\n<span id=\"more-1493\"></span>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/divider.png\" alt=\"\" class=\"wp-image-1497\" srcset=\"https://fr.wordpress.org/files/2019/11/divider.png 768w, https://fr.wordpress.org/files/2019/11/divider-300x76.png 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<p>5.3 développe et affine l’éditeur introduit dans WordPress 5.0 avec un nouveau bloc, des interactions plus intuitives et une accessibilité améliorée.</p>\n\n\n\n<p>Les nouvelles fonctionnalités de l’éditeur augmentent la liberté de conception, fournissent des options de mise en page supplémentaires et des variations de styles permettant aux concepteurs de contrôler totalement l’apparence de leur site. </p>\n\n\n\n<p>Cette version introduit également le thème Twenty Twenty, offrant à l’utilisateur plus de flexibilité de conception et d’intégration avec l&rsquo;éditeur. Créer de belles pages web et des mises en page avancées n’a jamais été aussi simple.</p>\n\n\n\n<h2>Des améliorations de l’éditeur de blocs et de l&rsquo;ergonomie du back- office</h2>\n\n\n\n<figure class=\"wp-block-video\"><video controls muted src=\"https://wordpress.org/news/files/2019/11/navigation.mp4\"></video></figure>\n\n\n\n<p>Cette mise à jour focalisée sur les améliorations introduit plus de 150 nouvelles fonctionnalités et améliorations d’utilisabilité, comme la prise en charge des grandes images pour téléverser les images de haute résolution prises avec votre téléphone ou avec d’autre appareils de haute résolution. En combinaison avec l’utilisation de tailles d’images plus larges, vos photos seront le mieux traitées possible.</p>\n\n\n\n<p>Les améliorations d’accessibilité incluent l’intégration des styles de l’éditeur dans l’interface d’administration. Ces améliorations corrigent de nombreux problèmes d’accessibilité&nbsp;: contrastes des couleurs sur les champs de formulaires et sur les boutons, cohérence entre l’éditeur et les écrans d’administration, nouvelles notices affichées à la volée, standardisation du jeu de couleurs par défaut de WordPress, et l’introduction d’animations pour rendre l’interaction avec les blocs plus élégante et naturelle. </p>\n\n\n\n<p>Pour les personnes utilisant un clavier pour naviguer sur l’administration, l’éditeur dispose maintenant d’un mode de navigation. Cela permet de sauter d’un bloc à l’autre sans tabuler à travers l’ensemble des éléments de chaque bloc.</p>\n\n\n\n<h2>Une flexibilité de conception étendue</h2>\n\n\n\n<p>WordPress 5.3 ajoute des outils toujours plus robustes pour concevoir de beaux sites.</p>\n\n\n\n<ul><li>Le nouveau bloc Groupe vous permet de diviser facilement votre page en sections colorées</li><li>Le bloc des colonnes prend maintenant en charge les largeurs fixes de colonnes</li><li>Les nouvelles mises en page prédéfinies transforment en jeu d&rsquo;enfant l’organisation du contenu dans des conceptions avancées</li><li>Le bloc Titre dispose maintenant d’un sélecteur de couleur de texte</li><li>Des options de style supplémentaires vous permettent de définir votre style préféré pour n&rsquo;importe quel bloc qui prend en charge cette fonctionnalité</li></ul>\n\n\n\n<h2>Arrivée de Twenty Twenty</h2>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/twentytwenty-desktop.png\" alt=\"\" class=\"wp-image-1498\" srcset=\"https://fr.wordpress.org/files/2019/11/twentytwenty-desktop.png 768w, https://fr.wordpress.org/files/2019/11/twentytwenty-desktop-300x297.png 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-medium\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/twentytwenty-mobile-267x300.png\" alt=\"\" class=\"wp-image-1499\" srcset=\"https://fr.wordpress.org/files/2019/11/twentytwenty-mobile-267x300.png 267w, https://fr.wordpress.org/files/2019/11/twentytwenty-mobile.png 768w\" sizes=\"(max-width: 267px) 100vw, 267px\" /></figure></div>\n\n\n\n<p>Le nouvel éditeur fêtant son premier anniversaire, il est appréciable que l’idée directrice de Twenty Twenty soit la flexibilité. Montrez vos services ou vos produits avec des combinaisons de colonnes, de groupes et de blocs médias. Mettez en place vos contenus en grande ou même pleine largeur pour des mises en page dynamiques et attirantes… ou laissez vos réflexions prendre toute la place avec une simple colonne de contenu centrée&nbsp;!</p>\n\n\n\n<p>Ce thème nommé «&nbsp;Twenty Twenty&nbsp;» le mérite bien&nbsp;: la clarté et la lisibilité sont aussi de grandes priorités. Le thème inclut la police&nbsp;<a href=\"https://rsms.me/inter/\">Inter</a>, conçue par Rasmus Andersson. «&nbsp;Inter&nbsp;» est implémentée sous la forme d’une police variable, une première pour un thème par défaut. Cela améliore les temps de chargement car cette police contient toutes les tailles et toutes les variations de styles en seulement deux fichiers.</p>\n\n\n\n<h2>Improvements for Everyone</h2>\n\n\n\n<h3>Rotation automatique des images</h3>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-thumbnail is-resized\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/Rotate-150x150.png\" alt=\"\" class=\"wp-image-1501\" width=\"75\" height=\"75\" srcset=\"https://fr.wordpress.org/files/2019/11/Rotate-150x150.png 150w, https://fr.wordpress.org/files/2019/11/Rotate.png 300w\" sizes=\"(max-width: 75px) 100vw, 75px\" /></figure></div>\n\n\n\n<p>Vos images seront correctement orientées lors du téléversement en fonction des données d’orientation embarquées dans le fichier. Cette fonctionnalité a été proposée pour la première fois il y a neuf ans, et son implémentation a été rendue possible grâce à la persévérance de plusieurs contributrices et contributeurs passionné·e·s.</p>\n\n\n\n<h3>Vérifications de l’état de santé du site</h3>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-thumbnail is-resized\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/Health-150x150.png\" alt=\"\" class=\"wp-image-1507\" width=\"75\" height=\"75\" srcset=\"https://fr.wordpress.org/files/2019/11/Health-150x150.png 150w, https://fr.wordpress.org/files/2019/11/Health.png 300w\" sizes=\"(max-width: 75px) 100vw, 75px\" /></figure></div>\n\n\n\n<p>Les améliorations introduites dans 5.3 rendent encore plus facile l’identification des problèmes. Les recommandations qui nécessiteraient un dépannage sont mises en avant sur l’écran «&nbsp;Santé de votre site&nbsp;».</p>\n\n\n\n<h3>Vérification de l’e-mail d’administration</h3>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright size-thumbnail is-resized\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/Email-150x150.png\" alt=\"\" class=\"wp-image-1508\" width=\"75\" height=\"75\" srcset=\"https://fr.wordpress.org/files/2019/11/Email-150x150.png 150w, https://fr.wordpress.org/files/2019/11/Email.png 300w\" sizes=\"(max-width: 75px) 100vw, 75px\" /></figure></div>\n\n\n\n<p>Il vous sera dorénavant périodiquement demandé de confirmer que votre adresse de messagerie est à jour quand vous vous connectez en tant qu’administrateur. Cela réduit le risque de verrouillage sans pouvoir accéder à votre site si vous changez d’adresse de messagerie.</p>\n\n\n\n<h2>Pour les développeuses et les développeurs</h2>\n\n\n\n<h3>Correctifs sur le composant date/heure</h3>\n\n\n\n<p>Les développeurs et développeuses peuvent maintenant mieux travailler avec les&nbsp;<a href=\"https://make.wordpress.org/core/2019/09/23/date-time-improvements-wp-5-3/\">dates et fuseaux horaires</a>. La fonctionnalité de gestion de la date et de l’heure a reçue quantité de nouvelles fonctions API pour unifier l’utilisation des fuseaux horaires, pour améliorer l’intéropérabilité PHP ainsi que plusieurs correctifs et améliorations diverses.</p>\n\n\n\n<h3>Compatibilité PHP 7.4</h3>\n\n\n\n<p>WordPress 5.3 vise à prendre en charge totalement PHP 7.4. Cette version contient de&nbsp;<a href=\"https://make.wordpress.org/core/2019/10/11/wordpress-and-php-7-4/\">multiples modifications</a>&nbsp;pour retirer les fonctionnalités dépréciées et assurer la compatibilité. WordPress continue d’encourager ses utilisatrices et utilisateurs à faire tourner leurs sites sur la dernière et la meilleure version de PHP.</p>\n\n\n\n<p>Si vous cherchez des informations plus techniques sur les évolutions de WordPress 5.3, n&rsquo;oubliez pas de <a href=\"https://fr.wordpress.org/2019/10/24/les-changements-a-venir-dans-wordpress-5-3/\">consulter notre article dédié</a>.</p>\n\n\n\n<figure class=\"wp-block-image size-large\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/11/divider.png\" alt=\"\" class=\"wp-image-1497\" srcset=\"https://fr.wordpress.org/files/2019/11/divider.png 768w, https://fr.wordpress.org/files/2019/11/divider-300x76.png 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<h2>L&rsquo;équipe derrière WP 5.3</h2>\n\n\n\n<p>Cette version de WordPress a été coordonnée par <a href=\"http://ma.tt/\">Matt Mullenweg</a>,&nbsp;<a href=\"https://profiles.wordpress.org/francina\">Francesca Marano</a> et&nbsp;<a href=\"https://dream-encode.com/blog/\">David Baumwald</a>. Ils ont été soutenu par une équipe de direction élargie&nbsp;:</p>\n\n\n\n<ul><li><strong>Éditeur (technique) :</strong> Riad Benguella (<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://profiles.wordpress.org/youknowriad/\"><strong>@youknowriad</strong></a>)</li><li><strong>Éditeur (Design) :</strong> Mark Uraine (<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://profiles.wordpress.org/mapk/\"><strong>@mapk</strong></a>)</li><li><strong>Cœur WP (technique) :</strong> Andrew Ozz (<a rel=\"noreferrer noopener\" target=\"_blank\" href=\"https://profiles.wordpress.org/azaozz/\"><strong>@azaozz</strong></a>)</li><li><strong>Documentation&nbsp;:</strong>&nbsp;Justin Ahinon (<a href=\"https://profiles.wordpress.org/justinahinon/\"><strong>@justinahinon</strong></a>)</li><li><strong>Marketing/communication&nbsp;:</strong>&nbsp;Mike Reid (<a href=\"https://profiles.wordpress.org/mikerbg/\"><strong>@mikerbg</strong></a>)</li><li><strong>Bibliothèque de médias (cœur) :</strong>&nbsp;Mike Schroder (<a href=\"https://profiles.wordpress.org/mikeschroder/\"><strong>@mikeschroder</strong></a>)</li><li><strong>Accessibilité (cœur) :</strong>&nbsp;Jean-Baptiste Audras (<a href=\"https://profiles.wordpress.org/audrasjb/\"><strong>@audrasjb</strong></a>)</li><li><strong>Twenty Twenty (technique)&nbsp;:</strong> Ian Belanger (<a href=\"https://profiles.wordpress.org/ianbelanger/\"><strong>@ianbelanger</strong></a>)</li><li><strong>Twenty Twenty (design)&nbsp;:</strong> Anders Norén (<a href=\"https://profiles.wordpress.org/anlino/\"><strong>@anlino</strong></a>)</li></ul>\n\n\n\n<p>Cette équipe de direction a été épaulée pendant les douze semaines du cycle de développement de WordPress 5.3 par 645 contributrices et contributeurs qui se sont collectivement occupé de 658 bugs, améliorations et tâches diverses pour mener à bien ce projet&nbsp;!</p>\n\n\n\n<p>Il s&rsquo;agit de la version de WordPress ayant accueilli le plus grand nombre de contributrices et contributeurs à date&nbsp;<img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f44f.png\" alt=\"👏\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Lancez une playlist du jazzman Rahsaan Roland Kirk (facilement trouvable sur Youtube ou autre), cliquez sur le bouton de mise à jour de WordPress, et profitez-en pour consulter la liste de toutes les personnes ayant contribué à WordPress 5.3. Sans toutes ces personnes, notre CMS favori ne pourrait tout simplement pas exister <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f499.png\" alt=\"💙\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p><a href=\"https://profiles.wordpress.org/123host/\">123host</a>, <a href=\"https://profiles.wordpress.org/1994rstefan/\">1994rstefan</a>, <a href=\"https://profiles.wordpress.org/5hel2l2y/\">5hel2l2y</a>, <a href=\"https://profiles.wordpress.org/irsdl/\">@irsdl</a>, <a href=\"https://profiles.wordpress.org/aaroncampbell/\">Aaron D. Campbell</a>, <a href=\"https://profiles.wordpress.org/jorbin/\">Aaron Jorbin</a>, <a href=\"https://profiles.wordpress.org/aksdvp/\">Aashish S</a>, <a href=\"https://profiles.wordpress.org/abhijitrakas/\">Abhijit Rakas</a>, <a href=\"https://profiles.wordpress.org/abrightclearweb/\">abrightclearweb