<a href=\"https://profiles.wordpress.org/vortfu/\">vortfu</a>, <a href=\"https://profiles.wordpress.org/svovaf/\">Vova Feldman</a>, <a href=\"https://profiles.wordpress.org/vrimill/\">vrimill</a>, <a href=\"https://profiles.wordpress.org/w3rkjana/\">w3rkjana</a>, <a href=\"https://profiles.wordpress.org/webdados/\">Webdados (Marco Almeida)</a>, <a href=\"https://profiles.wordpress.org/webmandesign/\">WebMan Design | Oliver Juhas</a>, <a href=\"https://profiles.wordpress.org/westonruter/\">Weston Ruter</a>, <a href=\"https://profiles.wordpress.org/earnjam/\">William Earnhardt</a>, <a href=\"https://profiles.wordpress.org/wpdavis/\">William P. Davis</a>, <a href=\"https://profiles.wordpress.org/williampatton/\">William Patton</a>, <a href=\"https://profiles.wordpress.org/withinboredom/\">withinboredom</a>, <a href=\"https://profiles.wordpress.org/worldweb/\">worldweb</a>, <a href=\"https://profiles.wordpress.org/yanngarcia/\">yanngarcia</a>, <a href=\"https://profiles.wordpress.org/collet/\">Yannicki</a>, <a href=\"https://profiles.wordpress.org/yarnboy/\">yarnboy</a>, <a href=\"https://profiles.wordpress.org/yashar_hv/\">yashar_hv</a>, <a href=\"https://profiles.wordpress.org/yoavf/\">Yoav Farhi</a>, <a href=\"https://profiles.wordpress.org/yodiyo/\">yodiyo</a>, <a href=\"https://profiles.wordpress.org/fierevere/\">Yui</a>, <a href=\"https://profiles.wordpress.org/yvettesonneveld/\">Yvette Sonneveld</a>, <a href=\"https://profiles.wordpress.org/zaantar/\">zaantar</a>, <a href=\"https://profiles.wordpress.org/zalak151291/\">zalak151291</a>, <a href=\"https://profiles.wordpress.org/zebulan/\">Zebulan Stanphill</a>, <a href=\"https://profiles.wordpress.org/chesio/\">Česlav Przywara</a>, <a href=\"https://profiles.wordpress.org/airathalitov/\">Айрат Халитов</a>, and <a href=\"https://profiles.wordpress.org/ounziw/\">水野史土</a>.</p>\n\n\n\n<p>Nous remercions également nos bénévoles adorés des forums d&rsquo;entraide, et notamment le <a href=\"https://wpfr.net/support\">forum de l&rsquo;association WPFR</a>.</p>\n\n\n\n<p>Si vous voulez en savoir plus sur la contribution à WordPress, nous vous invitons à <a href=\"https://wpfr.net/slack\">rejoindre le Slack WordPress Français (inscription libre et gratuite)</a> et à nous rejoindre sur le canal <code>#contribution</code>.</p>\n\n\n\n<p>Pour vous tenir au courant de tous les développements en cours et à venir du CMS, nous vous invitons à <a href=\"https://make.wordpress.org/core\">consulter le blog de l&rsquo;équipe de développement de WordPress (en anglais)</a>.</p>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p class=\"has-text-align-center has-medium-font-size\">Merci d’avoir choisi WordPress <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"💚\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://i0.wp.com/wordpress.org/news/files/2019/11/image.png?fit=632%2C414&amp;ssl=1\" alt=\"\" class=\"wp-image-7755\" /></figure>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:60:\"https://fr.wordpress.org/2019/11/13/wordpress-5-3-kirk/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:4;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:64:\"Questionnaire annuel officiel sur votre utilisation de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:101:\"https://fr.wordpress.org/2019/11/04/questionnaire-annuel-officiel-sur-votre-utilisation-de-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:109:\"https://fr.wordpress.org/2019/11/04/questionnaire-annuel-officiel-sur-votre-utilisation-de-wordpress/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Mon, 04 Nov 2019 08:41:03 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:23:\"Questionnaires/sondages\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1487\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:421:\"Comme chaque année, l&#8217;équipe « Community » de WordPress lance son questionnaire à destination des utilisatrices et utilisateurs de WordPress afin de mieux les connaître et de comprendre leurs besoins. La nouveauté du questionnaire de cette année, c&#8217;est qu&#8217;il a été traduit en français&#160;! Ainsi, l&#8217;anglais n&#8217;est plus une barrière pour y répondre 🙂 Cela ne vous [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:1219:\"\n<p>Comme chaque année, l&rsquo;équipe « Community » de WordPress lance son questionnaire à destination des utilisatrices et utilisateurs de WordPress afin de mieux les connaître et de comprendre leurs besoins.</p>\n\n\n\n<p>La nouveauté du questionnaire de cette année, c&rsquo;est qu&rsquo;il a été traduit en français&nbsp;! Ainsi, l&rsquo;anglais n&rsquo;est plus une barrière pour y répondre <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Cela ne vous prendra que quelques minutes, merci d&rsquo;avance&nbsp;!</p>\n\n\n\n<div class=\"wp-block-button\"><a class=\"wp-block-button__link has-background\" href=\"https://wordpressdotorg.survey.fm/wordpress-2019-survey-french\" style=\"background-color:#1e769b\">Répondre au questionnaire</a></div>\n\n\n\n<p>Les résultats du questionnaire seront publiés au premier trimestre 2020. Toutes les données personnelles sont anonymisées : les adresses e-mail et adresses IP sont automatiquement dissociées des données collectées. Pour en savoir plus, vous pouvez consulter notre <a href=\"https://fr.wordpress.org/about/privacy/\">politique de confidentialité</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:106:\"https://fr.wordpress.org/2019/11/04/questionnaire-annuel-officiel-sur-votre-utilisation-de-wordpress/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:5;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:43:\"Les changements à venir dans WordPress 5.3\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:79:\"https://fr.wordpress.org/2019/10/24/les-changements-a-venir-dans-wordpress-5-3/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:88:\"https://fr.wordpress.org/2019/10/24/les-changements-a-venir-dans-wordpress-5-3/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 24 Oct 2019 09:32:57 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1457\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:380:\"La sortie de WordPress 5.3 est prévue le 12 novembre 2019 ! 💚 Dirigée par Matt Mullenweg, coordonnée par Francesca Marano et comptant pas moins de 3 contributeurs de la communauté francophone sur les 11 personnes de l&#8217;équipe de direction de cette version, la version 5.3 de WordPress sera axée autour d&#8217;améliorations graphiques de l&#8217;interface [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:39853:\"\n<p>La sortie de <strong>WordPress 5.3</strong> est prévue le 12 novembre 2019 ! <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"💚\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Dirigée par Matt Mullenweg, coordonnée par Francesca Marano et comptant pas moins de 3 contributeurs de la communauté francophone sur les 11 personnes de l&rsquo;équipe de direction de cette version, la version 5.3 de WordPress sera axée autour d&rsquo;améliorations graphiques de l&rsquo;interface d&rsquo;administration de WP, d&rsquo;améliorations techniques à destination des développeurs et de l&rsquo;évolution de l&rsquo;éditeur Gutenberg.</p>\n\n\n\n<p>Sans oublier les centaines de correctifs de bugs et petites améliorations diverses associées. Au total, ce sont donc&nbsp;<a href=\"https://core.trac.wordpress.org/query?type=enhancement&amp;type=feature+request&amp;milestone=5.3&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">157</a>&nbsp;améliorations et nouvelles fonctionnalités et&nbsp;<a href=\"https://core.trac.wordpress.org/query?type=defect+(bug)&amp;milestone=5.3&amp;max=500&amp;col=id&amp;col=summary&amp;col=type&amp;col=milestone&amp;col=owner&amp;col=status&amp;col=priority&amp;order=priority\">366</a>&nbsp;corrections de bugs&nbsp;!</p>\n\n\n\n<p>Dans cet article, nous vous proposons de parcourir les principaux changements à venir sur WordPress 5.3. En plus d&rsquo;un panorama complet des modifications prévues, des liens vous sont proposés vers les notes de développement officielles de chaque évolution ou modification majeure.</p>\n\n\n\n<span id=\"more-1457\"></span>\n\n\n\n<h2>Twenty Twenty, le nouveau thème par défaut de WordPress&nbsp;!</h2>\n\n\n\n<p>Nous reviendrons plus en détails sur ce nouveau thème dans un prochain article sur <em>fr.wordpress.org</em>, mais le travail réalisé est vraiment séduisant&nbsp;!</p>\n\n\n\n<p>Ce thème est clairement conçu comme une vitrine des nouvelles fonctionnalités proposées par l&rsquo;éditeur Gutenberg. Il utilise une police variable (une première pour un thème natif de WordPress), améliorant grandement les performances de chargement. Le thème peut très facilement être adapté pour des besoins très différents, et il existe déjà de nombreux exemples de sites qui l&rsquo;utilisent en version beta.</p>\n\n\n\n<p>Nous vous proposerons un panorama complet des fonctionnalités de Twenty Twenty dans un prochain article <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<h2>Accessibilité</h2>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?focuses=~accessibility&amp;milestone=5.3&amp;group=component&amp;max=500&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=id\">50 tickets</a>&nbsp;liés à l&rsquo;accessibilité traités sur WP 5.3, les changements les plus notables concernent les évolutions CSS de l&rsquo;interface d&rsquo;administration, les améliorations des formulaires contenus dans la bibliothèque de médias, l&rsquo;ajout de l&rsquo;attribut&nbsp;<code>aria-current=\"page\"</code>&nbsp;sur les widgets qui le nécessitent, et l&rsquo;ajout automatique d&rsquo;attributs&nbsp;<code>aria-label</code>&nbsp;pour certains menus de navigation qui le nécessitent.</p>\n\n\n\n<p>Nous vous invitons à lire les notes de développement concernant ces modifications. Vous les trouverez listées ci-dessous.</p>\n\n\n\n<h3>Évolution des CSS de l&rsquo;interface d&rsquo;administration</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"wa03VhNG1x\"><a href=\"https://make.wordpress.org/core/2019/10/18/noteworthy-admin-css-changes-in-wordpress-5-3/\">Noteworthy Admin CSS changes in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Noteworthy Admin CSS changes in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/18/noteworthy-admin-css-changes-in-wordpress-5-3/embed/#?secret=wa03VhNG1x\" data-secret=\"wa03VhNG1x\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>À noter que ces changements CSS sur l&rsquo;interface d&rsquo;administration ont fait l&rsquo;objet d&rsquo;une campagne de test des extensions les plus populaires du dépôt WordPress.org afin de s&rsquo;assurer que celles-ci n&rsquo;introduisent pas de problèmes de compatibilité majeurs sur les extensions existantes. Les résultats de ces tests ont été consignés dans cet article (en anglais)&nbsp;: </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"M7iaIFVkeu\"><a href=\"https://make.wordpress.org/core/2019/10/15/report-wp-5-3-admin-css-changes-tested-against-top-20-plugins/\">Report: WP 5.3 Admin CSS changes tested against top 20 plugins</a></blockquote><iframe title=\"&#8220;Report: WP 5.3 Admin CSS changes tested against top 20 plugins&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/report-wp-5-3-admin-css-changes-tested-against-top-20-plugins/embed/#?secret=M7iaIFVkeu\" data-secret=\"M7iaIFVkeu\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Pour résumer, les auteurs d&rsquo;extensions, de thèmes, ainsi que les développeuses et développeurs sont invités à&nbsp;:</p>\n\n\n\n<ul><li>Ne pas utiliser de hauteur fixe sur les éléments de formulaires dans l&rsquo;administration de WP&nbsp;: les hauteurs flexibles font partie des standards de code pour WordPress (et l&rsquo;un des buts principaux de ces changements CSS à venir sur 5.3).</li><li>Ne pas utiliser de valeur personnalisée pour le <code>padding</code> haut et bas des éléments de formulaires (celui-ci est flexible et calculé automatiquement en fonction du contenu).</li><li>Ne pas utiliser de valeur personnalisée pour le <code>line-height</code> (interlignage).</li><li>Si vous surchargez les styles des boutons pour leur donner une couleur d&rsquo;arrière-plan différente, pensez à mettre à jour leur CSS pour surcharger également leur état <code>focus</code> et <code>hover</code>.</li></ul>\n\n\n\n<h3>Attribut aria-current dans les widgets</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"caDJ3LJndK\"><a href=\"https://make.wordpress.org/core/2019/09/23/core-widgets-new-aria-current-attribute-in-wordpress-5-3/\">Core Widgets: new aria-current attribute in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Core Widgets: new aria-current attribute in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/23/core-widgets-new-aria-current-attribute-in-wordpress-5-3/embed/#?secret=caDJ3LJndK\" data-secret=\"caDJ3LJndK\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Attribut aria-label dans la navigation entre page/articles/commentaires et types de publications personnalisés</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"uiJaRaUrtV\"><a href=\"https://make.wordpress.org/core/2019/10/15/use-aria-label-to-ensure-posts-and-comments-navigation-has-proper-context-in-wordpress-5-3/\">Use aria-label to ensure Posts and Comments navigation has proper context in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Use aria-label to ensure Posts and Comments navigation has proper context in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/use-aria-label-to-ensure-posts-and-comments-navigation-has-proper-context-in-wordpress-5-3/embed/#?secret=uiJaRaUrtV\" data-secret=\"uiJaRaUrtV\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Éditeur (Gutenberg)</h2>\n\n\n\n<p>L&rsquo;éditeur de WordPress a continué ses cycles d&rsquo;itérations commencés avec WP 5.0. WordPress 5.3 intégrera la version 6.5 de Gutenberg, ce qui fait que <strong>douze</strong> nouvelles versions de Gutenberg seront directement intégrées dans WP 5.3 (les versions&nbsp;<a href=\"https://make.wordpress.org/core/2019/04/03/whats-new-in-gutenberg-3rd-april/\">5.4</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/04/17/whats-new-in-gutenberg-17th-april/\">5.5</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/05/01/whats-new-in-gutenberg-1st-may/\">5.6</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/05/15/whats-new-in-gutenberg-15th-may/\">5.7</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/05/29/whats-new-in-gutenberg-29th-may/\">5.8</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/06/12/whats-new-in-gutenberg-12th-june/\">5.9</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/06/26/whats-new-in-gutenberg-26th-june/\">6.0</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/07/10/whats-new-in-gutenberg-10-july/\">6.1</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/07/31/whats-new-in-gutenberg-31-july/\">6.2</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/08/14/whats-new-in-gutenberg-14-august/\">6.3</a>,&nbsp;<a href=\"https://make.wordpress.org/core/2019/08/28/whats-new-in-gutenberg-28-august/\">6.4</a>, et&nbsp;<a href=\"https://make.wordpress.org/core/2019/09/19/whats-new-in-gutenberg-18-september/\">6.5</a>).</p>\n\n\n\n<p>Les correctifs de bugs et améliorations de performances des versions &nbsp;<a href=\"https://make.wordpress.org/core/2019/10/02/whats-new-in-gutenberg-2-october/\">6.6</a>&nbsp;et&nbsp;<a href=\"https://make.wordpress.org/core/2019/10/16/whats-new-in-gutenberg-16-october/\">6.7</a>&nbsp;seront également intégrés.</p>\n\n\n\n<p>Les changements majeurs&nbsp;:</p>\n\n\n\n<ul><li>Le temps de chargement pour un article « géant » de 36 000 mots et environ 1000 blocs se charge maintenant en 1,5 secondes</li><li>Une nouvelle API pour gérer les variations de styles des blocs côté serveur (en PHP donc)</li><li>Le bloc groupe/section, permettant de définir différentes sections dans une publication et par exemple de leur appliquer un arrière-plan commun et de les manipuler ensemble</li><li>Améliorations sur l&rsquo;accessibilité de l&rsquo;éditeur afin de corriger les problèmes remontés par l&rsquo;audit indépendant d&rsquo;accessibilité de Gutenberg réalisé au printemps 2019, avec notamment le mode « navigation » permettant une navigation clavier bien plus performante</li><li>Améliorations sur le HTML/CSS généré par l&rsquo;éditeur : noms de classes, gestion de l&rsquo;alignement, gestion des colonnes, gestion des couleurs, gestion des blocs tableau et galerie, etc.</li></ul>\n\n\n\n<h3>Nouvelles API concernant les blocs de l&rsquo;éditeur sur WordPress 5.3</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"YZCinvsj27\"><a href=\"https://make.wordpress.org/core/2019/09/24/new-block-apis-in-wordpress-5-3/\">New Block APIs in WordPress 5.3</a></blockquote><iframe title=\"&#8220;New Block APIs in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/24/new-block-apis-in-wordpress-5-3/embed/#?secret=YZCinvsj27\" data-secret=\"YZCinvsj27\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>WordPress 5.3 : mise à jour de l&rsquo;éditeur concernant les thèmes </h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"FXR5SBTYlz\"><a href=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/\">Block Editor Theme-related updates in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Block Editor Theme-related updates in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/27/block-editor-theme-related-updates-in-wordpress-5-3/embed/#?secret=FXR5SBTYlz\" data-secret=\"FXR5SBTYlz\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Médias</h2>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?component=Media&amp;milestone=5.3&amp;group=type&amp;max=500&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=id\">42</a>&nbsp;changements concernant les médias sur WP 5.3, notons la nouvelle façon de gérer les grosses images en les détectant pour générer une taille maximale optimisée pour le web, l&rsquo;enregistrement des métadonnées au moment de la création des miniatures ou encore la possibilité d&rsquo;obtenir une réorientation automatique des images portrait ou paysage en fonction des données exif fournies dans le fichier image par votre appareil photo.</p>\n\n\n\n<h3>Gestion des images « énormes »</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"imHx9ULNRo\"><a href=\"https://make.wordpress.org/core/2019/10/09/introducing-handling-of-big-images-in-wordpress-5-3/\">Introducing handling of big images in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Introducing handling of big images in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/09/introducing-handling-of-big-images-in-wordpress-5-3/embed/#?secret=imHx9ULNRo\" data-secret=\"imHx9ULNRo\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Changements dans le traitement des images</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"hmmf80jvPB\"><a href=\"https://make.wordpress.org/core/2019/10/11/updates-to-image-processing-in-wordpress-5-3/\">Updates to Image Processing in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Updates to Image Processing in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/11/updates-to-image-processing-in-wordpress-5-3/embed/#?secret=hmmf80jvPB\" data-secret=\"hmmf80jvPB\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Multisite</h2>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?component=Networks+and+Sites&amp;milestone=5.3&amp;group=type&amp;max=500&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=id\">15</a>&nbsp;changements concernant la gestion multisite dans WP 5.3, les plus notables sont ceux relatifs à l&rsquo;optimisation de la base de données, les changements concernant&nbsp;<code>WP_MS_Sites_List_Table</code>, les retours sur le court-circuitage des classes de WP Multisite, et l&rsquo;amélioration de performances sur l&rsquo;obtention des informations des sites et réseaux de sites par ID.</p>\n\n\n\n<h3>Amélioration de l&rsquo;écran de gestion du réseau de site</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"FE6hJWfstm\"><a href=\"https://make.wordpress.org/core/2019/10/15/enhancements-to-the-network-sites-screen-in-wordpress-5-3/\">Enhancements to the Network Sites Screen in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Enhancements to the Network Sites Screen in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/enhancements-to-the-network-sites-screen-in-wordpress-5-3/embed/#?secret=FE6hJWfstm\" data-secret=\"FE6hJWfstm\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Modernisation du code et prise en charge de PHP 7.4</h2>\n\n\n\n<p>WordPress 5.3 prend d&rsquo;ores et déjà en charge PHP 7.4, qui&nbsp;<a href=\"https://wiki.php.net/todo/php74\">devrait sortir à la fin du mois de novembre</a>&nbsp;!</p>\n\n\n\n<p>En plus de supporter PHP 7.4, de nombreuses mises à jour du code source de WordPress ont été faites, afin de continuer sa modernisation. Par exemple, WordPress 5.3 utilise maintenant l&rsquo;opérateur de décomposition (<em>spread operator</em>), et l&rsquo;extension JSON native de PHP est maintenant utilisée pour faire tourner WordPress.</p>\n\n\n\n<h3>WordPress et PHP 7.4</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"7mCy3B4cmQ\"><a href=\"https://make.wordpress.org/core/2019/10/11/wordpress-and-php-7-4/\">WordPress and PHP 7.4</a></blockquote><iframe title=\"&#8220;WordPress and PHP 7.4&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/11/wordpress-and-php-7-4/embed/#?secret=7mCy3B4cmQ\" data-secret=\"7mCy3B4cmQ\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>PHP : introduction de l&rsquo;opérateur de décomposition</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"C9ldWcxFU3\"><a href=\"https://make.wordpress.org/core/2019/10/09/wp-5-3-introducing-the-spread-operator/\">WP 5.3: Introducing the spread operator</a></blockquote><iframe title=\"&#8220;WP 5.3: Introducing the spread operator&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/09/wp-5-3-introducing-the-spread-operator/embed/#?secret=C9ldWcxFU3\" data-secret=\"C9ldWcxFU3\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>L&rsquo;extension JSON native de PHP est maintenant nécessaire</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"HtWlgpfLAo\"><a href=\"https://make.wordpress.org/core/2019/10/15/php-native-json-extension-now-required/\">PHP Native JSON Extension Now Required</a></blockquote><iframe title=\"&#8220;PHP Native JSON Extension Now Required&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/php-native-json-extension-now-required/embed/#?secret=HtWlgpfLAo\" data-secret=\"HtWlgpfLAo\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>API REST</h2>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?component=REST+API&amp;milestone=5.3&amp;group=type&amp;max=500&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=id\">33</a>&nbsp;évolutions de l&rsquo;API REST sur WordPress 5.3, notons l&rsquo;enregistrement des métadonnées des tableaux et des objets, le filtrage des réponses groupées avec le paramètre de requête <code>_fields</code>, le fait de pouvoir remettre les publications en date de publication « flottante » (<em>« floating date status »</em>), et la meilleure pour la fin&nbsp;: une amélioration de 30 à 40% des performances sur les grosses requêtes sur l&rsquo;API REST&nbsp;!</p>\n\n\n\n<p>Pour en savoir plus&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"fEgiWsfg40\"><a href=\"https://make.wordpress.org/core/2019/10/16/the-rest-api-in-wordpress-5-3/\">The REST API in WordPress 5.3</a></blockquote><iframe title=\"&#8220;The REST API in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/16/the-rest-api-in-wordpress-5-3/embed/#?secret=fEgiWsfg40\" data-secret=\"fEgiWsfg40\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Utilitaire de santé du site</h2>\n\n\n\n<p>Sur les&nbsp;<a href=\"https://core.trac.wordpress.org/query?component=Site+Health&amp;milestone=5.3&amp;group=type&amp;max=500&amp;col=id&amp;col=summary&amp;col=milestone&amp;col=owner&amp;col=type&amp;col=status&amp;col=priority&amp;order=id\">31</a>&nbsp;améliorations concernant l&rsquo;état de santé du site, notons des changements concernant la graduation d&rsquo;état de santé du site, les améliorations concernant la gestion des e-mails du mode de récupération, des changements sur filtres pour ajouter/modifier/supprimer les tests d&rsquo;état de santé, et un nouvel écran de vérification de l&rsquo;e-mail de l&rsquo;administrateur du site.</p>\n\n\n\n<h3>Quoi de neuf sur l&rsquo;utilitaire de santé de votre site&nbsp;?</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Sgxz2XxsTi\"><a href=\"https://make.wordpress.org/core/2019/09/25/whats-new-in-site-health-for-wordpress-5-3/\">What&#8217;s new in Site Health for WordPress 5.3</a></blockquote><iframe title=\"&#8220;What&#8217;s new in Site Health for WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/25/whats-new-in-site-health-for-wordpress-5-3/embed/#?secret=Sgxz2XxsTi\" data-secret=\"Sgxz2XxsTi\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Vérification de l&rsquo;e-mail de l&rsquo;administrateur du site</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"bbaNXM8RQL\"><a href=\"https://make.wordpress.org/core/2019/10/17/wordpress-5-3-admin-email-verification-screen/\">WordPress 5.3: Site Admin Email Verification Screen</a></blockquote><iframe title=\"&#8220;WordPress 5.3: Site Admin Email Verification Screen&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/17/wordpress-5-3-admin-email-verification-screen/embed/#?secret=bbaNXM8RQL\" data-secret=\"bbaNXM8RQL\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Autres évolutions diverses à venir avec WordPress 5.3</h2>\n\n\n\n<h3>Améliorations concernant la date et l&rsquo;heure dans WordPress</h3>\n\n\n\n<p>De nombreuses améliorations sont prévues sur la gestion de la date, de l&rsquo;heure, et des fuseaux horaires dans WP.</p>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"tMQvXRcKXk\"><a href=\"https://make.wordpress.org/core/2019/09/23/date-time-improvements-wp-5-3/\">Date/Time component improvements in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Date/Time component improvements in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/23/date-time-improvements-wp-5-3/embed/#?secret=tMQvXRcKXk\" data-secret=\"tMQvXRcKXk\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Modifications dans le but d&#8217;empêcher les moteurs de recherche d&rsquo;indexer les sites ne souhaitant pas l&rsquo;être</h3>\n\n\n\n<p>Cette modification fait suite à des changements concernant la prise en compte de <code>noindex</code> par les moteurs de recherche.</p>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"GBV5HC0BBA\"><a href=\"https://make.wordpress.org/core/2019/09/02/changes-to-prevent-search-engines-indexing-sites/\">Changes to prevent search engines indexing sites.</a></blockquote><iframe title=\"&#8220;Changes to prevent search engines indexing sites.&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/02/changes-to-prevent-search-engines-indexing-sites/embed/#?secret=GBV5HC0BBA\" data-secret=\"GBV5HC0BBA\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Prise en charge de l&rsquo;attribut rel=UGC dans les liens hypertextes, et utilisation native au sein des commentaires</h3>\n\n\n\n<p>Ce changement fait suite à l&rsquo;introduction de cette nouvelle valeur de l&rsquo;attribut <code>rel</code> par Google.</p>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"SKUR7rQV0G\"><a href=\"https://make.wordpress.org/core/2019/10/03/wp-5-3-introduces-new-functions-to-add-ugc-attribute-to-links-and-implements-it-to-comments/\">WP 5.3 introduces new functions to add UGC attribute to links, and implements it to comments</a></blockquote><iframe title=\"&#8220;WP 5.3 introduces new functions to add UGC attribute to links, and implements it to comments&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/03/wp-5-3-introduces-new-functions-to-add-ugc-attribute-to-links-and-implements-it-to-comments/embed/#?secret=SKUR7rQV0G\" data-secret=\"SKUR7rQV0G\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Changements dans la structure HTML de Twenty Nineteen</h3>\n\n\n\n<p>Quelques changements de structure HTML qui intéresseront les personnes utilisant Twenty Nineteen, surtout si vous avez surchargé sa feuille de styles CSS.</p>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"MEYUSe79FM\"><a href=\"https://make.wordpress.org/core/2019/09/04/changes-on-twenty-nineteen-html-structure-in-wordpress-5-3/\">Changes on Twenty Nineteen HTML structure in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Changes on Twenty Nineteen HTML structure in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/04/changes-on-twenty-nineteen-html-structure-in-wordpress-5-3/embed/#?secret=MEYUSe79FM\" data-secret=\"MEYUSe79FM\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Changement de la structure HTML générée par la fonction wp_die()</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"0OY3e2vv2u\"><a href=\"https://make.wordpress.org/core/2019/10/15/changes-to-wp_die-html-output-in-wordpress-5-3/\">Changes to wp_die() HTML output in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Changes to wp_die() HTML output in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/changes-to-wp_die-html-output-in-wordpress-5-3/embed/#?secret=0OY3e2vv2u\" data-secret=\"0OY3e2vv2u\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Des opérateurs de comparaison de clés de métadonnées étendus</h3>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"tlzwJGEoJF\"><a href=\"https://make.wordpress.org/core/2019/10/15/expanded-meta-key-comparison-operators-in-5-3/\">Expanded meta key comparison operators in 5.3</a></blockquote><iframe title=\"&#8220;Expanded meta key comparison operators in 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/expanded-meta-key-comparison-operators-in-5-3/embed/#?secret=tlzwJGEoJF\" data-secret=\"tlzwJGEoJF\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Mise à jour de la bibliothèque Backbone dans WP 5.3</h3>\n\n\n\n<p>Cette note de développement vous concerne si vous surchargez ou modifiez le comportement de la bibliothèque Backbone (qui sert notamment à la gestion des médias), car celle-ci à été mise à jour de la version 1.3.3 à 1.4.0.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"3czGU46rqd\"><a href=\"https://make.wordpress.org/core/2019/10/10/wordpress-5-3-backbone-upgrade-guide/\">WordPress 5.3: Backbone Upgrade Guide</a></blockquote><iframe title=\"&#8220;WordPress 5.3: Backbone Upgrade Guide&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/10/wordpress-5-3-backbone-upgrade-guide/embed/#?secret=3czGU46rqd\" data-secret=\"3czGU46rqd\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Les slugs de menus composés uniquement d&rsquo;un nombre entier ne sont plus supportés</h3>\n\n\n\n<p>De toute façon, cela n&rsquo;était déjà pas recommandé pour des questions de lisibilité (et de logique), mais cet usage va maintenant renvoyer une notification « doing it wrong » aux développeurs.</p>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"YZFZT7zWFk\"><a href=\"https://make.wordpress.org/core/2019/09/18/integer-menu-slugs-are-no-longer-supported-from-wordpress-5-3/\">Integer menu slugs are no longer supported from WordPress 5.3</a></blockquote><iframe title=\"&#8220;Integer menu slugs are no longer supported from WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/18/integer-menu-slugs-are-no-longer-supported-from-wordpress-5-3/embed/#?secret=YZFZT7zWFk\" data-secret=\"YZFZT7zWFk\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Un nouveau bouton « Afficher le mot de passe » dans l&rsquo;écran de connexion à votre administration WP</h3>\n\n\n\n<p>Très souvent utilisé sur nombre d&rsquo;applications web, WordPress adopte également un petit bouton permettant de visualiser le mot de passe que l&rsquo;on est en train de saisir.</p>\n\n\n\n<p>Consulter la note de développement (en anglais)&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"y79Mssuxvf\"><a href=\"https://make.wordpress.org/core/2019/10/10/wordpress-5-3-adds-a-show-button-next-to-the-password-field-on-the-login-screen/\">WordPress 5.3 adds a &#8220;Show&#8221; button next to the password field on the login screen</a></blockquote><iframe title=\"&#8220;WordPress 5.3 adds a &#8220;Show&#8221; button next to the password field on the login screen&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/10/wordpress-5-3-adds-a-show-button-next-to-the-password-field-on-the-login-screen/embed/#?secret=y79Mssuxvf\" data-secret=\"y79Mssuxvf\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h3>Et pour finir, un petit florilège de modifications diverses</h3>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"UM16bjeKGL\"><a href=\"https://make.wordpress.org/core/2019/10/15/miscellaneous-developer-focused-changes-in-5-3/\">Miscellaneous Developer Focused Changes in 5.3</a></blockquote><iframe title=\"&#8220;Miscellaneous Developer Focused Changes in 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/10/15/miscellaneous-developer-focused-changes-in-5-3/embed/#?secret=UM16bjeKGL\" data-secret=\"UM16bjeKGL\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<hr class=\"wp-block-separator\" />\n\n\n\n<p>Pour rappel, la sortie de WordPress 5.3 est prévue le 12 novembre 2019. Vous pouvez d&rsquo;ores et déjà la tester en version <em>Release Candidate</em> en installant l&rsquo;extension officielle WordPress Beta Tester puis en allant dans ses réglages et cocher la case <em>« Bleeding Edge »</em> / version de développement puis en mettant à jour votre installation de façon classique.</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-plugin-directory\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Czet7k2tcq\"><a href=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/\">WordPress Beta Tester</a></blockquote><iframe title=\"« WordPress Beta Tester » &#8212; Plugin Directory\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://fr.wordpress.org/plugins/wordpress-beta-tester/embed/#?secret=Czet7k2tcq\" data-secret=\"Czet7k2tcq\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Merci à <a href=\"https://profiles.wordpress.org/wolforg/\">Wolforg</a>, <a href=\"https://profiles.wordpress.org/chaton666/\">Marie Comet</a> et <a href=\"https://profiles.wordpress.org/crash_47/\">Thomas Piron</a> pour leur relecture attentive <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"💚\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /> </p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:84:\"https://fr.wordpress.org/2019/10/24/les-changements-a-venir-dans-wordpress-5-3/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"5\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:6;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:29:\"WordPress et la documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:66:\"https://fr.wordpress.org/2019/09/18/wordpress-et-la-documentation/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:74:\"https://fr.wordpress.org/2019/09/18/wordpress-et-la-documentation/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Wed, 18 Sep 2019 07:53:55 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:13:\"Documentation\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:13:\"WordPress.org\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1427\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:368:\"Lorsque vous recherchez de la documentation sur WordPress, votre réflexe est probablement de saisir le nom de la fonction PHP, du crochet (hook) ou de l&#8217;élément dont vous avez besoin sur votre moteur de recherche favori. Plusieurs sources sont alors proposées : les sources officieuses comme les articles de blogs, et les sources officielles. Elles [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:12748:\"<span id=\"more-1427\"></span>\n<!--noteaser-->\n\n\n\n<p>Lorsque vous recherchez de la documentation sur WordPress, votre réflexe est probablement de saisir le nom de la fonction PHP, du crochet (hook) ou de l&rsquo;élément dont vous avez besoin sur votre moteur de recherche favori. Plusieurs sources sont alors proposées : les sources officieuses comme les articles de blogs, et les sources officielles. Elles sont simples à identifier puisqu&rsquo;elles utilisent le domaine <code>WordPress.org</code>.</p>\n\n\n\n<p>Deux types de sources officielles co-existent actuellement dans les résultats de recherche : l&rsquo;ancien <a href=\"https://codex.wordpress.org/\">Codex</a>, et <a href=\"https://developer.wordpress.org\">DevHub</a>.</p>\n\n\n\n<h2>Le codex c&rsquo;est terminé, place à DevHub&nbsp;!</h2>\n\n\n\n<p>Depuis maintenant quelques années, une migration a été lancée vers la nouvelle plateforme de référence pour la documentation de WordPress&nbsp;: surnommée «&nbsp;DevHub&nbsp;», <a href=\"https://developer.wordpress.org\">developer.wordpress.org</a> a pour vocation de remplacer totalement l&rsquo;ancien Codex.</p>\n\n\n\n<h3>Pourquoi changer&nbsp;?</h3>\n\n\n\n<p>Basé sur un Wiki (une encyclopédie modifiable), le Codex avait l&rsquo;avantage (et l&rsquo;inconvénient) d&rsquo;avoir un contenu intégralement généré par ses utilisatrices et utilisateurs. </p>\n\n\n\n<p>Avantages, car il n&rsquo;y avait pas de limite à la création de pages de documentation et cela permettait à tout un chacun de proposer des contributions, des exemples, etc.</p>\n\n\n\n<p>Inconvénients, car il était alors quasiment impossible de maintenir à jour cette documentation. Les fonctionnalités de WordPress évoluent rapidement, au rythme de généralement 3 nouvelles versions majeures par an et une dizaine de versions mineures. Il est très difficile de tenir la documentation de ces fonctionnalités à jour avec quelques dizaines de volontaires. Ainsi, le Codex est condamné à une certaine obsolescence, le volume de contribution des nouvelles pages de documentation ne pouvant suivre le volume d&rsquo;évolutions au sein du CMS.</p>\n\n\n\n<h3>DevHub, vers une documentation semi-automatisée</h3>\n\n\n\n<p>Au contraire du Codex, la nouvelle plateforme de référence DevHub – <a href=\"https://developer.wordpress.org\">developer.wordpress.org</a> – fonctionne de façon automatisée (ou presque).</p>\n\n\n\n<p style=\"background-color:#04598a;color:#ffffff\" class=\"has-text-color has-background has-medium-font-size\">Sur DevHub, la documentation des fonctions, crochets (hooks), filtres et autres actions est générée automatiquement à partir de la documentation présente dans les fichiers du cœur du CMS.<br><strong>Cette documentation est donc toujours 100% à jour par rapport au cœur WP.</strong></p>\n\n\n\n<p>Pour le coup, l&rsquo;avantage est clair&nbsp;: <strong>dès la sortie d&rsquo;une nouvelle version de WordPress, l&rsquo;ensemble de la documentation est automatiquement mis à jour</strong> pour intégrer les nouvelles fonctionnalités, comprenant les pages de documentation existantes comme la création de nouvelles pages pour les nouvelles fonctionnalités.</p>\n\n\n\n<p>L&rsquo;inconvénient que l&rsquo;on peut y voir est un format plus rigide que l&rsquo;ancien Codex. Même si cela a clairement des avantages en terme de rapidité de l&rsquo;accès à l&rsquo;information vu que tout est formaté de la même façon, cela aura peut-être pour certain·e·s un peu moins de charme que le bon vieux Codex et ses pages générées à l&rsquo;huile de coude <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<h3>Le codex progressivement redirigé vers DevHub</h3>\n\n\n\n<p>Les pages du Codex seront progressivement redirigées de façon permanente vers DevHub (c&rsquo;est déjà le cas pour beaucoup d&rsquo;entre elles). D&rsquo;ici là, faites attention :</p>\n\n\n\n<p style=\"background-color:#04598a;color:#ffffff\" class=\"has-text-color has-background has-medium-font-size\"><strong>Les contenus du Codex ne sont plus maintenus</strong> et proposent donc une documentation incomplète ou obsolète. <br>Il est fortement recommandé d&rsquo;utiliser la documentation proposée sur developer.wordpress.org <strong>qui est maintenant la seule documentation officielle de WordPress à jour</strong>.</p>\n\n\n\n<p>Bien sûr, les pages du Codex étant progressivement redirigées vers DevHub, nous sommes dans une période de transition pendant laquelle les deux co-existent. Forts d&rsquo;une grande notoriété, les pages du Codex apparaissent souvent avant les pages DevHub dans les résultats de recherche. Mais cela sera résolu au fur et à mesure de la redirection permanente des pages vers DevHub.</p>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/codex-devhub.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/codex-devhub-1024x406.png\" alt=\"\" class=\"wp-image-1432\" srcset=\"https://fr.wordpress.org/files/2019/09/codex-devhub-1024x406.png 1024w, https://fr.wordpress.org/files/2019/09/codex-devhub-300x119.png 300w, https://fr.wordpress.org/files/2019/09/codex-devhub-768x304.png 768w, https://fr.wordpress.org/files/2019/09/codex-devhub.png 1120w\" sizes=\"(max-width: 1024px) 100vw, 1024px\" /></a></figure>\n\n\n\n<h2>Comment lire une page de documentation sur DevHub</h2>\n\n\n\n<p>Prenons par exemple une fonction de base de WP au hasard&nbsp;:&nbsp;<a href=\"https://developer.wordpress.org/reference/functions/get_the_time/\"><code>get_the_time()</code></a>.</p>\n\n\n\n<p>Sur la fiche developer.w.org, on retrouvera plusieurs sections :</p>\n\n\n\n<ul><li>Le&nbsp;<strong>nom</strong>&nbsp;de la fonction</li><li>Une&nbsp;<strong>description courte</strong></li><li>Une&nbsp;<strong>description longue</strong>&nbsp;(quand c&rsquo;est nécessaire)</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-1.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-1.png\" alt=\"\" class=\"wp-image-1433\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-1.png 737w, https://fr.wordpress.org/files/2019/09/devhub-1-300x50.png 300w\" sizes=\"(max-width: 737px) 100vw, 737px\" /></a></figure>\n\n\n\n<ul><li>Les&nbsp;<strong>paramètres d’entrée</strong>&nbsp;de la fonction :</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-2.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-2.png\" alt=\"\" class=\"wp-image-1434\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-2.png 710w, https://fr.wordpress.org/files/2019/09/devhub-2-300x116.png 300w\" sizes=\"(max-width: 710px) 100vw, 710px\" /></a></figure>\n\n\n\n<ul><li>Les éléments&nbsp;<strong>retournés</strong>&nbsp;par la fonction (si la fonction est sensée retourner quelque chose) :</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-3.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-3.png\" alt=\"\" class=\"wp-image-1435\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-3.png 782w, https://fr.wordpress.org/files/2019/09/devhub-3-300x47.png 300w, https://fr.wordpress.org/files/2019/09/devhub-3-768x120.png 768w\" sizes=\"(max-width: 782px) 100vw, 782px\" /></a></figure>\n\n\n\n<ul><li>La&nbsp;<strong>source</strong>&nbsp;de la fonction dans le cœur WordPress, avec les éléments suivants :<ul><li>Le fichier dans lequel la fonction est déclarée (lien cliquable vers la liste de toutes les fonctions déclarées dans ce fichier).</li><li>Le code de la fonction.</li><li>Un bouton permettant de voir le code source en entier.</li><li>Un lien «&nbsp;View on Trac&nbsp;» pour voir la fonction au sein du fichier où elle est déclarée sur Trac, sur le dépôt du code source de WordPress.</li></ul></li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-4.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-4.png\" alt=\"\" class=\"wp-image-1436\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-4.png 989w, https://fr.wordpress.org/files/2019/09/devhub-4-300x113.png 300w, https://fr.wordpress.org/files/2019/09/devhub-4-768x289.png 768w\" sizes=\"(max-width: 989px) 100vw, 989px\" /></a></figure>\n\n\n\n<ul><li>Le&nbsp;<strong>changelog</strong>&nbsp;: il s’agit de la liste des différentes modifications faites sur la fonction et de la version de WordPress correspondant à chaque modification. Cela permet de savoir quand une fonction a été introduite dans le cœur WP et quand est-ce qu’elle a été modifiée.</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-5.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-5.png\" alt=\"\" class=\"wp-image-1437\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-5.png 895w, https://fr.wordpress.org/files/2019/09/devhub-5-300x70.png 300w, https://fr.wordpress.org/files/2019/09/devhub-5-768x179.png 768w\" sizes=\"(max-width: 895px) 100vw, 895px\" /></a></figure>\n\n\n\n<ul><li>Une section&nbsp;<strong>Related</strong>&nbsp;composée de deux sous-sections :<ul><li><strong>Uses :</strong>&nbsp;les autres fonctions utilisées par la fonction en question</li><li><strong>Used by :</strong>&nbsp;les autres fonctions qui utilisent la fonction en question</li></ul></li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-6.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-6.png\" alt=\"\" class=\"wp-image-1438\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-6.png 963w, https://fr.wordpress.org/files/2019/09/devhub-6-300x196.png 300w, https://fr.wordpress.org/files/2019/09/devhub-6-768x501.png 768w\" sizes=\"(max-width: 963px) 100vw, 963px\" /></a></figure>\n\n\n\n<ul><li>Des <strong>User contributed notes :</strong>&nbsp;des sortes de commentaires permettant aux développeur·euse·s de proposer des exemples d’utilisation et autres remarques concernant la fonction.</li></ul>\n\n\n\n<figure class=\"wp-block-image\"><a href=\"https://fr.wordpress.org/files/2019/09/devhub-7.png\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/09/devhub-7.png\" alt=\"\" class=\"wp-image-1439\" srcset=\"https://fr.wordpress.org/files/2019/09/devhub-7.png 965w, https://fr.wordpress.org/files/2019/09/devhub-7-300x133.png 300w, https://fr.wordpress.org/files/2019/09/devhub-7-768x341.png 768w\" sizes=\"(max-width: 965px) 100vw, 965px\" /></a></figure>\n\n\n\n<h2>Contribuer à la documentation de WordPress sur DevHub</h2>\n\n\n\n<p>N’hésitez pas à proposer des&nbsp;<em>user contributed notes</em>&nbsp;!</p>\n\n\n\n<p>D’une part c’est un excellent moyen de contribuer à WordPress, d’autre part vous serez peut-être content de retrouver votre propre exemple ou remarque la prochaine fois que vous chercherez de la documentation sur cette fonction&nbsp;!</p>\n\n\n\n<p><strong>Les <em>user contributed notes</em> sont validées manuellement par l’équipe de documentation de WordPress.</strong></p>\n\n\n\n<h3>Des questions&nbsp;?</h3>\n\n\n\n<p>Si vous utilisez le Slack WordPress-fr, n&rsquo;hésitez pas à poser vos questions dans le canal #documentation-fr (pour vous inscrire gratuitement, c&rsquo;est <a href=\"https://wpfr.net/slack\">par ici</a>). Sinon, vous pouvez utiliser le <a href=\"https://wpfr.net/support/\">forum d&rsquo;entraide de l&rsquo;association WPFR</a> ou encore tout simplement publier un commentaire sur le présent article (modération a priori) <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f642.png\" alt=\"🙂\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<h3>«&nbsp;Attends une minute… mais c&rsquo;est tout en anglais DevHub&nbsp;!&nbsp;»</h3>\n\n\n\n<p>Oui… <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f60a.png\" alt=\"😊\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>…pour l&rsquo;instant&nbsp;! L&rsquo;équipe de développement du réseau de sites WordPress.org a mis en place un outil permettant à chacune des 192 langues (!) dans lesquelles WordPress est traduit de proposer leur propre traduction de la documentation de WordPress.</p>\n\n\n\n<p>Cet outil est en cours de test et le site français (fr.wordpress.org) sera parmi les premiers à disposer de cet outil. Nous sommes actuellement en train de finaliser les préparatifs. L&rsquo;équipe de documentation de WP en français devrait pouvoir commencer son travail d&rsquo;ici quelques semaines/mois. Bien entendu, il s&rsquo;agit d&rsquo;un travail de longue haleine et toutes les bonnes volontés seront les bienvenues&nbsp;!</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:71:\"https://fr.wordpress.org/2019/09/18/wordpress-et-la-documentation/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:7;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:56:\"WordPress 5.3 et Twenty Nineteen : vérifiez vos CSS !\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:86:\"https://fr.wordpress.org/2019/09/05/wordpress-5-3-et-twenty-nineteen-verifiez-vos-css/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://fr.wordpress.org/2019/09/05/wordpress-5-3-et-twenty-nineteen-verifiez-vos-css/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 05 Sep 2019 11:40:23 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1416\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:251:\"Si vous avez surchargé le CSS du thème Twenty Nineteen via l\'outil de personnalisation ou via un thème enfant, nous vous invitons à vérifier que ce changement à venir dans WP 5.3 ne vous concerne pas, ou à faire les modifications CSS si besoin.\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:5859:\"\n<p>La prochaine version majeure de WordPress sera la version 5.3. Elle est prévue le 12 novembre 2019.</p>\n\n\n\n<p>D&rsquo;ici là, nous attirons votre attention sur le fait que WordPress 5.3 apportera un petit changement sur la structure HTML du thème natif Twenty Nineteen. </p>\n\n\n\n<p>Si vous avez surchargé le CSS du thème Twenty Nineteen via l&rsquo;outil de personnalisation (en anglais, <em>Customizer</em>) ou via un thème enfant, nous vous invitons à lire cet article et à vérifier que ce changement ne vous concerne pas, ou à faire les (petites) modifications CSS qui s&rsquo;imposent si besoin. En effet, la mise à jour WordPress 5.3 pourrait alors occasionner des bugs d&rsquo;affichage.</p>\n\n\n\n<p>Nous commencerons par une description du problème avant d&rsquo;expliquer comment vérifier si cela vous concerne et faire les modifications nécessaires le cas échéant.</p>\n\n\n\n<span id=\"more-1416\"></span>\n\n\n\n<h2>Description détaillée du changement qui arrive avec WP 5.3</h2>\n\n\n\n<p>Dans certains modèles de pages, le thème Twenty Nineteen utilisait jusqu&rsquo;à présent l’élément HTML <code>&lt;main&gt;</code> en tant que descendant direct de l&rsquo;élément HTML <code>&lt;section&gt;</code>. Cela donnait alors des erreurs de balisage dans les modèles de page suivants&nbsp;:</p>\n\n\n\n<ul><li>404.php</li><li>archive.php</li><li>image.php</li><li>index.php</li><li>page.php</li><li>search.php</li><li>single.php</li></ul>\n\n\n\n<p>Pour information, voici les spécifications HTML (en anglais)</p>\n\n\n\n<blockquote class=\"wp-block-quote\"><p>A hierarchically correct main element is one whose ancestor elements are limited to html, body, div, form without an accessible name, and autonomous custom elements.</p><cite><a href=\"https://html.spec.whatwg.org/multipage/grouping-content.html#hierarchically-correct-main-element\">Source: HTML Living Standard</a></cite></blockquote>\n\n\n\n<p>Pour résumer, l&rsquo;élément HTML <code>&lt;main&gt;</code> ne doit pas avoir pour parent direct un élément autre que <code>&lt;html&gt;</code>, <code>&lt;body&gt;</code>, <code>&lt;div&gt;</code>, <code>&lt;form&gt;</code> ou  qu&rsquo;un élément personnalisé spécifique.</p>\n\n\n\n<p>Avec WordPress 5.3, le balisage actuel de Twenty Nineteen va être corrigé en utilisant un élément neutre <code>&lt;div&gt;</code> à la place de l&rsquo;élément <code>&lt;section&gt;</code>.</p>\n\n\n\n<p>Ancien rendu HTML :</p>\n\n\n\n<pre class=\"wp-block-code\"><code>&lt;section id=\"primary\" class=\"content-area\"&gt;\n    &lt;main id=\"main\" class=\"site-main\"&gt;\n        …\n    &lt;/main&gt;\n&lt;/section&gt;</code></pre>\n\n\n\n<p>Nouveau rendu HTML :</p>\n\n\n\n<pre class=\"wp-block-code\"><code>&lt;div id=\"primary\" class=\"content-area\"&gt;\n    &lt;main id=\"main\" class=\"site-main\"&gt;\n        …\n    &lt;/main&gt;\n&lt;/div&gt;</code></pre>\n\n\n\n<h2>Comment vérifier votre thème et le corriger si nécessaire</h2>\n\n\n\n<p class=\"has-background has-very-light-gray-background-color\">Note importante : Si vous utilisez Twenty Nineteen directement sans avoir de thème enfant ou si vous n&rsquo;utilisez pas du tout le thème Twenty Nineteen (avec ou sans thème enfant), alors ce qui suit ne vous concerne pas et vous n&rsquo;avez rien à faire de spécial.</p>\n\n\n\n<p>Les utilisateurs du thème Twenty Nineteen ou d&rsquo;un thème enfant de Twenty Nineteen sont invités à vérifier que la feuille de styles CSS de leur thème enfant ou que le code CSS éventuellement présent dans leur outil de personnalisation (en anglais <em>customizer</em>) n&rsquo;utilisent pas des sélecteurs de balises tels que :</p>\n\n\n\n<ol><li><code>section#primary</code> (tout attaché)</li><li><code>section.content-area</code> (tout attaché)</li><li><code>section .site-main</code> (avec un espace avant le point)</li><li><code>section #main</code> (avec un espace avant le dièse)</li></ol>\n\n\n\n<p>Vous pouvez chercher cela dans la feuille de style générale de votre thème enfant de Twenty Nineteen ou dans votre outil de personnalisation (Apparence &gt; Personnaliser). Si c&rsquo;est le cas, nous vous préconisons de remplacer ces sélecteurs par, respectivement :</p>\n\n\n\n<ol><li><code>#primary</code></li><li><code>.content-area</code></li><li><code>.site-main</code></li><li><code>#main</code></li></ol>\n\n\n\n<p>Pour plus d&rsquo;informations, <a href=\"https://core.trac.wordpress.org/ticket/47066\">voici le ticket Trac du Cœur WordPress correspondant à ce correctif</a> ainsi que la version originale de cet article, en anglais&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"EzwQ2qrlqW\"><a href=\"https://make.wordpress.org/core/2019/09/04/changes-on-twenty-nineteen-html-structure-in-wordpress-5-3/\">Changes on Twenty Nineteen HTML structure in WordPress 5.3</a></blockquote><iframe title=\"&#8220;Changes on Twenty Nineteen HTML structure in WordPress 5.3&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/09/04/changes-on-twenty-nineteen-html-structure-in-wordpress-5-3/embed/#?secret=EzwQ2qrlqW\" data-secret=\"EzwQ2qrlqW\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>En cas de doute, n&rsquo;hésitez pas à publier un commentaire sous cet article (il sera mis en attente de validation par l&rsquo;un des responsables de ce site, donc patientez quelques heures…) ou à utiliser le <a href=\"https://wpfr.net/support\">forum d&rsquo;entraide de WPFR</a> ou encore le <a href=\"https://wpfr.net/slack\">Slack WordPress-FR (demander une invitation gratuite ici)</a>.</p>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:91:\"https://fr.wordpress.org/2019/09/05/wordpress-5-3-et-twenty-nineteen-verifiez-vos-css/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"2\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:8;a:6:{s:4:\"data\";s:73:\"\n		\n		\n					\n		\n		\n		\n				\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:53:\"Découvrez les nouveautés de WordPress 5.2 «Jaco»\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:78:\"https://fr.wordpress.org/2019/05/02/decouvrez-les-nouveautes-de-wordpress-5-2/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:87:\"https://fr.wordpress.org/2019/05/02/decouvrez-les-nouveautes-de-wordpress-5-2/#comments\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 02 May 2019 07:18:42 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Nouvelles versions de WordPress\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1355\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:448:\"Nommée « Jaco » en l&#8217;honneur du bassiste de jazz Jaco Pastorius, la version 5.2 de WordPress est sortie le 7 mai 2019. Cette nouvelle version majeure de WordPress est riche en changements. Pas moins de 228&#160;bugs,&#160;59&#160;améliorations,&#160;3&#160;nouvelles fonctionnalités, et&#160;16&#160;tâches de gestion ont été prises en charge avec cette version 5.2. WordPress 5.2 est d&#8217;ores et déjà intégralement [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:16845:\"\n<p>Nommée « Jaco » en l&rsquo;honneur du bassiste de jazz Jaco Pastorius, <strong>la version 5.2 de WordPress est sortie le 7 mai 2019.</strong></p>\n\n\n\n<p>Cette nouvelle version majeure de WordPress est riche en changements. Pas moins de <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=defect+(bug)&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">228</a>&nbsp;bugs,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=enhancement&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">59</a>&nbsp;améliorations,&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=feature+request&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">3</a>&nbsp;nouvelles fonctionnalités, et&nbsp;<a href=\"https://core.trac.wordpress.org/query?status=closed&amp;type=task+(blessed)&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=type&amp;col=owner&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">16</a>&nbsp;tâches de gestion ont été <a href=\"https://core.trac.wordpress.org/query?status=closed&amp;milestone=5.2&amp;group=component&amp;col=id&amp;col=summary&amp;col=owner&amp;col=type&amp;col=priority&amp;col=component&amp;col=version&amp;order=priority\">prises en charge avec cette version 5.2</a>.</p>\n\n\n\n<p>WordPress 5.2 est d&rsquo;ores et déjà intégralement traduit, grâce à la mobilisation de <a href=\"https://fr.wordpress.org/team\">l&rsquo;équipe de traduction de WordPress en français</a>. <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f44f.png\" alt=\"👏\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<p>Voici un article récapitulant les changements apportés par WordPress 5.2. Chacun d’entre eux est accompagné des ressources correspondantes (appelées&nbsp;<em>Dev Notes</em>, celles-ci sont disponibles en anglais sur Make/Core).</p>\n\n\n\n<span id=\"more-1355\"></span>\n\n\n\n<h2>État de santé de votre site</h2>\n\n\n\n<div class=\"wp-block-image\"><figure class=\"alignright\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/05/wp-5-2-tools.png\" alt=\"\" class=\"wp-image-1363\" /></figure></div>\n\n\n\n<p>Avec WordPress 5.2, un nouvel écran fait son apparition dans l&rsquo;interface d&rsquo;administration.</p>\n\n\n\n<p>Disponible dans le menu «&nbsp;Outils &gt; Santé du site&nbsp;» du menu d&rsquo;administration, cette fonctionnalité d&rsquo;état de santé du site permet d&rsquo;obtenir un grand nombre d&rsquo;informations utiles sur la configuration de votre site.</p>\n\n\n\n<p>Deux écrans sont alors disponibles. Le premier permet d&rsquo;obtenir un bilan de santé général de son site grace à un panel de points de contrôle lancés de façon automatique.</p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/05/wp-5-2-sante-du-site.png\" alt=\"\" class=\"wp-image-1364\" srcset=\"https://fr.wordpress.org/files/2019/05/wp-5-2-sante-du-site.png 836w, https://fr.wordpress.org/files/2019/05/wp-5-2-sante-du-site-300x237.png 300w, https://fr.wordpress.org/files/2019/05/wp-5-2-sante-du-site-768x607.png 768w\" sizes=\"(max-width: 836px) 100vw, 836px\" /></figure>\n\n\n\n<p>Les développeuses et développeurs peuvent ajouter leur propres points de contrôle, comme dans l&rsquo;écran ci-dessus (critères marqués «&nbsp;Search Engine Optimization&nbsp;» dans la capture d&rsquo;écran). Pour en savoir plus sur l&rsquo;ajout de points de contrôle personnalisés, consultez l&rsquo;article suivant (en anglais) :</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"hNb9pCgS0f\"><a href=\"https://make.wordpress.org/core/2019/04/25/site-health-check-in-5-2/\">Site Health Check in 5.2</a></blockquote><iframe title=\"&#8220;Site Health Check in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/25/site-health-check-in-5-2/embed/#?secret=hNb9pCgS0f\" data-secret=\"hNb9pCgS0f\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Un second écran (accessible via l&rsquo;onglet «&nbsp;Info&nbsp;») permet d&rsquo;obtenir des informations de débogage qui sont précieuses pour votre hébergeur ou pour les responsables techniques de votre site. </p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/05/wp-5-2-debug-tool.png\" alt=\"\" class=\"wp-image-1365\" srcset=\"https://fr.wordpress.org/files/2019/05/wp-5-2-debug-tool.png 842w, https://fr.wordpress.org/files/2019/05/wp-5-2-debug-tool-300x250.png 300w, https://fr.wordpress.org/files/2019/05/wp-5-2-debug-tool-768x640.png 768w\" sizes=\"(max-width: 842px) 100vw, 842px\" /></figure>\n\n\n\n<p>De la même façon, les éditeurs d&rsquo;extensions peuvent ajouter leur propres points de contrôle dans cet outil.</p>\n\n\n\n<p>Cela leur permettra de faciliter le support de leur extension en indiquant à leurs utilisatrices et utilisateurs comment facilement récupérer ces informations et leur communiquer.</p>\n\n\n\n<h2>Protection contre les erreurs fatales PHP</h2>\n\n\n\n<p>WordPress intègre maintenant nativement un «&nbsp;mode de récupération&nbsp;» (<em>recovery mode</em> en anglais).</p>\n\n\n\n<p>L&rsquo;idée est simple : si un thème ou une extension plante votre site, plutôt que de vous fournir un classique «&nbsp;écran blanc de la mort&nbsp;» à partir duquel vous ne pouvez plus rien faire, WordPress désactivera automatiquement le thème ou l&rsquo;extension associé au bug. Si cela se passe en votre absence (via une mise à jour automatique par exemple) alors vous recevrez un e-mail contenant des informations sur le bug rencontré et sur le fait que votre site est passé en <em>mode de récupération</em>.</p>\n\n\n\n<p>Pour en savoir plus, vous pouvez consulter cet article (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"g5hchqhLg4\"><a href=\"https://make.wordpress.org/core/2019/04/16/fatal-error-recovery-mode-in-5-2/\">Fatal Error Recovery Mode in 5.2</a></blockquote><iframe title=\"&#8220;Fatal Error Recovery Mode in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/16/fatal-error-recovery-mode-in-5-2/embed/#?secret=g5hchqhLg4\" data-secret=\"g5hchqhLg4\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Arrêt de la prise en charge des versions de PHP obsolètes</h2>\n\n\n\n<p>À partir de WordPress 5.2, le CMS ne sera plus compatible avec les versions de PHP inférieures à 5.6.20. Si vous utilisez une version de PHP antérieure, vous ne pourrez tout simplement pas réaliser la mise à jour vers WordPress 5.2. Si vous êtes dans ce cas là, rapprochez-vous de votre hébergeur afin de passer sur une version de PHP plus récente.</p>\n\n\n\n<h2>Éditeur / Gutenberg</h2>\n\n\n\n<p>De nombreuses améliorations ont été faites dans l&rsquo;éditeur. En dehors des optimisations de performances et d&rsquo;utilisabilité, citons notamment l&rsquo;ajout d&rsquo;un module <code>block-editor</code> réutilisable pour permettre l&rsquo;utilisation de l&rsquo;éditeur de façon indépendante de l&rsquo;éditeur de publications, sans dépendance vis à vis des publications. Cela permettra de pouvoir l&rsquo;utiliser dans d&rsquo;autres écrans de l&rsquo;administration WordPress, comme par exemple dans l&rsquo;écran <em>Widgets</em>.</p>\n\n\n\n<p>Pour en savoir plus, vous pouvez consulter cet article (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"Z65XzE2Jdn\"><a href=\"https://make.wordpress.org/core/2019/04/09/the-block-editor-javascript-module-in-5-2/\">The Block Editor JavaScript module in 5.2</a></blockquote><iframe title=\"&#8220;The Block Editor JavaScript module in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/09/the-block-editor-javascript-module-in-5-2/embed/#?secret=Z65XzE2Jdn\" data-secret=\"Z65XzE2Jdn\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Accessibilité</h2>\n\n\n\n<p>Une amélioration du balisage des onglets utilisés dans l&rsquo;administration WordPress a été intégrée, ainsi que du balisage des formats d’articles, de la barre d’administration, et le Widget de sélection d&rsquo;archives d&rsquo;articles a maintenant un meilleur fonctionnement sur les technologies d&rsquo;assistance telles que les lecteurs d&rsquo;écrans/synthèses vocales.</p>\n\n\n\n<p>Pour en savoir plus sur ces changements (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"NhV3S5uMlh\"><a href=\"https://make.wordpress.org/core/2019/04/02/admin-tabs-semantic-improvements-in-5-2/\">Admin Tabs Semantic Improvements in 5.2</a></blockquote><iframe title=\"&#8220;Admin Tabs Semantic Improvements in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/02/admin-tabs-semantic-improvements-in-5-2/embed/#?secret=NhV3S5uMlh\" data-secret=\"NhV3S5uMlh\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"M74Sdl656H\"><a href=\"https://make.wordpress.org/core/2019/04/24/notable-accessibility-changes-in-5-2/\">Notable Accessibility Changes in 5.2</a></blockquote><iframe title=\"&#8220;Notable Accessibility Changes in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/24/notable-accessibility-changes-in-5-2/embed/#?secret=M74Sdl656H\" data-secret=\"M74Sdl656H\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Confidentialité</h2>\n\n\n\n<p>Le composant <em>Privacy</em> (confidentialité) du cœur WordPress a été amélioré avec l&rsquo;ajout de 4 nouvelles fonctionnalités pour rendre la personnalisation et le design de la page de politique de confidentialité plus simple. Certaines restrictions sur les exportations de données des utilisateurs ont également été assouplies.</p>\n\n\n\n<p>Pour en savoir plus sur ces changements (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"g2XIEE66bh\"><a href=\"https://make.wordpress.org/core/2019/04/24/developer-focused-privacy-updates-in-5-2/\">Developer Focused Privacy Updates in 5.2</a></blockquote><iframe title=\"&#8220;Developer Focused Privacy Updates in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/24/developer-focused-privacy-updates-in-5-2/embed/#?secret=g2XIEE66bh\" data-secret=\"g2XIEE66bh\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<h2>Autres changements notables</h2>\n\n\n\n<p>13 nouveaux Dashicons ont été ajoutés et mis à disposition des développeur·euses. Pour en savoir plus (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"byYt4IpujY\"><a href=\"https://make.wordpress.org/core/2019/04/11/dashicons-in-wordpress-5-2/\">Dashicons in WordPress 5.2</a></blockquote><iframe title=\"&#8220;Dashicons in WordPress 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/11/dashicons-in-wordpress-5-2/embed/#?secret=byYt4IpujY\" data-secret=\"byYt4IpujY\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p> De nouveaux filtres ont été ajoutés sur les requêtes faisables sur les sites et les réseaux de sites dans un contexte WordPress multisite. Pour en savoir plus (en anglais) :</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"VeHymQMJYS\"><a href=\"https://make.wordpress.org/core/2019/04/11/new-network-and-sites-query-filters/\">New Network and Sites Query Filters</a></blockquote><iframe title=\"&#8220;New Network and Sites Query Filters&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/11/new-network-and-sites-query-filters/embed/#?secret=VeHymQMJYS\" data-secret=\"VeHymQMJYS\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p>Le crochet d&rsquo;action (<em>hook</em>) <code>wp_body_open</code> a été ajouté. Il permet aux développeuses et aux développeurs d&rsquo;ajouter des scripts juste après l&rsquo;ouverture de la balise <code>body</code> du thème. Cela est notamment nécessaire pour intégrer les tags proposés par les outils de mesure d&rsquo;audience. Pour en savoir plus (en anglais) :</p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-theme-review-team\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"yKhYMfUJLH\"><a href=\"https://make.wordpress.org/themes/2019/03/29/addition-of-new-wp_body_open-hook/\">Addition of new &#8216;wp_body_open&#8217; hook.</a></blockquote><iframe title=\"&#8220;Addition of new &#8216;wp_body_open&#8217; hook.&#8221; &#8212; Theme Review Team\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/themes/2019/03/29/addition-of-new-wp_body_open-hook/embed/#?secret=yKhYMfUJLH\" data-secret=\"yKhYMfUJLH\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\n\n\n<p> Autres changements divers (en anglais) : </p>\n\n\n\n<figure class=\"wp-block-embed-wordpress wp-block-embed is-type-wp-embed is-provider-make-wordpress-core\"><div class=\"wp-block-embed__wrapper\">\n<blockquote class=\"wp-embedded-content\" data-secret=\"die5jdzcpV\"><a href=\"https://make.wordpress.org/core/2019/04/24/miscellaneous-developer-updates-in-5-2/\">Miscellaneous Developer Updates in 5.2</a></blockquote><iframe title=\"&#8220;Miscellaneous Developer Updates in 5.2&#8221; &#8212; Make WordPress Core\" class=\"wp-embedded-content\" sandbox=\"allow-scripts\" security=\"restricted\" style=\"position: absolute; clip: rect(1px, 1px, 1px, 1px);\" src=\"https://make.wordpress.org/core/2019/04/24/miscellaneous-developer-updates-in-5-2/embed/#?secret=die5jdzcpV\" data-secret=\"die5jdzcpV\" width=\"600\" height=\"338\" frameborder=\"0\" marginwidth=\"0\" marginheight=\"0\" scrolling=\"no\"></iframe>\n</div></figure>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:83:\"https://fr.wordpress.org/2019/05/02/decouvrez-les-nouveautes-de-wordpress-5-2/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:2:\"22\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:9;a:6:{s:4:\"data\";s:76:\"\n		\n		\n					\n		\n		\n		\n				\n		\n		\n\n					\n										\n					\n					\n			\n		\n		\n			\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:5:{s:0:\"\";a:7:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:61:\"Le 11 mai 2019, c’est le 4ème WordPress Translation Day !\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:90:\"https://fr.wordpress.org/2019/04/07/le-11-mai-2019-cest-le-4eme-wordpress-translation-day/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:98:\"https://fr.wordpress.org/2019/04/07/le-11-mai-2019-cest-le-4eme-wordpress-translation-day/#respond\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Sun, 07 Apr 2019 08:18:58 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:8:\"category\";a:2:{i:0;a:5:{s:4:\"data\";s:11:\"Évènement\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:10:\"Traduction\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";s:32:\"https://fr.wordpress.org/?p=1328\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:393:\"Le WordPress Translation Day (WPTD) est un évènement mondial régulièrement organisé par les équipes de traduction de WordPress. L&#8217;objectif est de réunir virtuellement toutes les équipes de traduction du CMS pendant 24 heures pour contribuer à la traduction du CMS et de son écosystème (cœur WP, sites WordPress.org, thèmes, extensions, etc.), partout dans le monde [&#8230;]\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"Jb Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:3614:\"\n<p>Le <strong>WordPress Translation Day</strong> (WPTD) est un évènement mondial régulièrement organisé par les équipes de traduction de WordPress. L&rsquo;objectif est de réunir  virtuellement toutes les équipes de traduction du CMS pendant 24 heures pour contribuer à la traduction du CMS et de son écosystème (cœur WP, sites WordPress.org, thèmes, extensions, etc.), <strong>partout dans le monde et sur tous les fuseaux horaires</strong>.</p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/04/wptd4-organize-an-event.jpg\" alt=\"\" class=\"wp-image-1332\" srcset=\"https://fr.wordpress.org/files/2019/04/wptd4-organize-an-event.jpg 768w, https://fr.wordpress.org/files/2019/04/wptd4-organize-an-event-300x120.jpg 300w\" sizes=\"(max-width: 768px) 100vw, 768px\" /></figure>\n\n\n\n<span id=\"more-1328\"></span>\n\n\n\n<p>Le dernier WordPress Translation Day avait réuni plus de 1300 personnes sur 71 évènements organisés dans 29 pays différents.</p>\n\n\n\n<p>Cela avait permis de proposer plus de 93&nbsp;000 traductions pour 818 projets (thèmes, extensions) répartis sur 60 langues différentes !</p>\n\n\n\n<figure class=\"wp-block-image\"><img loading=\"lazy\" src=\"https://fr.wordpress.org/files/2019/04/wptd3-stats.png\" alt=\"\" class=\"wp-image-1331\" srcset=\"https://fr.wordpress.org/files/2019/04/wptd3-stats.png 538w, https://fr.wordpress.org/files/2019/04/wptd3-stats-231x300.png 231w\" sizes=\"(max-width: 538px) 100vw, 538px\" /></figure>\n\n\n\n<p>Les années précédentes, des meetups locaux avaient été organisés dans les villes de Toulouse, Bordeaux et Valence. Cette année nous lançons un appel à toutes les communautés locales françaises et francophones pour organiser leur propre meetup local !</p>\n\n\n\n<p>Les communautés locales qui disposent d&rsquo;un·e ou plusieurs membres participant déjà à la traduction de WordPress sont déjà en train d&rsquo;organiser leur évènement.</p>\n\n\n\n<p>Tous les meetups français sont invités à nous rejoindre et à organiser un évènement pour l&rsquo;occasion samedi 11 mai 2019 ! L&rsquo;objectif est de nous réunir pour traduire WordPress et de partager un moment en visioconférence (horaire et modalités encore à définir).</p>\n\n\n\n<p>Pour l&rsquo;occasion, des conférences seront également proposées en vidéo partout dans le monde et pourront être suivies en direct sur le <a href=\"https://wptranslationday.org\">site officiel de l&rsquo;évènement</a>.</p>\n\n\n\n<p>Et même si vous n&rsquo;avez pas de meetup à proximité de chez vous, rejoignez-nous sur le canal #traductions sur le <a href=\"http://wpfr.net/slack\">slack WordPress Fr (inscription gratuite)</a>, vous pourrez participer à ce grand évènement et interagir avec la communauté le jour-J.</p>\n\n\n\n<p>Et si vous n&rsquo;avez encore jamais contribué à la traduction de WordPress, de ses thèmes et extensions, c&rsquo;est le moment idéal de vous lancer ! N&rsquo;hésitez pas à nous laisser un message sur le site de l&rsquo;équipe de traduction de WP en français <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f603.png\" alt=\"😃\" class=\"wp-smiley\" style=\"height: 1em; max-height: 1em;\" /></p>\n\n\n\n<ul><li><a href=\"https://fr.wordpress.org/team\">Le site de l&rsquo;équipe de traduction de WordPress en français</a></li><li><a href=\"https://wptranslationday.org\">Plus d&rsquo;informations sur le site officiel du WPTD (en anglais)</a></li><li><a href=\"https://wptranslationday.org/blog/organize-a-wordpress-translation-day-4-local-event/\">Organiser un évènement local pour le WPTD4 (en anglais)</a></li></ul>\n\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:36:\"http://wellformedweb.org/CommentAPI/\";a:1:{s:10:\"commentRss\";a:1:{i:0;a:5:{s:4:\"data\";s:95:\"https://fr.wordpress.org/2019/04/07/le-11-mai-2019-cest-le-4eme-wordpress-translation-day/feed/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:38:\"http://purl.org/rss/1.0/modules/slash/\";a:1:{s:8:\"comments\";a:1:{i:0;a:5:{s:4:\"data\";s:1:\"0\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:4:\"href\";s:35:\"https://fr.wordpress.org/news/feed/\";s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:44:\"http://purl.org/rss/1.0/modules/syndication/\";a:2:{s:12:\"updatePeriod\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"\n	hourly	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:15:\"updateFrequency\";a:1:{i:0;a:5:{s:4:\"data\";s:4:\"\n	1	\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:8:{s:6:\"server\";s:5:\"nginx\";s:4:\"date\";s:29:\"Thu, 30 Apr 2020 08:31:10 GMT\";s:12:\"content-type\";s:34:\"application/rss+xml; charset=UTF-8\";s:6:\"x-olaf\";s:3:\"⛄\";s:13:\"last-modified\";s:29:\"Thu, 16 Apr 2020 14:35:48 GMT\";s:4:\"link\";s:61:\"<https://fr.wordpress.org/wp-json/>; rel=\"https://api.w.org/\"\";s:15:\"x-frame-options\";s:10:\"SAMEORIGIN\";s:4:\"x-nc\";s:9:\"HIT ord 2\";}}s:5:\"build\";s:14:\"20130911040210\";}', 'no');
