ss-5-4-en-chiffres-linfluence-des-pays-et-entreprises-sur-wp/\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:11:\"isPermaLink\";s:5:\"false\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Tue, 31 Mar 2020 21:44:01 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:636:\"\n		        L’article 📊WordPress 5.4 en chiffres : l’influence des pays et entreprises sur WP provient de Jean-Baptiste Audras - CTO @ Whodunit &amp; WordPress Core Developer\nWordPress 5.4 «&#160;Adderley&#160;» est sorti le 31 mars 2020, notamment grâce au travail de 552 personnes qui ont contribué à cette nouvelle version de notre outil de publication web préféré&#160;! 🥂 En tant que coordinateur de la documentation de WP [&#8230;]\nL’article 📊WordPress 5.4 en chiffres : l’influence des pays et entreprises sur WP provient de Jean-Baptiste Audras - CTO @ Whodunit &amp; WordPress Core Developer		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:9:\"JB Audras\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:20193:\"<p>L’article <a rel=\"nofollow\" href=\"https://jeanbaptisteaudras.com/2020/03/wordpress-5-4-en-chiffres-linfluence-des-pays-et-entreprises-sur-wp/\">📊WordPress 5.4 en chiffres : l’influence des pays et entreprises sur WP</a> provient de <a rel=\"nofollow\" href=\"https://jeanbaptisteaudras.com\">Jean-Baptiste Audras - CTO @ Whodunit &amp; WordPress Core Developer</a></p>\n\n<p><a href=\"https://wordpress.org/news/2020/03/adderley/\">WordPress 5.4 <em>«&nbsp;Adderley&nbsp;»</em> est sorti le 31 mars 2020</a>, notamment grâce au travail de 552 personnes qui ont contribué à cette nouvelle version de notre outil de publication web préféré&nbsp;! <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f942.png\" alt=\"🥂\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p>\n\n\n\n<p>En tant que coordinateur de la documentation de WP 5.4, je peux dire que c&rsquo;était une super expérience, avec une équipe de coordination professionnelle et sympathique. Bravo et merci à l&rsquo;équipe et aux mentors&nbsp;: Francesca, David, Sergey, Tammie, Mark, Mary, Jorge, Josepha, Jonathan, Jeff et Matt… merci pour cette expérience inestimable <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f64c.png\" alt=\"🙌\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"💚\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p>\n\n\n\n<p>Quand WordPress 5.3 «&nbsp;Kirk&nbsp;» est sorti, j&rsquo;ai fait <a href=\"https://jeanbaptisteaudras.com/2019/11/distribution-of-wordpress-5-3-contributors-by-country/\">quelques statistiques et un classements par pays</a>. Pour WordPress 5.4, je suis allé plus loin et vous trouverez dans cet article bien plus de stats&nbsp;: contributions par pays, par employeur/entreprise, ou encore le ratio entre les nouveaux contributeurs et ceux qui avaient déjà contribué au cœur WP auparavant.</p>\n\n\n\n<div class=\"schema-faq wp-block-yoast-faq-block\"><div class=\"schema-faq-section\" id=\"faq-question-1586247303757\"><strong class=\"schema-faq-question\"><strong>Comment ces données concernant WordPress 5.4 ont-elles été collectées ?</strong></strong> <p class=\"schema-faq-answer\">Avec Sergey Biryukov et Jorge Costa, nous avons travaillé sur la génération des crédits de WordPress 5.4. À partir de cette liste, j&rsquo;ai « parsé » la page de profil WordPress.org de chaque contributeur afin d’extraire quelques informations publiques : pays, employeur, et s’il a déjà contribué au cœur WP avant. Cela concerne tout autant les contributions au cœur WP faites sur Trac et les pull requests faites sur le dépôt GitHub de Gutenberg.</p> </div> <div class=\"schema-faq-section\" id=\"faq-question-1586247326006\"><strong class=\"schema-faq-question\"><strong>Est-ce que ces statistiques de WP 5.4 sont 100% précises ?</strong></strong> <p class=\"schema-faq-answer\">Ces stats se basent sur les informations déclarées publiquement sur le profil wp.org de chaque personne. Les utilisateurs dont les données étaient vides n&rsquo;ont pas été pris en compte dans ces chiffres.<br />Néanmoins, le pourcentage de personnes ayant rempli son profil étant important, ces données apportent tout de même un éclairage pertinent sur les ratios et sont plutôt représentatives de l&rsquo;ensemble.</p> </div> <div class=\"schema-faq-section\" id=\"faq-question-1586247561761\"><strong class=\"schema-faq-question\">Puis-je télécharger et réutiliser ces graphiques et données ?</strong> <p class=\"schema-faq-answer\">Oui pas de problème <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f60a.png\" alt=\"😊\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /> Tous les graphiques ainsi que les jeux de données peuvent être <a href=\"https://jeanbaptisteaudras.com/2019/wp-admin/post.php?post=60342&amp;action=edit#download-data\">téléchargés à la fin de l&rsquo;article</a>.</p> </div> </div>\n\n\n\n<p></p>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f30d.png\" alt=\"🌍\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement des pays par nombre de contributeurs</h2>\n\n\n\n<p>Ce graphique montre le nombre de pays qui ont contribué à WordPress 5.4, classés par nombre de contributeurs.</p>\n\n\n\n<p>Sur les 48 pays qui ont contribué à cette version de WordPress, les <strong>États-unis</strong> ont le plus grand nombre de contributeurs (99), suivis par l’<strong>Inde</strong> (48 contributeurs). Ensuite viennent l’<strong>Allemagne</strong> avec 20, le <strong>Royaume-Uni</strong> avec 18 et –<em>cocorico&nbsp;!</em>– la <strong>France</strong> avec 15 contributeurs.</p>\n\n\n\n<p>Les États-Unis sont toujours le pays ayant le plus d&rsquo;influence sur le développement du CMS, mais l&rsquo;Inde confirme sa seconde position (majoritairement des tickets liés à la documentation du CMS, mais pas uniquement, il y a aussi beaucoup de correctifs fonctionnels). Les pays d’Europe viennent ensuite en ordre dispersé mais si on les additionne, on arrive à un nombre équivalent aux USA.</p>\n\n\n\n<figure class=\"wp-block-image alignwide size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-countries-people.svg\" alt=\"\" /></figure>\n\n\n\n<p>Voici l’évolution du top 10 des pays entre WP 5.3 et WP 5.4.</p>\n\n\n\n<figure class=\"wp-block-table is-style-regular\"><table><thead><tr><th><strong>WordPress 5.3</strong></th><th>&nbsp;</th><th><strong>WordPress 5.4</strong></th><th>&nbsp;</th></tr></thead><tbody><tr><td><strong>Pays</strong></td><td><strong>Personnes</strong></td><td><strong>Pays</strong></td><td><strong>Personnes</strong></td></tr><tr><td>USA</td><td>110</td><td>USA</td><td>99</td></tr><tr><td>Inde</td><td>63</td><td>Inde</td><td>48</td></tr><tr><td>Royaume-Uni</td><td>26</td><td>Allemagne</td><td>20</td></tr><tr><td>Allemagne</td><td>22</td><td>Royaume-Uni</td><td>18</td></tr><tr><td>Pays-bas</td><td>21</td><td>France</td><td>15</td></tr><tr><td>Australie</td><td>14</td><td>Canada</td><td>11</td></tr><tr><td>Canada</td><td>13</td><td>Pays-bas</td><td>11</td></tr><tr><td>France</td><td>11</td><td>Bangladesh</td><td>9</td></tr><tr><td>Italie</td><td>9</td><td>Italie</td><td>8</td></tr><tr><td>Japon</td><td>8</td><td>Japon</td><td>8</td></tr></tbody></table></figure>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f30e.png\" alt=\"🌎\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement des pays par nombre de contributions</h2>\n\n\n\n<p>Si au lieu de compter les contributrices et contributrices, on choisi à la place de compter les contributions (participations à un ticket Trac ou une issue GitHub), alors les résultats sont considérablement différents. Des contributeurs <strong>russes</strong> ont été crédités dans 558 tickets, juste devant les <strong>américains</strong> avec 538 contributions. Les <strong>néerlandais</strong> arrivent ensuite avec 168 contributions, les <strong>Britanniques</strong> suivent avec  114 contributions, les personnes situées en <strong>Inde</strong> avec 113 contributions puis l’<strong>Algérie</strong> avec 101 crédits.</p>\n\n\n\n<figure class=\"wp-block-pullquote alignright is-style-solid-color small\"><blockquote><p>Notons que <a href=\"https://profiles.wordpress.org/sergeybiryukov/\">Sergey Biryukov</a> (lead technique de WordPress 5.4) a été crédité 555 fois&nbsp;! Cela explique pourquoi la russie est devant. Je me demande presque si n&rsquo;aurions pas du renommer WordPress en SergeyPress 1.0… <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f602.png\" alt=\"😂\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p></blockquote></figure>\n\n\n\n<figure class=\"wp-block-image alignwide size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-country-contributions.svg\" alt=\"\" /></figure>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"💚\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement des entreprises par nombre de contributeurs</h2>\n\n\n\n<p>Sur les 163 entreprises employant des personnes qui ont contribué à WordPress 5.4, c&rsquo;est <strong>Automattic</strong> qui a de loin le plus grand nombre de contributeurs, avec 52 personnes créditées dans la version 5.4. Sept autres entreprises ont plus de 2 personnes ayant été créditées&nbsp;: <strong>Yoast</strong> avec 7 personnes, <strong><a href=\"https://whodunit.fr\">Whodunit</a></strong> –&nbsp;mon employeur&nbsp;– avec 6 personnes, <strong>Human Made</strong> (6), <strong>10up</strong> (5), <strong>Google</strong> (4), <strong>Bluehost</strong> (4), et enfin <strong>WPMU Dev</strong> (3).</p>\n\n\n\n<figure class=\"wp-block-image alignwide size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-employer-people.svg\" alt=\"\" /></figure>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49c.png\" alt=\"💜\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement des entreprises par nombre de contributions</h2>\n\n\n\n<p><strong>Automattic</strong> est la société la plus prolifique avec des employés crédités dans pas moins de 754 tickets, mais elle est suivie de près par <strong>Yoast</strong> avec 601 tickets.</p>\n\n\n\n<p>Il y a trois autres entreprises apparaissant dans plus de 60 tickets&nbsp;: il s’agit de <strong>Bluehost</strong> (70), <strong>Whodunit</strong> (67) et <strong>Human Made</strong> (67).</p>\n\n\n\n<p>Automattic (éditeur de la plateforme de blogging WordPress.com) et Yoast (éditeur de l’extension du même nom) sont donc les deux sociétés ayant eu l&rsquo;influence la plus importante sur le contenu de la version 5.4 de WordPress. Elles sont suivies par un hébergeur et deux agences web. Plus loin dans le classement, on retrouve l’agence 10up, les éditeurs WPMU Dev et iThemes ou encore Google, qui laisse petit à petit son empreinte sur le CMS.</p>\n\n\n\n<figure class=\"wp-block-image alignwide size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-employer-contributions.svg\" alt=\"\" /></figure>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f423.png\" alt=\"🐣\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Ratio entre nouveaux contributeurs et contributeurs core réguliers</h2>\n\n\n\n<p>J’ai aussi essayé de voir quel était le ratio entre les personnes ayant proposé leurs premières contributions au cœur WordPress et celles qui avait déjà contribué au CMS sur des versions précédentes.</p>\n\n\n\n<p>Les nouveaux contributrices et contributeurs représentent un tiers des personnes ayant participé à WordPress 5.4, avec 168 people qui ont fait leur première contribution au cœur du CMS pour cette version&nbsp;! <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f389.png\" alt=\"🎉\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f49a.png\" alt=\"💚\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p>\n\n\n\n<p>Ils ont été crédités en tout sur un petit 10% du nombre total de tickets, et les contributeurs réguliers représentent plus de 90% de l&rsquo;ensemble. Cela est plutôt normal, compte-tenu du fait que les nouveaux sont par définition en train d&rsquo;expérimenter la contribution, il est logique que la quantité de tickets sur lesquels ils soient impliqués soit moins élevée <img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f60c.png\" alt=\"😌\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" /></p>\n\n\n\n<div class=\"wp-block-columns alignwide\">\n<div class=\"wp-block-column\">\n<h3>Nombre de nouveaux contributeurs par rapport aux contributeurs réguliers</h3>\n\n\n\n<figure class=\"wp-block-image size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-new-people.svg\" alt=\"\" /></figure>\n</div>\n\n\n\n<div class=\"wp-block-column\">\n<h3>Nombre de contributions venant de nouveaux par rapport à celles venant de contributeurs réguliers</h3>\n\n\n\n<figure class=\"wp-block-image size-large\"><img src=\"https://jeanbaptisteaudras.com/share/WP-54-stats-new-contributions.svg\" alt=\"\" /></figure>\n</div>\n</div>\n\n\n\n<h2><img src=\"https://s.w.org/images/core/emoji/12.0.0-1/72x72/1f396.png\" alt=\"🎖\" class=\"wp-smiley\" style=\"height: 1em;max-height: 1em\" />Classement individuel des personne ayant le plus contribué à WP 5.4</h2>\n\n\n\n<p>Voici la liste des personnes ayant proposé plus de 20 contributions sur la version 5.4 de WordPress&nbsp;:</p>\n\n\n\n<figure class=\"wp-block-table is-style-regular\"><table class=\"has-fixed-layout\"><thead><tr><th>Utilisateur·ice</th><th>Contributions</th><th>Pays</th><th>Entreprise</th></tr></thead><tbody><tr><td>sergeybiryukov</td><td>555</td><td>Russie</td><td>Yoast</td></tr><tr><td>jorgefilipecosta</td><td>144</td><td></td><td>Automattic</td></tr><tr><td>ellatrix</td><td>135</td><td>Pays-bas</td><td></td></tr><tr><td>youknowriad</td><td>97</td><td>Algerie</td><td>Automattic</td></tr><tr><td>aduth</td><td>85</td><td>USA</td><td>Automattic</td></tr><tr><td>epiqueras</td><td>85</td><td>Perou</td><td></td></tr><tr><td>gziolo</td><td>83</td><td>Pologne</td><td>Automattic</td></tr><tr><td>audrasjb</td><td>60</td><td>France</td><td>Whodunit</td></tr><tr><td>johnbillion</td><td>52</td><td>Royaume-Uni</td><td>Human Made Ltd</td></tr><tr><td>mkaz</td><td>50</td><td>USA</td><td>Automattic</td></tr><tr><td>desrosj</td><td>42</td><td>USA</td><td>Bluehost</td></tr><tr><td>garrett-eclipse</td><td>42</td><td>Canada</td><td>Eclipse360</td></tr><tr><td>azaozz</td><td>40</td><td>Canada</td><td></td></tr><tr><td>afercia</td><td>36</td><td>Italie</td><td>Yoast</td></tr><tr><td>joen</td><td>32</td><td>Danemark</td><td>Automattic</td></tr><tr><td>andraganescu</td><td>31</td><td></td><td></td></tr><tr><td>retrofox</td><td>30</td><td></td><td>Automattic</td></tr><tr><td>talldanwp</td><td>28</td><td>Australie</td><td></td></tr><tr><td>ianbelanger</td><td>26</td><td>USA</td><td>Bluehost</td></tr><tr><td>timothyblynjacobs</td><td>26</td><td>USA</td><td>iThemes</td></tr><tr><td>karmatosed</td><td>26</td><td>Royaume-Uni</td><td>Automattic</td></tr><tr><td>xkon</td><td>24</td><td>Grèce</td><td>WPMU DEV</td></tr><tr><td>mcsf</td><td>23</td><td>Portugal</td><td>Automattic</td></tr><tr><td>whyisjake</td><td>20</td><td>USA</td><td>Automattic / WordPress VIP</t