:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:746:\"<p>Si vous créez des extensions pour WordPress, il y a de grandes chances que vous ayiez besoin d&#8217;une page dédiée pour les réglages. Créer une page de réglages n&#8217;est pas bien compliqué, car WordPress mets à notre disposition une API pour ça. Non, pas besoin d&#8217;un framework pour créer des pages de réglages, et non, [&#8230;]</p>\n<p>Cet article <a rel=\"nofollow\" href=\"https://vincentdubroeucq.com/comment-creer-page-de-reglages-extension-wordpress/\">Comment créer une page de réglages pour une extension WordPress</a> est apparu en premier sur <a rel=\"nofollow\" href=\"https://vincentdubroeucq.com\">Vincent Dubroeucq</a>.</p><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/BBl1grsKDd0\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:80:\"https://vincentdubroeucq.com/comment-creer-page-de-reglages-extension-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}i:12;a:6:{s:4:\"data\";s:84:\"\n		        \n		        \n		        \n		        \n		        \n		        \n		        \n		    \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";s:5:\"child\";a:4:{s:0:\"\";a:5:{s:5:\"title\";a:1:{i:0;a:5:{s:4:\"data\";s:69:\"Neve: un thème WordPress ultra personnalisable à l’ère Gutenberg\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"link\";a:1:{i:0;a:5:{s:4:\"data\";s:51:\"http://feedproxy.google.com/~r/wpfr/~3/LE5d_f7wJkQ/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:4:\"guid\";a:1:{i:0;a:5:{s:4:\"data\";