s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:7:\"pubDate\";a:1:{i:0;a:5:{s:4:\"data\";s:31:\"Thu, 09 Apr 2020 15:32:51 +0000\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}s:11:\"description\";a:1:{i:0;a:5:{s:4:\"data\";s:330:\"\n		        Lorsque vous remaniez un site web ou que vous mettez à jour un ancien contenu, il est probable que la structure de vos URLs soit modifiée. ...\nThe post Redirections WordPress : Les meilleures pratiques pour maximiser le SEO et la vitesse des pages appeared first on Hébergement WordPress infogéré Kinsta.		        \";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:32:\"http://purl.org/dc/elements/1.1/\";a:1:{s:7:\"creator\";a:1:{i:0;a:5:{s:4:\"data\";s:6:\"Kinsta\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:40:\"http://purl.org/rss/1.0/modules/content/\";a:1:{s:7:\"encoded\";a:1:{i:0;a:5:{s:4:\"data\";s:36660:\"<p>Lorsque vous remaniez un site web ou que vous mettez à jour un ancien contenu, il est probable que la structure de vos URLs soit modifiée. Et si vous ne suivez pas les meilleures pratiques de redirection de WordPress, vous risquez d&rsquo;avoir un impact négatif sur l&rsquo;expérience utilisateur (UX) et sur votre référencement <a href=\"https://kinsta.com/fr/blog/que-veut-dire-referencement-seo/\">(SEO)</a>.</p>\n<p>La fonctionnalité de redirection de WordPress intégrée à la plateforme de base est conçue pour repérer les URLs incorrectes. C&rsquo;est-à-dire que lorsqu&rsquo;une mauvaise URL est demandée, WordPress essaie de localiser la bonne URL et redirige le visiteur si c&rsquo;est le cas.</p>\n<p>Dans cet article, nous expliquerons l&rsquo;importance des redirections WordPress et comment elles influencent la vitesse des pages et, bien sûr, le référencement. Nous discuterons également de la manière dont vous pouvez minimiser les redirections dans WordPress et nous vous guiderons à travers les différentes solutions que vous pouvez utiliser pour les mettre en place.</p>\n<aside id=\"sidebar-cta-mini\">\n  <div id=\"sidebar-cta-mini-aligner\">\n    <div class=\"cta-mini cta-mini--floating\">\n      <div class=\"cta-mini--light\">\n				\n				\n				<div id=\"js-mykinsta-video\" class=\"wistia_embed wistia_async_vzsjfur4md popover=true popoverAnimateThumbnail=true videoFoam=true popoverPreventScroll=true responsive-video\" style=\"background-image: url(https://kinsta.com/fr/wp-content/themes/kinsta/images/mykinsta-dashboard-v8@2x.jpg)\"></div>\n        <a class=\"button button--purple button--small\" href=\"https://demo.kinsta.com/register?utm_campaign=mykinsta%20demo&#038;utm_source=blog&#038;utm_medium=sidebar%20video%20button\">Essayer la démo gratuite</a>\n      </div>\n    </div>\n  </div>\n</aside>\n\n<p>Commençons !</p>\n		<aside class=\"toc pb--50 pt--50 mt--50 mb--50\" data-heading=\"Table des matières\" data-exclude=\"last\" data-list-style=\"arrow\" data-count-number=\"-1\" data-selector=\"h2\"></aside>\n		\n<h2>Une introduction aux redirections WordPress</h2>\n<p>Le noyau de WordPress est doté d&rsquo;une fonctionnalité de redirection destinée à aider à détecter et à corriger les URLs incorrectes. Si quelqu&rsquo;un demande une URL incorrecte, WordPress tente de localiser la bonne et redirige ensuite le visiteur si cela a réussi.</p>\n<p>Disons que vous avez une page qui se trouve sur « http://www.exemple.com/parent/page »<em>. </em>Si vous saisissez « http://exemple.com/page » dans votre navigateur, en général, WordPress est assez intelligent pour localiser automatiquement la bonne page vers laquelle vous serez redirigé.</p>\n<p>Malheureusement, <strong>ce n&rsquo;est pas toujours aussi simple</strong>. Si vous configurez votre site web pour qu&rsquo;il utilise HTTPS (de manière à forcer tout le trafic à être redirigé de l&rsquo;URL préfixée <a href=\"https://kinsta.com/fr/base-de-connaissances/rediriger-http-vers-https/\">HTTP vers HTTPS</a>), le processus de redirection devient plus complexe.</p>\n<p>Par exemple, imaginez qu&rsquo;un visiteur tente d&rsquo;accéder à la page web « https://www.exemple.com/parent/page » en saisissant « http://exemple.com/page » dans la barre d&rsquo;adresse. Le processus se déroulerait comme suit :</p>\n<ul>\n<li>Premièrement, le visiteur est redirigé de HTTP vers HTTPS.</li>\n<li>Deuxièmement, le visiteur est redirigé lorsque « www » est ajouté à l&rsquo;URL.</li>\n<li>Troisièmement, le visiteur est redirigé vers la formulation de l&rsquo;URL qui inclut la page mère dans le chemin.</li>\n<li>Enfin, le serveur commence à envoyer les fichiers et les ressources du site web au navigateur du visiteur.</li>\n</ul>\n<p>Vous pourriez penser : « C&rsquo;est génial ! Je peux massacrer un lien et le visiteur finira quand même là où il est censé être ». Dans un sens, vous auriez raison de penser cela. WordPress est très bon pour déterminer où les URLs sont censées se résoudre, ce qui signifie que les URLs mal saisies se résolvent souvent correctement.</p>\n<p>Cependant, toute cette auto-redirection a aussi un revers.</p>\n\n<h2>Comment les redirections WordPress impactent la vitesse de chargement des pages</h2>\n<p>Une fois que l&rsquo;on se rend compte à quel point WordPress est résistant, il est facile de se faire piéger en négligeant la formulation des URLs. Cela est particulièrement dangereux si vous saisissez manuellement les URLs dans les liens en ligne et les <a href=\"https://kinsta.com/fr/blog/plugins-menu-wordpress/\">menus personnalisés</a>.</p>\n<p>Ce n&rsquo;est pas grave, n&rsquo;est-ce pas ? Les visiteurs se retrouvent quand même à la bonne URL ! Bien que cela soit vrai en théorie, <strong>ce que vous négligez, c&rsquo;est l&rsquo;impact des redirections sur la vitesse de chargement des pages</strong>.</p>\n<p>Jetons un coup d&rsquo;œil sur le résultat de la vitesse des pages <a href=\"https://kinsta.com/fr/blog/test-vitesse-pingdom/\">Pingdom</a> pour un site WordPress. Ce test est basé sur l&rsquo;accès à une page en utilisant une URL correctement formulée, afin d&rsquo;éviter toute redirection :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 736px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/generatepress-redirects-example-2.png\" alt=\"Un résultat de test Pingdom avec une URL correctement formée\" width=\"736\" height=\"243\" /><p class=\"wp-caption-text\">Un résultat de test Pingdom avec une URL correctement formée</p></div>\n<p>Ce n&rsquo;est pas mal du tout. Si nous examinons les requêtes de fichiers, nous constatons qu&rsquo;il n&rsquo;y a pas de redirection lorsque le site est demandé :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1097px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/generatepress-requete-2.png\" alt=\"Une requête de fichier Pingdom\" width=\"1097\" height=\"76\" /><p class=\"wp-caption-text\">Une requête de fichier Pingdom</p></div>\n<p>Que se passe-t-il donc si nous nous trompons d&rsquo;URL et que nous refaisons le test ?</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 739px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/generatepress-resultat-formee-1-1.png\" alt=\"Un résultat de test Pingdom avec une URL mal formée\" width=\"739\" height=\"241\" /><p class=\"wp-caption-text\">Un résultat de test Pingdom avec une URL mal formée</p></div>\n<p>Cela ajoute près de 100 millisecondes au temps de chargement des pages. Bien que cela puisse sembler sans importance puisque ce site est déjà assez rapide, regardons les requêtes de fichiers pour voir ce qui s&rsquo;est passé :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1113px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/generatepress-requete-1-1.png\" alt=\"Une mauvaise URL de requête de fichier\" width=\"1113\" height=\"114\" /><p class=\"wp-caption-text\">Une mauvaise URL de requête de fichier</p></div>\n<p>Une redirection a été ajoutée au début de l&rsquo;URL. Après les redirections, la page se charge normalement. Nous pouvons donc attribuer la vitesse plus lente de la page à la redirection qui se produit lorsque l&rsquo;URL incorrecte est introduite dans le test.</p>\n<p>En fin de compte, cette redirection impacte la <a href=\"https://kinsta.com/fr/apprendre/accelerer-wordpress/\">vitesse de chargement de page</a> ce qui est préjudiciable. La différence peut être significative et mesurable.</p>\n<h2>Comment les redirections de WordPress affectent le SEO de votre site</h2>\n<p>Si vous avez une compréhension de base du référencement, vous connaissez probablement le rôle important que les liens jouent dans ce domaine. Si une URL renvoie à une page qui n&rsquo;existe plus, ou a été transférée vers un autre lien qui a été déplacé, vos visiteurs peuvent rencontrer une <a href=\"https://kinsta.com/fr/blog/erreur-404-not-found/\">erreur de page 404</a> :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 904px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/404-erreur-1.png\" alt=\"Une page d\'erreur 404 dans Chrome\" width=\"904\" height=\"365\" /><p class=\"wp-caption-text\">Une page d&rsquo;erreur 404 dans Chrome</p></div>\n<p>En plus d&rsquo;une mauvaise expérience utilisateur, une <a href=\"https://kinsta.com/fr/blog/erreur-404-not-found/\">erreur 404 « page non trouvée »</a> peut également vous nuire du point de vue du référencement. Ces erreurs 404 sont le résultat de <a href=\"https://kinsta.com/fr/blog/liens-casses/\">liens brisés</a>, qui affectent la capacité des <a href=\"https://kinsta.com/fr/blog/moteurs-recherche-alternatifs/\">moteurs de recherche</a> à explorer votre site web et à localiser ses pages.</p>\n<p>Cela indique aux moteurs de recherche que les utilisateurs sont non seulement capables de trouver ce qu&rsquo;ils cherchent, mais aussi que <a href=\"https://kinsta.com/fr/blog/sitelinks-google/\">l&rsquo;architecture de votre site</a> est médiocre et dépassée.</p>\n<p>Il est donc essentiel de mettre en place des redirections pour les pages dont l&rsquo;URL a été modifiée. Si vous <a href=\"https://kinsta.com/fr/blog/changer-votre-domaine-wordpress/\">déplacez votre site vers un nouveau domaine</a>, la configuration des redirections de WordPress peut faire en sorte que les robots des moteurs de recherche soient toujours capables d&rsquo;indexer les nouvelles URLs du site, tout en éliminant simultanément les anciennes de l&rsquo;index.</p>\n<p>Les redirections peuvent également contribuer à garantir que le jus du lien sera transmis de votre ancien domaine à votre nouveau et au sein de vos propres pages. Cependant, il est important de noter que seuls certains <a href=\"https://kinsta.com/fr/blog/codes-statut-http/\">codes de redirection HTTP</a> transmettront votre classement dans les moteurs de recherche.</p>\n<h3>Les différents types de redirections d’URL</h3>\n<p>En tant qu&rsquo;<a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-que-wordpress/\">utilisateur de WordPress</a>, le type de redirection le plus courant auquel vous aurez affaire (et le meilleur pour le référencement) est une redirection 301. Elle est utilisée pour les contenus qui ont été déplacés de façon permanente.</p>\n<p>Les redirections 301 indiquent aux moteurs de recherche que la page à laquelle vous souhaitez envoyer des visiteurs a changé ou a été déplacée et passe entre 90 et 99 % du jus de lien. Dans la plupart des cas, ce type de redirection aura pour effet que les moteurs de recherche transmettront la majorité du contenu du lien (ou de l&rsquo;autorité de la page) à la nouvelle page ou à la page mise à jour.</p>\n<p><a href=\"https://kinsta.com/fr/blog/codes-statut-http/\">D&rsquo;autres types de redirections côté serveur sont également possibles</a> :</p>\n<ul>\n<li><strong>302</strong>. Cette redirection temporaire informe les moteurs de recherche que la page est déplacée, mais pas de façon permanente. Elle ne transmet pas le jus de lien comme le fait une redirection 301.</li>\n<li><strong>303</strong>. Ce type de redirection temporaire est utilisé pour éviter que les pages qui stockent des données ne soient rafraîchies ou mises en favoris (<a href=\"https://kinsta.com/fr/blog/passerelles-paiement-woocommerce/\">formulaires de paiement</a>, pages d’atterrissage, etc.). De cette façon, les utilisateurs ne peuvent pas soumettre à nouveau les formulaires après avoir appuyé sur le bouton « retour » de leur navigateur. Ces redirections n&rsquo;influencent pas le référencement.</li>\n<li><strong>307</strong>. Une redirection 307 est similaire à une redirection 303, en ce sens qu&rsquo;elle ne doit être utilisée que pour une page temporairement déplacée. Cependant, une redirection 302 est généralement la méthode préférée.</li>\n<li><strong>308</strong>. Une redirection 308 est une redirection permanente, donc elle transmet le jus de lien et l&rsquo;autorité de la page. Comme la précédente redirection, cependant, ses effets sur le référencement ne sont pas bien connus. Dans la plupart des cas, il est préférable d&rsquo;utiliser une redirection 301.</li>\n</ul>\n<p>Comme nous l&rsquo;avons dit, tous les éléments ci-dessus sont considérés comme des redirections côté serveur.</p>\n<p>Il existe également des redirections côté client, qui sont déclenchées lorsque le navigateur d&rsquo;un utilisateur gère la redirection ou le transfert. Cependant, ces dernières ne sont pas fiables et doivent être évitées.</p>\n<p>Les redirections côté serveur sont le meilleur moyen de s&rsquo;assurer que les moteurs de recherche peuvent rapidement comprendre les redirections et transférer votre jus SEO de manière appropriée.</p>\n<h2>Rediriger ou ne pas rediriger ?</h2>\n<p>Les redirections existent pour une raison. Elles vous permettent d&rsquo;envoyer des visiteurs depuis un contenu obsolète et des URLs inexistantes vers un contenu mis à jour. Nous avons déjà couvert l&rsquo;angle des URLs inexistantes dans une certaine mesure. WordPress fait un peu cela tout seul.</p>\n<p>Cependant, WordPress ne peut pas tout attraper, et il y a des moments où des règles de redirection manuelle sont nécessaires.</p>\n<p>Par exemple, disons que vous avez écrit un article intitulé « What&rsquo;s Brand New in WordPress » à l&rsquo;époque de la sortie de WordPress 3.0. C&rsquo;était un excellent article en 2010, mais les internautes qui cherchent « ce qu&rsquo;il y a de neuf dans WordPress » aujourd&rsquo;hui en 2020 veulent des informations plus récentes. Vous voulez garder ces lecteurs heureux, alors <a href=\"https://kinsta.com/fr/blog/conseils-relecture/\">vous rédigez un nouvel article</a> sur les fonctionnalités incluses dans une prochaine version de WordPress.</p>\n<p>Dans ce scénario, une réorientation de l&rsquo;ancien article vers le nouvel article est parfaitement acceptable et appropriée. En outre, dans ce cas, une redirection est une <a href=\"https://kinsta.com/blog/wordpress-seo\">bonne pratique de référencement</a>. Le jus de lien attribué à l&rsquo;ancien article sera plutôt transmis à votre nouvel article, ce qui lui donnerait un poids instantané dans les moteurs de recherche.</p>\n<p>Il existe plusieurs scénarios dans lesquels les redirections sont appropriées, notamment</p>\n<ul>\n<li>Vous avez publié un contenu mis à jour et vous voulez éloigner les visiteurs de l&rsquo;ancienne version.</li>\n<li>Vous avez remanié <a href=\"https://kinsta.com/fr/blog/reecriture-url-permaliens-wordpress/\">la structure des permaliens d’un</a> <a href=\"https://kinsta.com/fr/blog/reecriture-url-permaliens-wordpress/\">site web</a> et devez rediriger les anciennes URL vers leur nouvelle structure.</li>\n<li>Vous mettez à jour une page ou un article publié et souhaitez rediriger temporairement le trafic vers un autre article ou une autre page pendant que vous travaillez sur la mise à jour.</li>\n</ul>\n<h3>Quand ne pas rediriger</h3>\n<p>Dans tous les scénarios ci-dessus, des <strong>redirections sont nécessaires</strong> pour envoyer les visiteurs d&rsquo;un contenu obsolète et d&rsquo;URLs brisées vers un contenu mis à jour. Elles sont également utiles comme mesure temporaire pendant qu&rsquo;un contenu spécifique est mis à jour.</p>\n<p>Alors, quand n&rsquo;est-il <em>pas</em> approprié d&rsquo;utiliser une redirection WordPress ? Par exemple, si vous avez construit un <a href=\"https://kinsta.com/fr/blog/plugins-menu-wordpress/\">menu personnalisé</a> en utilisant des URLs qui n&rsquo;incluent pas « www », mais que l&rsquo;URL de votre site se résout avec le sous-domaine « www » au début de l&rsquo;URL, vous faites une erreur.</p>\n<p>L&rsquo;utilisation de redirections dans ce scénario n&rsquo;est pas appropriée et nuit à <a href=\"https://kinsta.com/fr/apprendre/vitesse-de-site/\">la vitesse</a> et au SEO de votre site.</p>\n<h2>Comment réduire les redirections dans WordPress</h2>\n<p>Si vous êtes convaincu de la nécessité de réduire les redirections dans WordPress, il y a deux choses importantes à faire.</p>\n<h3>1. Ne jamais créer de redirections non nécessaires</h3>\n<p>La première chose à retenir est de ne jamais créer intentionnellement des redirections inutiles. Par exemple, vous ne devez pas créer de redirections lorsque vous créez des liens et des menus internes.</p>\n<p>Si vous avez pris l&rsquo;habitude de saisir les URL paresseusement, il est préférable de repenser votre façon de travailler. Au contraire, lorsque vous créez une URL, assurez-vous que vous :</p>\n<ul>\n<li>Utilisez le préfixe de protocole approprié (HTTP ou HTTPS).</li>\n<li>Incluez ou excluez le sous-domaine « www » selon le cas.</li>\n<li>N&rsquo;utilisez pas les IDs d’article et de page dans les liens.</li>\n<li>Incluez le chemin d&rsquo;accès complet à la page ou à l&rsquo;article.</li>\n</ul>\n<p>Le pouvoir de redirection intégré dans WordPress est censé être un moyen de secours, au cas où vous créeriez accidentellement une mauvaise URL. Ce n&rsquo;est pas une solution très fiable pour les URL paresseuses en général.</p>\n<h3>2. Assurez-vous que votre domaine de premier niveau (TLD) ne soit pas redirigé plus d&rsquo;une fois</h3>\n<p>La deuxième chose que vous pouvez faire pour minimiser l&rsquo;occurrence des redirections de WordPress est de vous assurer que votre <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-qu-un-tld/\">domaine de premier niveau (TLD)</a> se résout avec pas plus d&rsquo;une redirection. Votre objectif est de vous assurer que la bonne URL est atteinte par une seule redirection ou moins, quelle que soit la combinaison de préfixe de protocole et de sous-domaine qu&rsquo;un visiteur lance devant le TLD.</p>\n<p>Prenons un exemple. Toutes les URLs suivantes devraient se résoudre au TLD avec au maximum une redirection et l&rsquo;une d&rsquo;entre elles devrait se résoudre sans redirection :</p>\n<ul>\n<li>http://exemple.com</li>\n<li>http://www.exemple.com</li>\n<li>https://exemple.com</li>\n<li>https://www.exemple.com</li>\n</ul>\n<p>Si vous n&rsquo;êtes pas sûr du nombre de redirections nécessaires pour résoudre l&rsquo;URL de votre site en utilisant ces différentes combinaisons de préfixes de protocole et de <a href=\"https://kinsta.com/fr/blog/sous-domaine-wordpress/\">sous-domaines</a>, vous pouvez le vérifier en utilisant le <a href=\"https://varvy.com/tools/redirects/\">mappeur de redirection de Patrick Sexton</a> :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1600px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/redirect-mapper-1-1.png\" alt=\"L\'outil Redirect mapper\" width=\"1600\" height=\"624\" /><p class=\"wp-caption-text\">L&rsquo;outil Redirect mapper</p></div>\n<p>Vous trouverez ci-dessous un exemple de la manière dont les redirections qui ne sont pas correctement configurées sont facilement repérables grâce à ce mappeur de redirection :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1084px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/mal-redirections-configurees-1.png\" alt=\"Redirections mal configurées\" width=\"1084\" height=\"420\" /><p class=\"wp-caption-text\">Redirections mal configurées</p></div>\n<p>Vous pouvez voir qu&rsquo;il y a des redirections en double dans la version « www » du domaine. À l&rsquo;inverse, voici un exemple de redirections correctement mises en place :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 955px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/place-correctement-redirections-1.png\" alt=\"Redirections correctement mises en place\" width=\"955\" height=\"296\" /><p class=\"wp-caption-text\">Redirections correctement mises en place</p></div>\n<p>Comme vous pouvez le voir, il n&rsquo;y a qu&rsquo;une seule redirection qui se produit à la fois pour les « www » et les « non www ».</p>\n<p>Si vous constatez que certaines de ces combinaisons ne se résolvent pas (renvoi d&rsquo;un <a href=\"https://kinsta.com/fr/blog/codes-statut-http/\">code de statut de serveur 404</a>) ou nécessitent plus d&rsquo;une redirection pour être résolues, il est temps de se mettre au travail.</p>\n<h2>Mise en place de redirections au niveau du serveur</h2>\n<p>Une méthode que vous pouvez utiliser pour configurer une redirection WordPress est d&rsquo;ajouter une ou plusieurs règles de redirection à votre serveur. Cela permettra aux visiteurs d&rsquo;arriver le plus rapidement possible à la bonne formulation d&rsquo;URL de votre site.</p>\n<p>L&rsquo;objectif de base que vous essayez d&rsquo;atteindre est de créer des règles de redirection qui ciblent toute formulation d&rsquo;URL nécessitant plus d&rsquo;une redirection. Vous voulez forcer ces URLs à se résoudre directement à l&rsquo;URL correctement formulée.</p>\n<p>Par exemple, si l&rsquo;URL « http://exemple.com » nécessite deux redirections pour arriver à « https://www.exemple.com », vous pouvez créer une redirection manuelle qui permet de le faire en une seule étape (au lieu de deux).</p>\n<h3>Règles de redirection dans Apache</h3>\n<p>Si votre site est hébergé sur une <a href=\"https://en.wikipedia.org/wiki/LAMP_(software_bundle)\">pile LAMP</a> standard, vous devrez ajouter des règles de réécriture d&rsquo;URL au <a href=\"https://kinsta.com/fr/base-de-connaissances/fichier-htaccess-wordpress/\">fichier</a><a href=\"https://kinsta.com/fr/base-de-connaissances/fichier-htaccess-wordpress/\"> .htaccess de</a> votre site<a href=\"https://kinsta.com/fr/base-de-connaissances/fichier-htaccess-wordpress/\">.</a> La mise en place d&rsquo;une redirection WordPress via un fichier de configuration de serveur web est un processus technique et peut être compliqué.</p>\n<p>Par conséquent, n&rsquo;utilisez cette méthode que si vous êtes à l&rsquo;aise pour modifier votre fichier <em>.htaccess. </em>Même si vous l&rsquo;êtes, il est toujours bon de <a href=\"https://kinsta.com/fr/base-de-connaissances/comment-sauvegarder-base-de-donnees-mysql-avec-phpmyadmin/\">d’abord créer une sauvegarde</a> du fichier.</p>\n<p>Ensuite, la première étape consiste à se connecter à votre installation WordPress à l&rsquo;aide d&rsquo;un <a href=\"https://kinsta.com/fr/blog/meilleurs-clients-ftp/\">client FTP,</a> ou par le biais <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-que-cpanel/\">du gestionnaire de fichiers du</a> <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-que-cpanel/\">cPanel</a> de votre hébergement. Vous pouvez localiser le fichier<em> .htaccess</em> dans le répertoire racine de votre site WordPress.</p>\n<p>Pour mettre en place une redirection 301, vous devrez spécifier les anciens et nouveaux emplacements d&rsquo;URL avec une structure syntaxique qui ressemble à ceci :</p>\n<p><code>Redirect 301 \"old-page\" \"new-page\"</code></p>\n<p>Si vous souhaitez rediriger tout le trafic de votre site de <a href=\"https://stackoverflow.com/questions/13977851/htaccess-redirect-to-https-www\">HTTP vers HTTPS</a>, vous pouvez utiliser les moyens suivants</p>\n<pre><code class=\"language-apacheconf\">&lt;IfModule mod_rewrite.c&gt;\n\nRewriteEngine On\nRewriteCond !{HTTPS} off\nRewriteRule ^(.*)$ https://www.%{HTTP_HOST}%{REQUEST_URI} [L,R=301]\nRewriteCond %{HTTP_HOST} !^www\\.\nRewriteRule ^(.*)$ https://www.%{HTTP_HOST}%{REQUEST_URI} [L,R=301]\n\n&lt;/IfModule&gt;</code></pre>\n<p>Gardez à l&rsquo;esprit qu&rsquo;avant de faire cela, il est important de vous assurer que votre <a href=\"https://kinsta.com/fr/base-de-connaissances/comment-installer-un-certificat-ssl/\">certificat SSL </a>est correctement configuré sur le nouveau site WordPress.</p>\n<h3>Règles de redirection dans Nginx</h3>\n<p>Si vous utilisez une <a href=\"https://kinsta.com/knowledgebase/htaccess/\">configuration d&rsquo;hébergement plus avancée</a>, il y a de fortes chances qu&rsquo;elle soit <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-que-nginx/\">propulsée par Nginx</a> plutôt que par <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-qu-apache/\">Apache</a>. Dans ce cas, les choses ne sont pas aussi simples.</p>\n<p>Si vous êtes un <a href=\"https://kinsta.com/fr/plans/\">utilisateur de Kinsta</a>, n&rsquo;hésitez pas à passer à la section suivante.</p>\n<p>La configuration de la redirection varie d&rsquo;un hébergeur à l&rsquo;autre et vous devrez contacter le support de votre hébergeur pour résoudre le problème de redirection.</p>\n<p>Cependant, si vous avez confiance en vos capacités, vous pouvez créer une redirection dans Nginx en créant un bloc serveur pour le contenu que vous souhaitez rediriger, en utilisant le code suivant :</p>\n<pre><code class=\"language-nginx\">server {\n	listen 80;\n	server_name domain1.com;\n	return 301 $scheme://domain2.com$request_uri;\n}</code></pre>\n<p>Dans la directive ci-dessus, le terme « return » est utilisé pour une substitution d&rsquo;URL. Il renvoie le code de statut spécifié dans l&rsquo;URL de redirection. La variable « $scheme » utilise le schéma de la requête http/https originale et renvoie le code de redirection 301 avec la nouvelle URL.</p>\n<p>Une autre option est d&rsquo;utiliser :</p>\n<pre><code class=\"language-nginx\">rewrite ^/$ http://www.domain2.com permanent;\nrewrite ^/(.*)$ http://www.domain2.com/$1 permanent;\n</code></pre>\n<p>Cela peut être utilisé pour créer une redirection permanente. Pour des informations plus détaillées, vous pouvez consulter les conseils de F5 Network sur la <a href=\"https://www.nginx.com/blog/creating-nginx-rewrite-rules/\">création de règles de réécriture Nginx</a>.</p>\n<h4>Règles de redirection dans MyKinsta</h4>\n<p>Si votre site est hébergé par Kinsta, <strong>il est facile de mettre en place des redirections</strong>. Vous pouvez utiliser notre <a href=\"https://kinsta.com/fr/base-de-connaissances/regles-redirection/\">outil de règles de redirection</a> dans MyKinsta pour créer des redirections 301 et 302.</p>\n<p>Après vous être connecté à votre MyKinsta, cliquez sur votre site et allez sur <strong>Redirections</strong>, puis sur <strong>Ajouter une règle de redirection</strong> :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1914px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/redirection-regle-mykinsta.png\" alt=\"Ajouter ne règle de redirection dans MyKinsta\" width=\"1914\" height=\"1066\" /><p class=\"wp-caption-text\">Ajouter ne règle de redirection dans MyKinsta</p></div>\n<p>Ensuite, sur l&rsquo;écran de d&rsquo;<strong>ajout de règle de redirection</strong>, vous pouvez choisir le préfixe de domaine pour lequel ajouter la redirection. En général, vous voudrez rediriger à la fois le trafic www et non www, auquel cas vous choisirez <strong>Tous les domaines</strong> :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 900px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/kinsta-redirection-regle-1.png\" alt=\"L\'écran « Ajouter une règle de redirection » dans MyKinsta.\" width=\"900\" height=\"526\" /><p class=\"wp-caption-text\">L&rsquo;écran « Ajouter une règle de redirection » dans MyKinsta.</p></div>\n<p>Une fois que c&rsquo;est clair, vous devrez alors remplir les champs <strong>Rediriger de</strong> et <strong>Rediriger vers</strong>.</p>\n<p>Sous le <strong>code de statut HTTP</strong>, vous pouvez facilement choisir le type de règle de redirection que vous souhaitez utiliser : 301 ou 302. Lorsque vous êtes satisfait de votre choix, cliquez sur <strong>Ajouter une règle de redirection</strong>.</p>\n<p>Gardez à l&rsquo;esprit que, comme notre outil de redirection utilise automatiquement regex, vous devez ajouter « ^ » avant chaque chemin « de ». Cela l&#8217;empêchera de créer une boucle de redirection avec d&rsquo;autres URL. Bien que cet outil soit assez simple, vous pouvez toujours contacter le support si vous avez des questions ou si vous avez besoin d&rsquo;aide.</p>\n<p>L&rsquo;ajout de redirections dans MyKinsta signifie que les règles sont mises en œuvre au niveau du serveur, ce qui est la manière optimale. Cependant, il existe également des extensions WordPress avec lesquelles vous pouvez mettre en place des redirections pour les sites WordPress.</p>\n<p>Avant d&rsquo;examiner de plus près les extensions de redirection, il est important de noter que leur utilisation peut parfois causer des problèmes de performance. La plupart d&rsquo;entre eux utilisent la <a href=\"https://developer.wordpress.org/reference/functions/wp_redirect/\">fonction wp_redirect</a>, qui nécessite une exécution de code et des ressources supplémentaires.</p>\n<h2>Créer une redirection WordPress avec une extension</h2>\n<p>Si votre hébergeur ne dispose pas d&rsquo;une fonction de règles de redirection, vous devrez peut-être utiliser une extension WordPress. De nombreuses extensions de redirection sont disponibles et <a href=\"https://wordpress.org/plugins/redirection/\">Redirection</a> est l&rsquo;une des plus populaires que vous pouvez utiliser :</p>\n<div class=\"wp-caption alignnone\" style=\"max-width: 1600px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/03/wordpress-redirection-plugin-1.jpg\" alt=\"L’extension WordPress Redirection\" width=\"1600\" height=\"516\" /><p class=\"wp-caption-text\">L’extension WordPress Redirection</p></div>\n<p>Cette extension est très facile à utiliser et peut être configurée pour créer des redirections en utilisant du code WordPress, des <em>.htaccess</em> sur les serveurs Apache ou des redirections de serveur Nginx. De plus, elle est gratuite.</p>\n<p>Voici comment démarrer avec l’extension Redirection.</p>\n<p>Après l&rsquo;avoir téléchargé à partir du répertoire des extensions, vous pouvez la localiser en allant sur <strong>Outils &gt; Redirection</strong> :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1897px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/redirection-extension.png\" alt=\"Page d\'accueil de l’extension WordPress Redirection\" width=\"1897\" height=\"1058\" /><p class=\"wp-caption-text\">Page d&rsquo;accueil de l’extension WordPress Redirection</p></div>\n<p>Cela vous amènera à une page d&rsquo;accueil. Cliquez sur le bouton « <strong>Démarrer la configuration</strong> », puis suivez la série d&rsquo;invites. Une fois que c&rsquo;est fait, vous pouvez commencer à l&rsquo;utiliser.</p>\n<h3>Comment ajouter manuellement une nouvelle redirection</h3>\n<p>Vous pouvez ajouter manuellement une nouvelle redirection en cliquant sur le bouton <strong>Ajouter</strong>, puis en saisissant les URL source et cible dans les champs respectifs du formulaire et en cliquant sur le bouton <strong>Ajouter une redirection</strong> :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1735px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/ajouter-redirection-1.png\" alt=\"L\'écran Ajouter une nouvelle redirection dans l’extension Redirection\" width=\"1735\" height=\"751\" /><p class=\"wp-caption-text\">L&rsquo;écran Ajouter une nouvelle redirection dans l’extension Redirection</p></div>\n<p>Cette approche n&rsquo;est recommandée que si vous n&rsquo;avez que quelques URL à rediriger. Si vous avez affaire à un site entier, vous êtes encouragé à gagner du temps en utilisant la fonction d&rsquo;importation d&rsquo;URL de l’extension.</p>\n<h3>Importation/exportation de redirections</h3>\n<p>Une autre façon utile d&rsquo;utiliser cette extension est d&rsquo;importer et d&rsquo;exporter des redirections. Par exemple, vous pouvez exporter d&rsquo;anciennes URLs de votre site web, puis utiliser l’extension sur un nouveau site pour importer la liste.</p>\n<p>Pour ce faire, installez et activez l’extension Redirection sur votre ancien site web. Ensuite, à partir de votre tableau de bord d&rsquo;administration WordPress, allez dans <strong>Outils &gt; Redirection &gt; Import/Export</strong>.</p>\n<p>En bas de l&rsquo;écran, sous <strong>Exporter</strong>, vous pouvez tout exporter vers un fichier CSV, Apache <em>.htaccess,</em> Nginx rewrite rules, ou Redirection JSON :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1093px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/extension-redirection-1.png\" alt=\"La section « Exporter » de l’extension WordPress Redirection\" width=\"1093\" height=\"462\" /><p class=\"wp-caption-text\">La section « Exporter » de l’extension WordPress Redirection</p></div>\n<p>Ensuite, avec l’extension installée sur votre nouveau site, vous pouvez vous rendre sur le même écran pour importer le fichier :</p>\n<div class=\"wp-caption aligncenter\" style=\"max-width: 1719px\"><img src=\"https://kinsta.com/fr/wp-content/uploads/sites/4/2020/04/importing-redirection-1.png\" alt=\"L\'écran Import/Export de l’extension Redirection\" width=\"1719\" height=\"424\" /><p class=\"wp-caption-text\">L&rsquo;écran Import/Export de l’extension Redirection</p></div>\n<p>Cliquez sur le bouton <strong>Ajouter un fichier</strong> et sélectionnez le fichier. Une fois le fichier téléversé, vous pouvez trouver les nouvelles URLs sous l&rsquo;onglet <strong>Redirections</strong>.</p>\n<h2>Autres extensions WordPress de redirection</h2>\n<p>Ce n&rsquo;est pas la seule extension WordPress de redirection que vous pouvez utiliser. <a href=\"https://wordpress.org/plugins/eps-301-redirects/\">301 Redirects</a> est une autre extension populaire qui sera préférée par les utilisateurs à la recherche d&rsquo;une liste d&rsquo;options de configuration. Avec plus de 80 000 installations actives, elle a certainement été bien testée. Elle est facile à apprendre, possède une interface bien conçue et peut être utilisée pour créer manuellement des redirections 301 et 302.</p>\n<p>Une fonctionnalité particulièrement intéressante est un <a href=\"https://kinsta.com/fr/base-de-connaissances/menu-deroulant-wordpress/\">menu déroulant</a> permettant de sélectionner des pages, des articles, des pages de médias et des pages d&rsquo;archives comme cible de redirection. Cela permet de garantir que les règles de redirection créées manuellement se résolvent sans aucun problème. Vous pouvez également conserver des requête chaînes dans les redirections.</p>\n\n<h2>Résumé</h2>\n<p>C&rsquo;est simple : si elles sont mal implémentées, les redirections WordPress peuvent ralentir votre site. C&rsquo;est pourquoi il vaut la peine de prendre le temps de <strong>minimiser le nombre de redirections</strong>.</p>\n<p>Vous pouvez le faire en évitant de créer des redirections inutiles et en vous assurant que votre <a href=\"https://kinsta.com/fr/base-de-connaissances/qu-est-ce-qu-un-tld/\">TLD </a>se résout avec une seule redirection.</p>\n<p>Cependant, il y a des moments où il est approprié de créer et d&rsquo;utiliser intentionnellement la redirection. Lorsque c&rsquo;est le cas, il y a deux façons de procéder :</p>\n<ul>\n<li>Vous pouvez configurer des redirections au niveau du serveur. Certains fournisseurs d&rsquo;hébergement proposent des fonctionnalités qui peuvent vous aider, comme l&rsquo;<a href=\"https://kinsta.com/fr/base-de-connaissances/regles-redirection/\">outil de règles de redirection</a> ici chez Kinsta.</li>\n<li>Utilisez une extension WordPress telle que Redirection pour ajouter manuellement quelques redirections ou importer une liste de redirections d&rsquo;URL.</li>\n</ul>\n<p>En limitant l&rsquo;utilisation de la redirection aux instances nécessaires et en utilisant les meilleures pratiques WordPress de redirection, vous contribuez à ce que vos visiteurs aient l&rsquo;expérience la plus rapide possible et à ce que <a href=\"https://kinsta.com/fr/blog/suivi-des-conversions/\">vos taux de conversion ne diminuent pas</a>.</p>\n<p>De plus, vous n&rsquo;aurez pas à craindre de nuire à <a href=\"https://kinsta.com/blog/wordpress-seo\">votre SEO</a> et de perdre votre classement !</p>\n<p>Qu&rsquo;en pensez-vous ? Avez-vous rencontré des problèmes de performance dus à un trop grand nombre de redirections ? Faites-le nous savoir dans la section des commentaires ci-dessous !</p>\n<p>The post <a rel=\"nofollow\" href=\"https://kinsta.com/fr/blog/redirections-wordpress/\">Redirections WordPress : Les meilleures pratiques pour maximiser le SEO et la vitesse des pages</a> appeared first on <a rel=\"nofollow\" href=\"https://kinsta.com/fr\">Hébergement WordPress infogéré Kinsta</a>.</p><img src=\"http://feeds.feedburner.com/~r/wpfr/~4/ejRwhzDv3XM\" height=\"1\" width=\"1\" alt=\"\"/>\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:8:\"origLink\";a:1:{i:0;a:5:{s:4:\"data\";s:50:\"https://kinsta.com/fr/blog/redirections-wordpress/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}s:52:\"http://backend.userland.com/creativeCommonsRssModule\";a:1:{s:7:\"license\";a:1:{i:0;a:5:{s:4:\"data\";s:49:\"http://creativecommons.org/licenses/by-nc-sa/3.0/\";s:7:\"attribs\";a:0:{}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:27:\"http://www.w3.org/2005/Atom\";a:1:{s:4:\"link\";a:2:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:3:{s:3:\"rel\";s:4:\"self\";s:4:\"type\";s:19:\"application/rss+xml\";s:4:\"href\";s:32:\"http://feeds.feedburner.com/wpfr\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}i:1;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:2:{s:3:\"rel\";s:3:\"hub\";s:4:\"href\";s:32:\"http://pubsubhubbub.appspot.com/\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}s:42:\"http://rssnamespace.org/feedburner/ext/1.0\";a:1:{s:4:\"info\";a:1:{i:0;a:5:{s:4:\"data\";s:0:\"\";s:7:\"attribs\";a:1:{s:0:\"\";a:1:{s:3:\"uri\";s:4:\"wpfr\";}}s:8:\"xml_base\";s:0:\"\";s:17:\"xml_base_explicit\";b:0;s:8:\"xml_lang\";s:0:\"\";}}}}}}}}}}}}s:4:\"type\";i:128;s:7:\"headers\";O:42:\"Requests_Utility_CaseInsensitiveDictionary\":1:{s:7:\"\0*\0data\";a:11:{s:12:\"content-type\";s:23:\"text/xml; charset=UTF-8\";s:4:\"etag\";s:27:\"fVZhharkORPXiOICvd00ZdrmXJw\";s:13:\"last-modified\";s:29:\"Thu, 30 Apr 2020 08:29:57 GMT\";s:16:\"content-encoding\";s:4:\"gzip\";s:4:\"date\";s:29:\"Thu, 30 Apr 2020 08:31:12 GMT\";s:7:\"expires\";s:29:\"Thu, 30 Apr 2020 08:31:12 GMT\";s:13:\"cache-control\";s:18:\"private, max-age=0\";s:22:\"x-content-type-options\";s:7:\"nosniff\";s:16:\"x-xss-protection\";s:13:\"1; mode=block\";s:6:\"server\";s:3:\"GSE\";s:7:\"alt-svc\";s:169:\"h3-Q050=\":443\"; ma=2592000,h3-Q049=\":443\"; ma=2592000,h3-Q048=\":443\"; ma=2592000,h3-Q046=\":443\"; ma=2592000,h3-Q043=\":443\"; ma=2592000,quic=\":443\"; ma=2592000; v=\"46,43\"\";}}s:5:\"build\";s:14:\"20130911040210\";}', 'no');
