(1, 1, '2020-04-29 16:11:25', '2020-04-29 14:11:25', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball est inventé en décembre 1891 par James Naismith, professeur d\'éducation physique canado-américain au <em>Springfield College</em>, dans l\'État du Massachusetts (États-Unis). Lors d\'une journée de pluie, Naismith tente d\'assurer malgré tout son cours de sport, et essaie de développer un sport d\'intérieur pour maintenir la condition physique de ses élèves entre les saisons de football américain et de baseball, pendant les longs hivers de la Nouvelle-Angleterre. Il souhaite leur trouver une activité où les contacts physiques sont restreints, afin d\'éviter les risques de blessure.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Après avoir écarté certains jeux trop violents ou peu appropriés à une pratique en salle, il reprend l\'idée d\'un ancien jeu de balle maya (le <em>Pok-ta-pok</em>) et place deux caisses de pêches sur les rampes du gymnase, à 3,05 mètres de hauteur (dix pieds). Le but du jeu est de faire pénétrer un ballon dans ces caisses en bois pour marquer un <q>panier</q>. Contrairement aux paniers actuels, la caisse de pêches dispose d\'un fond : la balle devait donc être récupérée manuellement après chaque <q>panier</q> inscrit. Afin d\'éviter d\'avoir à rechercher systématiquement la balle, le fond du panier est évidé pour pouvoir l\'extraire avec une longue perche. Naismith établit rapidement treize règles principales (les Treize règles originelles) pour rendre le jeu praticable ; la majorité sont encore en vigueur. Ces règles comportent notamment l\'interdiction de courir en tenant la balle (marcher) et de <q>donner des coups d\'épaule, de tenir, de pousser ou de faire tomber de quelconque manière</q> l\'adversaire. Elles définissent en outre la durée d\'une partie : quatre quarts-temps de quinze minutes, avec une pause de cinq minutes entre elles.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Ce sport est baptisé basket-ball, ce qui signifie littéralement en anglais « ballon panier ». Il est d\'abord pratiqué avec un ballon de football, puis avec des balles de couleur brune. Le tout premier match public de basket-ball est joué le 11 mars 1892 entre des élèves d\'une classe d\'étudiants de la <em>Springfield Christian Training Association</em> et leurs enseignants. Les étudiants gagnent 5-1 ; le seul panier marqué par les enseignants est celui du célèbre entraîneur de football américain Amos Alonzo Stagg. La même année, le jeu est adapté pour être joué par des femmes. Le premier match féminin se déroule en 1893 au <em>Smith College</em> de Northampton, dans le Massachusetts. Dès 1897-1898, le nombre de joueurs par équipe est fixé à cinq. À l\'occasion d\'une démonstration au Y.M.C.A. de New York en avril 1892, la discipline gagne une première mention dans The New York Times. Il est présenté comme <q>un nouveau sport de balle, un substitut du football sans ses aspects brutaux</q>. Les premiers articles sur ce sport en France datent de 1897. Dans ce dernier pays, il est d\'abord plutôt considéré comme un sport féminin et se fait encore appeler « balle au panier ».</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1906, les caisses en bois sont finalement remplacées par des anneaux en métal fixés à des panneaux. La balle passe ainsi à travers un arceau et retombe au sol lorsqu\'un panier est inscrit. Le panneau sert quant à lui à éviter que la balle n\'atterrisse dans les tribunes, et permet d\'effectuer des tirs avec rebond. Dans son journal, découvert en 2006 par sa petite-fille, James Naismith fait part de ses appréhensions quant au jeu qu\'il a inventé, et indique qu\'il y a introduit certaines règles d\'un jeu enfantin médiéval, le <em>Duck on a Rock</em>.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au début de son histoire, le basket-ball est surtout porté sur le jeu offensif et la défense est reléguée au second plan. La défense est alors la phase passive du basket-ball, où les joueurs attendent l\'échec de l\'adversaire ; elle a depuis acquis un rôle comparable à celui de l\'attaque. Par ailleurs, la passe et le tir étaient les seules manières de déplacer la balle vers le panier. En effet, le dribble n\'existait pas dans le basket-ball originel, hormis lors d\'une éventuelle passe à un coéquipier avec rebond au sol : il était rendu difficile par la forme asymétrique des premiers ballons. Il est devenu essentiel dans le jeu à partir des années 1950, lorsque les ballons manufacturés eurent une forme régulière et les qualités de rebond nécessaires.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le sport prend diverses appellations en fonction des pays. En espagnol, il est nommé <em>baloncesto</em> (Espagne) ou <em>básquetbol</em> (Argentine); en italien <em>pallacanestro</em> ; et en tchèque <em>košíková</em>.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":22,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Dr._James_Naismith-1.jpg\" alt=\"\" class=\"wp-image-22\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">James Naismith, inventeur du basketball, avec un ballon et un panier.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":23,\"width\":376,\"height\":529,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Firstbasketball.jpg\" alt=\"\" class=\"wp-image-23\" width=\"376\" height=\"529\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le premier terrain de basket-ball au <em>Springfield College</em>.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Histoire du basket-ball', '', 'publish', 'open', 'open', '', 'bonjour-tout-le-monde', '', '', '2020-04-30 14:48:33', '2020-04-30 12:48:33', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?p=1', 0, 'post', '', 0),
(2, 1, '2020-04-29 16:11:25', '2020-04-29 14:11:25', '<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Matériel</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball se joue généralement dans un endroit couvert, comme un gymnase, mais peut aussi être pratiqué sur des aires de jeu en tant que loisir, sous sa variante la plus populaire&nbsp;: le <em>streetball</em> («&nbsp;basket-ball de rue&nbsp;»). Le terrain est doublement symétrique, en longueur et en largeur. Ses dimensions varient, selon les pays ou les normes internationales, de 22,50 à 29&nbsp;mètres de long sur 13 à 15&nbsp;mètres de large. Les terrains en extérieur (<em>playgrounds</em>) peuvent être goudronnés ou en terre battue. Les terrains couverts sont généralement réalisés en parquet, avec des lattes d\'érable disposées dans le sens de la longueur. Le nom et le logo de l\'équipe résidente sont souvent peints sur le cercle central. Les salles accueillant des matchs en compétition possèdent des équipements supplémentaires comme l\'horloge des 24 secondes, une table de marque (sur le côté), des tableaux d\'affichage et des compteurs. Aux États-Unis, la plupart comprennent également des écrans suspendus au plafond.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Aux deux extrémités du terrain se trouve un panier, formé par un anneau (ou <em>arceau</em>) métallique situé à 3,05&nbsp;m du sol, en dessous duquel est attaché un filet ouvert en son centre. L\'arceau est fixé à un panneau rectangulaire vertical (la <q>planche</q>) sur lequel la balle peut rebondir lors d\'un tir. Certains arceaux peuvent s\'incliner lorsqu\'un joueur effectue un dunk puis revenir en position horizontale (les anneaux inclinables).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Sous chaque panier se trouve une zone rectangulaire appelée la raquette (ou zone restrictive). Un arc de cercle situé à 6,25&nbsp;m (6,75&nbsp;m depuis 2010 pour les championnats de Pro A, Pro B, N1 français et basket-ball féminin&nbsp;; 7,23&nbsp;m en NBA) de chaque panier représente la ligne de tirs à trois points. Sous l\'anneau est tracé un arc de cercle d\'un rayon de 1,25&nbsp;m dans lequel aucun passage en force d\'un attaquant ne sera sifflé par l\'arbitre.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le ballon de basket-ball standard est de forme sphérique, et a une masse de 650&nbsp;g et un diamètre de 24&nbsp;cm. Sa pression intérieure est de 0,55 atm. Initialement, le basket-ball se pratiquait avec un ballon de football, puis des ballons spécifiques de couleur marron. Ce n\'est qu\'à la fin des années 1950 que Tony Hinkle, désireux de créer une balle plus visible des joueurs et des spectateurs, développe la balle de couleur orange encore utilisée aujourd\'hui. Constituée de huit pièces de cuir cousues autour d\'une chambre à air, il existe en plusieurs tailles&nbsp;: 7 pour les hommes, 6 pour les femmes, et de 5 à 3 pour les jeunes joueurs. Le ballon officiel de la NBA est fabriqué par Spalding, et celui de la FIBA par l\'équipementier japonais Molten.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":48,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Basketball_court_fiba-586x1024.png\" alt=\"\" class=\"wp-image-48\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un terrain de basket-ball selon les règles de la FIBA.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":49,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Lifetime_Basketball_Hoop.jpg\" alt=\"\" class=\"wp-image-49\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un panier de basket-ball à l\'extérieur, avec un arceau, un filet et un panneau transparent.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Vêtements et accessoires</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout début du siècle, les joueurs portaient des maillots en tricot de laine et des pantalons en étoffe. La dureté du jeu et le mauvais état des terrains imposait en outre le port de protections aux genoux, aux coudes et aux tibias. Dès les années 1910, le port du maillot se développe et les pantalons en étoffe sont remplacés par des shorts. Dans les années 1960, l\'habillement des joueurs évolue&nbsp;: les maillots deviennent plus légers et sont progressivement réalisés en fibres synthétiques. À l\'initiative notamment de Michael Jordan, les shorts sont allongés et les maillots rendus plus larges. En outre, certains joueurs portent des gaines au bras effectuant les tirs, ou plus rarement aux doigts&nbsp;: les <em>sleeves</em>. D\'autres comme Slick Watts ou Bill Walton ont rendu populaires les bandeaux, portés autour de la tête ou au poignet. Fabriqués en nylon et élasthanne extensibles, ils sont destinés à garder les muscles chauds ou éponger la sueur, mais sont aussi utilisés comme un accessoire de style.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les chaussures de basket-ball ont également changé au fil du temps. Au début du siècle, la plupart des joueurs portaient des chaussures de cuir peu confortables. En 1903, l\'équipementier sportif Spalding met en vente un modèle spécialement conçu pour le basket-ball, avec un système de ventouses pour éviter de glisser. Des modèles en toile et en caoutchouc ont ensuite été créés, parfois sur les conseils de joueurs comme Chuck Taylor, qui contribua au développement des Converse. Les Chuck Taylor All Star et les Keds sont les chaussures les plus utilisées dans les années 1960 et 1970. À partir des années 1980 apparaît la forme actuelle des chaussures de basket-ball, avec une forme montante cachant la malléole médiale afin d\'éviter les risques de torsion de la cheville&nbsp;: Nike et Adidas dominent alors le marché. Les plus grands joueurs sont sponsorisés par des fabricants de baskets, tel Michael Jordan avec Nike: ce dernier a d\'ailleurs développé sa propre collection de baskets nommée Air Jordan. Si les chaussures de basket-ball se sont imposées en compétition et sont par exemple obligatoires lors des Jeux olympiques, il est cependant possible de pratiquer le sport en loisir avec de simples baskets.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Dans les matchs officiels, chaque joueur porte un maillot numéroté. La règle FIBA imposait les numéros de 4 à 15 (ce n\'est plus forcément le cas) lors des compétitions internationales, soit douze numéros (autant qu\'il y a de joueurs dans une équipe). Toutefois, en NBA, les joueurs peuvent choisir n\'importe quel numéro de 0 à 99 compris (le 00 existe aussi). Ainsi, en général et dans la mesure du possible, les joueurs de NBA conservent le même numéro durant toute leur carrière, même en changeant d\'équipe, sauf quand un joueur le possède déjà ou quand celui-ci est retiré. Lorsque certains joueurs marquent l\'histoire de leur franchise, il arrive que celle-ci décide de retirer leur numéro pour leur rendre hommage. Ainsi, le célèbre numéro 23 porté par Michael Jordan aux Bulls de Chicago a été rendu indisponible dans cette franchise après son départ.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":75,\"width\":656,\"height\":878,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Carmelo_Anthony_Nov_2013-765x1024.jpg\" alt=\"\" class=\"wp-image-75\" width=\"656\" height=\"878\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le joueur américain Carmelo Anthony portant un équipement complet&nbsp;: maillot, short, bandeau et <em>shooting sleeve</em> avec protection au coude sur les deux bras.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Équipement', '', 'publish', 'closed', 'open', '', 'page-d-exemple', '', '', '2020-04-30 15:10:43', '2020-04-30 13:10:43', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?page_id=2', 0, 'page', '', 0),
(3, 1, '2020-04-29 16:11:25', '2020-04-29 14:11:25', '<!-- wp:heading --><h2>Qui sommes-nous ?</h2><!-- /wp:heading --><!-- wp:paragraph --><p>L’adresse de notre site Web est : http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Utilisation des données personnelles collectées</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Commentaires</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Quand vous laissez un commentaire sur notre site web, les données inscrites dans le formulaire de commentaire, mais aussi votre adresse IP et l’agent utilisateur de votre navigateur sont collectés pour nous aider à la détection des commentaires indésirables.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Une chaîne anonymisée créée à partir de votre adresse de messagerie (également appelée hash) peut être envoyée au service Gravatar pour vérifier si vous utilisez ce dernier. Les clauses de confidentialité du service Gravatar sont disponibles ici : https://automattic.com/privacy/. Après validation de votre commentaire, votre photo de profil sera visible publiquement à coté de votre commentaire.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Médias</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous êtes un utilisateur ou une utilisatrice enregistré·e et que vous téléversez des images sur le site web, nous vous conseillons d’éviter de téléverser des images contenant des données EXIF de coordonnées GPS. Les visiteurs de votre site web peuvent télécharger et extraire des données de localisation depuis ces images.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Formulaires de contact</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Cookies</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous déposez un commentaire sur notre site, il vous sera proposé d’enregistrer votre nom, adresse de messagerie et site web dans des cookies. C’est uniquement pour votre confort afin de ne pas avoir à saisir ces informations si vous déposez un autre commentaire plus tard. Ces cookies expirent au bout d’un an.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Si vous vous rendez sur la page de connexion, un cookie temporaire sera créé afin de déterminer si votre navigateur accepte les cookies. Il ne contient pas de données personnelles et sera supprimé automatiquement à la fermeture de votre navigateur.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Lorsque vous vous connecterez, nous mettrons en place un certain nombre de cookies pour enregistrer vos informations de connexion et vos préférences d’écran. La durée de vie d’un cookie de connexion est de deux jours, celle d’un cookie d’option d’écran est d’un an. Si vous cochez « Se souvenir de moi », votre cookie de connexion sera conservé pendant deux semaines. Si vous vous déconnectez de votre compte, le cookie de connexion sera effacé.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>En modifiant ou en publiant une publication, un cookie supplémentaire sera enregistré dans votre navigateur. Ce cookie ne comprend aucune donnée personnelle. Il indique simplement l’ID de la publication que vous venez de modifier. Il expire au bout d’un jour.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Contenu embarqué depuis d’autres sites</h3><!-- /wp:heading --><!-- wp:paragraph --><p>Les articles de ce site peuvent inclure des contenus intégrés (par exemple des vidéos, images, articles…). Le contenu intégré depuis d’autres sites se comporte de la même manière que si le visiteur se rendait sur cet autre site.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Ces sites web pourraient collecter des données sur vous, utiliser des cookies, embarquer des outils de suivis tiers, suivre vos interactions avec ces contenus embarqués si vous disposez d’un compte connecté sur leur site web.</p><!-- /wp:paragraph --><!-- wp:heading {\"level\":3} --><h3>Statistiques et mesures d’audience</h3><!-- /wp:heading --><!-- wp:heading --><h2>Utilisation et transmission de vos données personnelles</h2><!-- /wp:heading --><!-- wp:heading --><h2>Durées de stockage de vos données</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous laissez un commentaire, le commentaire et ses métadonnées sont conservés indéfiniment. Cela permet de reconnaître et approuver automatiquement les commentaires suivants au lieu de les laisser dans la file de modération.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>Pour les utilisateurs et utilisatrices qui s’enregistrent sur notre site (si cela est possible), nous stockons également les données personnelles indiquées dans leur profil. Tous les utilisateurs et utilisatrices peuvent voir, modifier ou supprimer leurs informations personnelles à tout moment (à l’exception de leur nom d’utilisateur·ice). Les gestionnaires du site peuvent aussi voir et modifier ces informations.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Les droits que vous avez sur vos données</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Si vous avez un compte ou si vous avez laissé des commentaires sur le site, vous pouvez demander à recevoir un fichier contenant toutes les données personnelles que nous possédons à votre sujet, incluant celles que vous nous avez fournies. Vous pouvez également demander la suppression des données personnelles vous concernant. Cela ne prend pas en compte les données stockées à des fins administratives, légales ou pour des raisons de sécurité.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Transmission de vos données personnelles</h2><!-- /wp:heading --><!-- wp:paragraph --><p>Les commentaires des visiteurs peuvent être vérifiés à l’aide d’un service automatisé de détection des commentaires indésirables.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Informations de contact</h2><!-- /wp:heading --><!-- wp:heading --><h2>Informations supplémentaires</h2><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Comment nous protégeons vos données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Procédures mises en œuvre en cas de fuite de données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Les services tiers qui nous transmettent des données</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Opérations de marketing automatisé et/ou de profilage réalisées à l’aide des données personnelles</h3><!-- /wp:heading --><!-- wp:heading {\"level\":3} --><h3>Affichage des informations liées aux secteurs soumis à des régulations spécifiques</h3><!-- /wp:heading -->', 'Politique de confidentialité', '', 'trash', 'closed', 'open', '', 'politique-de-confidentialite__trashed', '', '', '2020-04-30 11:52:41', '2020-04-30 09:52:41', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?page_id=3', 0, 'page', '', 0),
