(27, 1, '2020-04-30 11:20:28', '2020-04-30 09:20:28', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La <em>National Basketball League</em>, fondée en 1898 et dissoute en 1904, est le précurseur des nombreuses ligues professionnelles créées aux États-Unis et dans le reste du monde tout au long du siècle. Hormis la <em>Eastern Basket Ball League</em>, fondée en 1909, les principales ligues professionnelles sont créées au début des années 1920 : la <em>Metropolitan Basketball League</em> (1921) et l\'<em>American Basketball League</em> (1925). En 1922 est créée l\'équipe des Rens de Dayton (également appelée New York Renaissance), composée uniquement d\'Afro-Américains. Leurs principaux rivaux étaient les Original Celtics, considérés comme les <q>pères du basketball</q> et présentés comme les champions du monde de la discipline. À l\'image des Harlem Globetrotters, fondés en 1926, ceux-ci organisaient des tournées dans le pays à la manière d\'un cirque. Les Celtics dominent le basketball américain de 1922 à 1928, année de leur dissolution.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le 6 juin 1946 est créée la <em>Basketball Association of America</em> (BAA) : son premier match oppose les Huskies de Toronto, à domicile, aux Knickerbockers de New York. Après trois saisons, en 1949, la ligue fusionne avec la <em>National Basketball League</em> pour former la <em>National Basketball Association</em> (NBA). Dès les années 1950 apparaissent les premières stars du basketball, dont le pivot George Mikan et le meneur Bob Cousy. Les Lakers de Minneapolis (qui s\'installent à Los Angeles en 1960) et les Celtics de Boston assoient leur domination sur la NBA en remportant seize titres à eux deux de 1949 à 1970. Les deux équipes s\'opposent alors dans une rivalité qui les voit s\'affronter à dix reprises en finales entre 1959 et 1987.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les années 1960 voient éclore plusieurs joueurs aujourd\'hui légendaires : l\'arrière des Lakers Jerry West ; le meneur Oscar Robertson ; le pivot des Celtics Bill Russell, onze fois champion NBA et qui révolutionna la manière de pratiquer la défense; et Wilt Chamberlain, qui détient encore aujourd\'hui de nombreux records de statistiques. Le 2 mars 1962, il inscrit 100 points lors d\'un match entre les Warriors de Philadelphie et les Knicks de New York.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1967, l\'<em>American Basketball Association</em> (ABA) est lancée pour tenter de rivaliser avec la NBA, qui connaît un pic de popularité. Celle-ci suscite l\'intérêt du public en proposant un nouveau style de jeu et des règles différentes. La balle est tricolore (rouge, blanc, bleu), le jeu est plus agressif et spectaculaire, et le tir à trois points est créé. Julius Erving est alors le joueur le plus célèbre de cette ligue, grâce à un style aérien où le saut et le jeu au-dessus du panier sont aussi importants que le tir. Toutefois, les faibles recettes et le succès déclinant de la ligue la contraignent à être absorbée par la NBA : ses quatre meilleures équipes (les Nets de New York, les Nuggets de Denver, les Pacers de l\'Indiana et les Spurs de San Antonio) y sont incorporées, et certains éléments sont conservés, comme le tir à trois points. Après 1970, la NBA est sans conteste la ligue de basketball la plus importante, tant en termes de popularité que de budget ou de niveau de jeu.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":28,\"width\":644,\"height\":873,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Wilt_Chamberlain_Bill_Russell_2-755x1024.jpg\" alt=\"\" class=\"wp-image-28\" width=\"644\" height=\"873\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Bill Russell (à gauche) en défense sur Wilt Chamberlain. De 1959 à 1969, ces deux pivots s\'opposent et donnent lieu à l\'une des plus grandes rivalités de l\'histoire du basket-ball.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Création des premières ligues professionnelles américaines', '', 'publish', 'open', 'open', '', 'creation-des-premieres-ligues-professionnelles-americaines', '', '', '2020-04-30 14:42:29', '2020-04-30 12:42:29', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?p=27', 0, 'post', '', 0),
(28, 1, '2020-04-30 11:19:40', '2020-04-30 09:19:40', '', '800px-Wilt_Chamberlain_Bill_Russell_2', '', 'inherit', 'open', 'closed', '', '800px-wilt_chamberlain_bill_russell_2', '', '', '2020-04-30 11:19:40', '2020-04-30 09:19:40', '', 27, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Wilt_Chamberlain_Bill_Russell_2.jpg', 0, 'attachment', 'image/jpeg', 0),
(29, 1, '2020-04-30 11:20:28', '2020-04-30 09:20:28', '<!-- wp:paragraph -->\n<p>La <em>National Basketball League</em>, fondée en 1898 et dissoute en 1904, est le précurseur des nombreuses ligues professionnelles créées aux États-Unis et dans le reste du monde tout au long du siècle. Hormis la <em>Eastern Basket Ball League</em>, fondée en 1909, les principales ligues professionnelles sont créées au début des années 1920 : la <em>Metropolitan Basketball League</em> (1921) et l\'<em>American Basketball League</em> (1925). En 1922 est créée l\'équipe des Rens de Dayton (également appelée New York Renaissance), composée uniquement d\'Afro-Américains. Leurs principaux rivaux étaient les Original Celtics, considérés comme les <q>pères du basketball</q> et présentés comme les champions du monde de la discipline. À l\'image des Harlem Globetrotters, fondés en 1926, ceux-ci organisaient des tournées dans le pays à la manière d\'un cirque. Les Celtics dominent le basketball américain de 1922 à 1928, année de leur dissolution.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le 6 juin 1946 est créée la <em>Basketball Association of America</em> (BAA) : son premier match oppose les Huskies de Toronto, à domicile, aux Knickerbockers de New York. Après trois saisons, en 1949, la ligue fusionne avec la <em>National Basketball League</em> pour former la <em>National Basketball Association</em> (NBA). Dès les années 1950 apparaissent les premières stars du basketball, dont le pivot George Mikan et le meneur Bob Cousy. Les Lakers de Minneapolis (qui s\'installent à Los Angeles en 1960) et les Celtics de Boston assoient leur domination sur la NBA en remportant seize titres à eux deux de 1949 à 1970. Les deux équipes s\'opposent alors dans une rivalité qui les voit s\'affronter à dix reprises en finales entre 1959 et 1987.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les années 1960 voient éclore plusieurs joueurs aujourd\'hui légendaires : l\'arrière des Lakers Jerry West ; le meneur Oscar Robertson ; le pivot des Celtics Bill Russell, onze fois champion NBA et qui révolutionna la manière de pratiquer la défense; et Wilt Chamberlain, qui détient encore aujourd\'hui de nombreux records de statistiques. Le 2 mars 1962, il inscrit 100 points lors d\'un match entre les Warriors de Philadelphie et les Knicks de New York.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 1967, l\'<em>American Basketball Association</em> (ABA) est lancée pour tenter de rivaliser avec la NBA, qui connaît un pic de popularité. Celle-ci suscite l\'intérêt du public en proposant un nouveau style de jeu et des règles différentes. La balle est tricolore (rouge, blanc, bleu), le jeu est plus agressif et spectaculaire, et le tir à trois points est créé. Julius Erving est alors le joueur le plus célèbre de cette ligue, grâce à un style aérien où le saut et le jeu au-dessus du panier sont aussi importants que le tir. Toutefois, les faibles recettes et le succès déclinant de la ligue la contraignent à être absorbée par la NBA : ses quatre meilleures équipes (les Nets de New York, les Nuggets de Denver, les Pacers de l\'Indiana et les Spurs de San Antonio) y sont incorporées, et certains éléments sont conservés, comme le tir à trois points. Après 1970, la NBA est sans conteste la ligue de basketball la plus importante, tant en termes de popularité que de budget ou de niveau de jeu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":28,\"width\":644,\"height\":873,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Wilt_Chamberlain_Bill_Russell_2-755x1024.jpg\" alt=\"\" class=\"wp-image-28\" width=\"644\" height=\"873\"/><figcaption>Bill Russell (à gauche) en défense sur Wilt Chamberlain. De 1959 à 1969, ces deux pivots s\'opposent et donnent lieu à l\'une des plus grandes rivalités de l\'histoire du basket-ball.</figcaption></figure>\n<!-- /wp:image -->', 'Création des premières ligues professionnelles américaines', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2020-04-30 11:20:28', '2020-04-30 09:20:28', '', 27, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/27-revision-v1/', 0, 'revision', '', 0),
(30, 1, '2020-04-30 11:28:25', '2020-04-30 09:28:25', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Peu après sa création, le basket-ball s\'étend progressivement en dehors des États-Unis et du Canada et atteint l\'Europe, où il se développe rapidement. En 1909 se tient le premier match international de basketball, opposant le Mayak Saint-Pétersbourg (à domicile) à une équipe de YMCA américaine. Le premier grand évènement européen se déroule en 1919 à Joinville-le-Pont durant les Jeux interalliés : les États-Unis, emmenés par Marty Friedman, l\'emportent contre la France en finale. Le jeu gagne en popularité dans ces deux pays.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le 18 juin 1932, la Fédération internationale de basket-ball amateur (FIBA) est fondée à Genève par l\'Argentine, la Tchécoslovaquie, la Grèce, l\'Italie, la Lettonie, le Portugal, la Roumanie et la Suisse. À l\'origine, cette fédération ne supervise que les équipes d\'amateurs. Elle joue un rôle fondamental dans l\'inscription du basketball au programme des Jeux olympiques d\'été de 1936 à Berlin. Les matchs y sont disputés en extérieur, sur un terrain en terre battue. Le premier titre olympique est remporté par l\'équipe nationale américaine, avec entre autres Sam Balter, Ralph Bishop et Francis Johnson, contre l\'équipe du Canada. Le 22 août 1951, à Berlin-Ouest, une rencontre est disputée devant plus de 75 000 spectateurs, ce qui en ferait la plus importante fréquentation pour un match de basket-ball.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le premier championnat du monde de basket-ball est organisé en Argentine en 1950, et trois ans plus tard a lieu le premier championnat du monde de basket-ball féminin à Santiago du Chili. L\'épreuve féminine ne devient olympique qu\'en 1976, lors des Jeux olympiques de Montréal, grâce notamment à l\'action du secrétaire général de la FIBA Renato William Jones.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":31,\"width\":411,\"height\":265,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-Jeux_interalliés_1919_basket-ball_01-1024x664.jpg\" alt=\"\" class=\"wp-image-31\" width=\"411\" height=\"265\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Rencontre entre les États-Unis et la France lors des Jeux Interralliés de 1919.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":32,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Equipe_de_France_1953.jpg\" alt=\"\" class=\"wp-image-32\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Équipe de France de basket-ball féminin 1953.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Implantation en Europe et compétitions internationales', '', 'publish', 'open', 'open', '', 'implantation-en-europe-et-competitions-internationales', '', '', '2020-04-30 14:38:40', '2020-04-30 12:38:40', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?p=30', 0, 'post', '', 0),
