wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":31,\"width\":411,\"height\":265,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-Jeux_interalliés_1919_basket-ball_01-1024x664.jpg\" alt=\"\" class=\"wp-image-31\" width=\"411\" height=\"265\"/><figcaption>Rencontre entre les États-Unis et la France lors des Jeux Interralliés de 1919.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":32,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Equipe_de_France_1953.jpg\" alt=\"\" class=\"wp-image-32\"/><figcaption>Équipe de France de basket-ball féminin 1953.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Implantation en Europe et compétitions internationales', '', 'inherit', 'closed', 'closed', '', '30-revision-v1', '', '', '2020-04-30 11:28:25', '2020-04-30 09:28:25', '', 30, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/30-revision-v1/', 0, 'revision', '', 0),
(34, 1, '2020-04-30 11:37:08', '2020-04-30 09:37:08', '<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Achèvement de la professionnalisation</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La NBA gagne en visibilité et est diffusée dans un nombre croissant de pays, dont la France à partir de 1985. De nouveaux talents émergent dans les années 1970, comme Kareem Abdul-Jabbar (meilleur marqueur de l\'histoire de la NBA), Elvin Hayes, Moses</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">Malone, Robert Parish ou Bernard King, ainsi que dans les années 1980 où débutent entre autres Hakeem Olajuwon, John Stockton, Karl Malone, Dominique Wilkins et Patrick Ewing. Toutefois, trois joueurs dominent la décennie et contribuent à accroître la popularité du basketball dans le monde : Larry Bird, Magic Johnson et surtout Michael Jordan, considéré comme le plus grand joueur de l\'histoire. À partir des années 1990, quelques équipes parviennent à remettre en cause la domination des Lakers de Los Angeles et des Celtics de Boston sur le basketball américain, comme les Bulls de Chicago emmenés par Jordan (six titres entre 1991 et 1998) et les Spurs de San Antonio (cinq titres de 1999 à 2014). De nouvelles stars font leur apparition : David Robinson, Gary Payton, Jason Kidd, Steve Nash, Dirk Nowitzki, Tim Duncan, Kobe Bryant ou encore Shaquille O\'Neal, connu pour son physique impressionnant et ses facéties sur le terrain.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La professionnalisation du basket-ball se poursuit dans les années 1970 et ne s\'achève véritablement qu\'en 1990. En 1989, la FIBA cesse d\'exclure les joueurs professionnels de ses compétitions, et des joueurs professionnels sont pour la première fois admis aux Jeux olympiques de 1992. Néanmoins, la pratique amateur continue de se développer : en 2012, vingt-six millions d\'Américains pratiquent le basketball (dont quinze millions de manière occasionnelle). En juin 2015, la Fédération française de basket-ball annonce une progression importante du nombre de licenciés, avec un record de plus de 600 000, dont 36 % de femmes. Au début des années 2010, le basket-ball est l\'un des sports les plus pratiqués au monde, avec plus de 100 millions de licenciés et plus de 450 millions de pratiquants occasionnels.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Mondialisation et contestation de la domination américaine</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Depuis la création du sport, les États-Unis ont dominé les compétitions internationales masculines et féminines, quoique concurrencés par les équipes de Yougoslavie (puis de Serbie) et d\'Union soviétique. L\'équipe américaine a notamment remporté l\'or olympique à quatorze reprises, sur dix-huit olympiades où le basketball figure au programme. La première <em>Dream Team</em> (« Équipe de rêve ») américaine, composée notamment de Michael Jordan, Magic Johnson, Charles Barkley et Scottie Pippen, entre en compétition lors des Jeux olympiques de Barcelone et remporte le titre avec un écart moyen de 42 points sur ses adversaires. Elle est ainsi considérée comme la meilleure équipe de l\'histoire. Toutefois, avec la popularité croissante du basket-ball dans le monde, de nouvelles équipes nationales gagnent en niveau et parviennent à contester la suprématie américaine. L\'équipe américaine, bien que composée intégralement de joueurs évoluant en NBA, finit sixième lors des championnats du monde en 2002 derrière la Yougoslavie, l\'Argentine, l\'Allemagne, la Nouvelle-Zélande et l\'Espagne. Lors des Jeux olympiques de 2004 à Athènes, les États-Unis n\'obtiennent que la médaille de bronze, après des défaites contre Porto Rico, la Lituanie et l\'Argentine. Ils perdent également contre la Grèce en demi-finales des championnats du monde en 2006. Selon le classement établi par la FIBA en date du 3 octobre 2015, l\'équipe américaine demeure la meilleure au monde, suivie par l\'Espagne, la Lituanie, l\'Argentine, la France, la Serbie, la Russie, la Turquie, le Brésil et la Grèce.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Depuis les années 1990, une « globalisation » du basket-ball semble se mettre en place, avec la création de nombreux championnats et ligues à travers le monde. Aux championnats les plus anciens, créés avant les années 1970 (Pro A, Lega Basket, ESAKE, TBL, BBL, Liga ACB) s\'ajoutent de nouvelles ligues professionnelles, essentiellement en Asie où le sport est en plein essor. La première ligue professionnelle d\'Asie, la <em>Philippine Basketball Association</em> (PBA), organise son premier match le 9 avril 1975 à Quezon City, dans la banlieue de Manille. La <em>National Basketball League</em> est fondée en 1979 regroupe sept équipes australiennes et une équipe néo-zélandaise ; une ligue féminine est créée en 1981. Des ligues sont créées partout dans le monde dans les années 2000, comme la Bj League au Japon (2005), la NBB au Brésil (2008) et la VTB United League en Russie et Europe de l\'Est (2008). Toutefois, c\'est la <em>Chinese Basketball Association</em> qui connaît le plus fort développement et attire même d\'anciens joueurs NBA, comme Metta World Peace, Stephon Marbury ou Tracy McGrady. Au Canada, bien que le hockey sur glace demeure le sport le plus pratiqué et médiatisé, le nombre de licenciés et de matchs diffusés ne cesse de croître depuis une dizaine d\'années</span>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Face au développement international du basketball, la NBA s\'est peu à peu ouverte aux meilleurs joueurs étrangers non formés aux</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">États-Unis. Parmi les premiers figurent des Yougoslaves comme Dražen Petrović, Toni Kukoč et Vlade Divac, ou des Lituaniens (Arvydas Sabonis, Šarūnas Marčiulionis). Une vingtaine de joueurs français a foulé les parquets de la ligue américaine : Tariq</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">Abdul-Wahad fut le premier, en 1997, suivi par d\'autres comme Nicolas Batum, Joakim Noah, Mickaël Piétrus, Kevin Séraphin, Johan Petro, Boris Diaw ou encore Tony Parker, quatre fois champion NBA avec les Spurs de San Antonio. La ligue recrute aussi plusieurs joueurs africains : Manute Bol, Michael Olowokandi, DeSagana Diop, Luc Mbah a Moute, Hasheem Thabeet ou Bismack Biyombo.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Des joueurs russes (Timofeï Mozgov, Andreï Kirilenko), espagnols (les frères Pau et Marc Gasol), allemands (Dirk Nowitzki, Detlef Schrempf), italiens (Andrea Bargnani, Marco Belinelli), suisses (Thabo Sefolosha, Clint Capela), argentins (Manu Ginóbili, Andrés Nocioni) et brésiliens (Anderson Varejão et Nenê) font également leur apparition. Quelques Australiens (Luc Longley, Andrew Bogut) sont aussi parvenus à intégrer un club américain. Enfin, depuis les années 2000 et le gain de popularité du basketball en Asie, la NBA a accueilli quelques joueurs chinois ou d\'origine chinoise : Yi Jianlian, Wang Zhizhi, Jeremy Lin et surtout le géant Yao Ming, figure de proue de l\'expansion du basket-ball en Chine, où le basket-ball est devenu le deuxième sport le plus pratiqué après le tennis de table.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":37,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Jordan_by_Lipofsky_16577.jpg\" alt=\"\" class=\"wp-image-37\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Michael Jordan sautant au panier pour réaliser un dunk. Durant sa carrière longue de près de</span> <span style=\"color:#08ffff\" class=\"has-inline-color\">vingt ans (1984-2003), ses actions spectaculaires et ses cinq titres de meilleur joueur de la saison (MVP) ont fait de lui le basketteur le plus célèbre au monde.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":38,\"width\":271,\"height\":193,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-Gasol_Brothers_at_the_2012_Summer_Olympics-1024x731.jpg\" alt=\"\" class=\"wp-image-38\" width=\"271\" height=\"193\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Les frères Marc et Pau Gasol sous le maillot de l\'équipe d\'Espagne, lors des Jeux olympiques de 2012 à Londres.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":39,\"width\":269,\"height\":218,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Yao_Ming_2310550443.jpg\" alt=\"\" class=\"wp-image-39\" width=\"269\" height=\"218\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le joueur chinois Yao Ming en décembre 2006, sous le maillot des Rockets de Houston. De 2002 à 2011, il dispute neuf saisons en NBA et contribue à l\'expansion du basket-ball en Asie.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>