(56, 1, '2020-04-30 12:20:37', '2020-04-30 10:20:37', '<!-- wp:paragraph -->\n<p>L\'histoire du basket-ball féminin débute en 1892 au <em>Smith College</em> (Massachusetts), lorsque la professeure d\'éducation physique Senda Berenson Abbott adapte les règles du jeu pour les femmes. Ainsi, elle interdit d\'arracher le ballon à l\'adversaire ou de dribbler au sol plus de trois fois, afin de ne pas <q>développer une tendance à la nervosité et perdre la grâce, la dignité et l\'estime de soi</q>. Peu après avoir été embauchée, elle rencontre Naismith afin d\'en apprendre davantage sur le basket-ball. Convaincue de l\'intérêt de ce sport et des valeurs qu\'il peut véhiculer, elle organise le premier match universitaire féminin au <em>Smith College</em> le 21 mars 1893 : les élèves en première année (<em>freshmen</em>) jouent contre les deuxièmes années (<em>sophomores</em>). Le sport s\'implante dans plusieurs universités pour femmes, dont Wellesley, Vassar et Bryn Mawr College. Le 4 avril 1896, l\'équipe de Stanford affronte celle de Berkeley dans un match à neuf contre neuf, qui voit la victoire de Stanford par 2–1.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>En 1895, Clara Gregory Baer publie le premier recueil des règles du basket-ball féminin, alors appelé basquette. Les règles de Berenson sont publiées pour la première fois en 1899, et celle-ci réalise la première édition du <em>Women\'s Basketball Guide</em> d\'Albert Spalding en 1901. La pratique féminine est alors très mal considérée : devant le développement du sport dans les lycées, de nombreuses études tentent de prouver les effets du basket-ball sur la moralité des jeunes filles et prônent son interdiction. Les joueuses portent le corset ainsi que de longues robes, qui les font fréquemment trébucher. Le tir devait être effectué à une seule main : tirer à deux mains était jugé disgracieux car il mettait la poitrine en avant. Les joueuses des <em>Edmonton Grads</em>, une équipe canadienne qui réalise des tournées entre 1915 et 1940, n\'étaient pas payées et devaient impérativement rester célibataires.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>De premières stars féminines émergent aux États-Unis, comme Mildred Didrickson des Golden Cyclones et l\'équipe des All American Red Heads. Cette dernière se produit en spectacle à la manière des Globetrotters de Harlem et joue parfois contre des équipes masculines, avec les règles destinées aux hommes. Elles ont cependant pour obligation de se maquiller et de soigner leur apparence. Dès 1924, la Fédération sportive féminine internationale organise une compétition de basket-ball. Les <em>Edmonton Grads</em> dominent le basket-ball féminin jusqu\'aux années 1940&nbsp;: elles jouent contre toutes les équipes qui acceptent de les défier et remportent 522&nbsp;victoires pour seulement 20&nbsp;défaites. Elles remportent également le tournoi de démonstration du basket-ball féminin aux Jeux olympiques de 1924, 1928, 1932 et 1936.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le basket-ball féminin accède à plus de reconnaissance dans la seconde moitié du <abbr title=\"20ᵉ siècle\">XX<sup>e</sup></abbr>&nbsp;siècle, avec notamment la création du championnat du monde de basket-ball féminin en 1953 et du championnat d\'Afrique en 1966. Le sport prend son essor aux États-Unis après l\'adoption du Titre IX, qui interdit toute discrimination sur la base du sexe dans les programmes d\'éducation soutenus par l’État, et permet la constitution de nombreuses équipes universitaires&nbsp;: un championnat NCAA féminin est créé en 1982. En 1976, le basket-ball féminin devient un sport olympique. L\'équipe des États-Unis (7) et celle d\'URSS/Russie (3) se partagent les dix titres mis en jeu. En 1985, Senda Berenson, Bertha Teague et Margaret Wade deviennent les premières femmes à être intronisées au <em>Basketball Hall of Fame</em>. La professionnalisation du basket-ball féminin se renforce en 1997 avec la création de la Women\'s National Basketball Association (WNBA), sur le modèle de la NBA. Elle voit rapidement émerger des joueuses vedettes telles que Lisa Leslie, Tina Thompson, Sue Bird, Diana Taurasi ou Candace Parker. Les matchs de la ligue sont diffusés sur la chaîne de télévision ESPN depuis 2009 et participent au développement de la popularité du basket-ball féminin.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":42,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Smith-College-Class-1902-basketball-team-1024x585.jpg\" alt=\"\" class=\"wp-image-42\"/><figcaption>L\'équipe féminine de basket-ball du Smith College en 1902.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":43,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-20130607_-_France-Canada_-_040-1024x682.jpg\" alt=\"\" class=\"wp-image-43\"/><figcaption>La joueuse française Céline Dumerc (en bleu) lors d\'un match face au Canada, le 7 juin 2013.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Basket-ball féminin', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2020-04-30 12:20:37', '2020-04-30 10:20:37', '', 41, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/41-revision-v1/', 0, 'revision', '', 0),
