sées au <em>Basketball Hall of Fame</em>. La professionnalisation du basket-ball féminin se renforce en 1997 avec la création de la Women\'s National Basketball Association (WNBA), sur le modèle de la NBA. Elle voit rapidement émerger des joueuses vedettes telles que Lisa Leslie, Tina Thompson, Sue Bird, Diana Taurasi ou Candace Parker. Les matchs de la ligue sont diffusés sur la chaîne de télévision ESPN depuis 2009 et participent au développement de la popularité du basket-ball féminin.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":42,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Smith-College-Class-1902-basketball-team-1024x585.jpg\" alt=\"\" class=\"wp-image-42\"/><figcaption>L\'équipe féminine de basket-ball du Smith College en 1902.</figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":43,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-20130607_-_France-Canada_-_040-1024x682.jpg\" alt=\"\" class=\"wp-image-43\"/><figcaption>La joueuse française Céline Dumerc (en bleu) lors d\'un match face au Canada, le 7 juin 2013.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Basket-ball féminin', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2020-04-30 12:22:09', '2020-04-30 10:22:09', '', 41, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/41-revision-v1/', 0, 'revision', '', 0),
