(60, 1, '2020-04-30 12:25:40', '2020-04-30 10:25:40', '<!-- wp:paragraph -->\n<p><span style=\"color:#dbe8ed\" class=\"has-inline-color\">L</span><span style=\"color:#d5f1fc\" class=\"has-inline-color\">\'histoire du basket-ball féminin débute en 1892 au <em>Smith College</em> (Massachusetts), lorsque la professeure d\'éducation physique Senda Berenson Abbott adapte les règles du jeu pour les femmes. Ainsi, elle interdit d\'arracher le ballon à l\'adversaire ou de dribbler au sol plus de trois fois, afin de ne pas <q>développer une tendance à la nervosité et perdre la grâce, la dignité et l\'estime de soi</q>. Peu après avoir été embauchée, elle rencontre Naismith afin d\'en apprendre davantage sur le basket-ball. Convaincue de l\'intérêt de ce sport et des valeurs qu\'il peut véhiculer, elle organise le premier match universitaire féminin au <em>Smith College</em> le 21 mars 1893 : les élèves en première année (<em>freshmen</em>) jouent contre les deuxièmes années (<em>sophomores</em>). Le sport s\'implante dans plusieurs universités pour femmes, dont Wellesley, Vassar et Bryn Mawr College. Le 4 avril 1896, l\'équipe de Stanford affronte celle de Berkeley dans un match à neuf contre neuf, qui voit la victoire de Stanford par 2–1.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1895, Clara Gregory Baer publie le premier recueil des règles du basket-ball féminin, alors appelé basquette. Les règles de Berenson sont publiées pour la première fois en 1899, et celle-ci réalise la première édition du <em>Women\'s Basketball Guide</em> d\'Albert Spalding en 1901. La pratique féminine est alors très mal considérée : devant le développement du sport dans les lycées, de nombreuses études tentent de prouver les effets du basket-ball sur la moralité des jeunes filles et prônent son interdiction. Les joueuses portent le corset ainsi que de longues robes, qui les font fréquemment trébucher. Le tir devait être effectué à une seule main : tirer à deux mains était jugé disgracieux car il mettait la poitrine en avant. Les joueuses des <em>Edmonton Grads</em>, une équipe canadienne qui réalise des tournées entre 1915 et 1940, n\'étaient pas payées et devaient impérativement rester célibataires.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">De premières stars féminines émergent aux États-Unis, comme Mildred Didrickson des Golden Cyclones et l\'équipe des All American Red Heads. Cette dernière se produit en spectacle à la manière des Globetrotters de Harlem et joue parfois contre des équipes masculines, avec les règles destinées aux hommes. Elles ont cependant pour obligation de se maquiller et de soigner leur apparence. Dès 1924, la Fédération sportive féminine internationale organise une compétition de basket-ball. Les <em>Edmonton Grads</em> dominent le basket-ball féminin jusqu\'aux années 1940 : elles jouent contre toutes les équipes qui acceptent de les défier et remportent 522 victoires pour seulement 20 défaites. Elles remportent également le tournoi de démonstration du basket-ball féminin aux Jeux olympiques de 1924, 1928, 1932 et 1936.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball féminin accède à plus de reconnaissance dans la seconde moitié du <abbr title=\"20ᵉ siècle\">XX<sup>e</sup></abbr> siècle, avec notamment la création du championnat du monde de basket-ball féminin en 1953 et du championnat d\'Afrique en 1966. Le sport prend son essor aux États-Unis après l\'adoption du Titre IX, qui interdit toute discrimination sur la base du sexe dans les programmes d\'éducation soutenus par l’État, et permet la constitution de nombreuses équipes universitaires : un championnat NCAA féminin est créé en 1982. En 1976, le basket-ball féminin devient un sport olympique. L\'équipe des États-Unis (7) et celle d\'URSS/Russie (3) se partagent les dix titres mis en jeu. En 1985, Senda Berenson, Bertha Teague et Margaret Wade deviennent les premières femmes à être intronisées au <em>Basketball Hall of Fame</em>. La professionnalisation du basket-ball féminin se renforce en 1997 avec la création de la Women\'s National Basketball Association (WNBA), sur le modèle de la NBA. Elle voit rapidement émerger des joueuses vedettes telles que Lisa Leslie, Tina Thompson, Sue Bird, Diana Taurasi ou Candace Parker. Les matchs de la ligue sont diffusés sur la chaîne de télévision ESPN depuis 2009 et participent au développement de la popularité du basket-ball féminin.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":42,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Smith-College-Class-1902-basketball-team-1024x585.jpg\" alt=\"\" class=\"wp-image-42\"/><figcaption><span style=\"color:#130ba3\" class=\"has-inline-color\">L\'équipe féminine de basket-ball du Smith College en 1902.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":43,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-20130607_-_France-Canada_-_040-1024x682.jpg\" alt=\"\" class=\"wp-image-43\"/><figcaption><span style=\"color:#130ba3\" class=\"has-inline-color\">La joueuse française Céline Dumerc (en bleu) lors d\'un match face au Canada, le 7 juin 2013.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Basket-ball féminin', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2020-04-30 12:25:40', '2020-04-30 10:25:40', '', 41, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/41-revision-v1/', 0, 'revision', '', 0),
(76, 1, '2020-04-30 15:06:56', '2020-04-30 13:06:56', '<!-- wp:heading -->\n<h2>Matériel</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball se joue généralement dans un endroit couvert, comme un gymnase, mais peut aussi être pratiqué sur des aires de jeu en tant que loisir, sous sa variante la plus populaire : le <em>streetball</em> (« basket-ball de rue »). Le terrain est doublement symétrique, en longueur et en largeur. Ses dimensions varient, selon les pays ou les normes internationales, de 22,50 à 29 mètres de long sur 13 à 15 mètres de large. Les terrains en extérieur (<em>playgrounds</em>) peuvent être goudronnés ou en terre battue. Les terrains couverts sont généralement réalisés en parquet, avec des lattes d\'érable disposées dans le sens de la longueur. Le nom et le logo de l\'équipe résidente sont souvent peints sur le cercle central. Les salles accueillant des matchs en compétition possèdent des équipements supplémentaires comme l\'horloge des 24 secondes, une table de marque (sur le côté), des tableaux d\'affichage et des compteurs. Aux États-Unis, la plupart comprennent également des écrans suspendus au plafond.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Aux deux extrémités du terrain se trouve un panier, formé par un anneau (ou <em>arceau</em>) métallique situé à 3,05 m du sol, en dessous duquel est attaché un filet ouvert en son centre. L\'arceau est fixé à un panneau rectangulaire vertical (la <q>planche</q>) sur lequel la balle peut rebondir lors d\'un tir. Certains arceaux peuvent s\'incliner lorsqu\'un joueur effectue un dunk puis revenir en position horizontale (les anneaux inclinables).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Sous chaque panier se trouve une zone rectangulaire appelée la raquette (ou zone restrictive). Un arc de cercle situé à 6,25 m (6,75 m depuis 2010 pour les championnats de Pro A, Pro B, N1 français et basket-ball féminin ; 7,23 m en NBA) de chaque panier représente la ligne de tirs à trois points. Sous l\'anneau est tracé un arc de cercle d\'un rayon de 1,25 m dans lequel aucun passage en force d\'un attaquant ne sera sifflé par l\'arbitre.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le ballon de basket-ball standard est de forme sphérique, et a une masse de 650 g et un diamètre de 24 cm. Sa pression intérieure est de 0,55 atm. Initialement, le basket-ball se pratiquait avec un ballon de football, puis des ballons spécifiques de couleur marron. Ce n\'est qu\'à la fin des années 1950 que Tony Hinkle, désireux de créer une balle plus visible des joueurs et des spectateurs, développe la balle de couleur orange encore utilisée aujourd\'hui. Constituée de huit pièces de cuir cousues autour d\'une chambre à air, il existe en plusieurs tailles : 7 pour les hommes, 6 pour les femmes, et de 5 à 3 pour les jeunes joueurs. Le ballon officiel de la NBA est fabriqué par Spalding, et celui de la FIBA par l\'équipementier japonais Molten.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":48,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Basketball_court_fiba-586x1024.png\" alt=\"\" class=\"wp-image-48\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un terrain de basket-ball selon les règles de la FIBA.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":49,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Lifetime_Basketball_Hoop.jpg\" alt=\"\" class=\"wp-image-49\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un panier de basket-ball à l\'extérieur, avec un arceau, un filet et un panneau transparent.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading -->\n<h2>Vêtements et accessoires</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout début du siècle, les joueurs portaient des maillots en tricot de laine et des pantalons en étoffe. La dureté du jeu et le mauvais état des terrains imposait en outre le port de protections aux genoux, aux coudes et aux tibias. Dès les années 1910, le port du maillot se développe et les pantalons en étoffe sont remplacés par des shorts. Dans les années 1960, l\'habillement des joueurs évolue : les maillots deviennent plus légers et sont progressivement réalisés en fibres synthétiques. À l\'initiative notamment de Michael Jordan, les shorts sont allongés et les maillots rendus plus larges. En outre, certains joueurs portent des gaines au bras effectuant les tirs, ou plus rarement aux doigts : les <em>sleeves</em>. D\'autres comme Slick Watts ou Bill Walton ont rendu populaires les bandeaux, portés autour de la tête ou au poignet. Fabriqués en nylon et élasthanne extensibles, ils sont destinés à garder les muscles chauds ou éponger la sueur, mais sont aussi utilisés comme un accessoire de style.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les chaussures de basket-ball ont également changé au fil du temps. Au début du siècle, la plupart des joueurs portaient des chaussures de cuir peu confortables. En 1903, l\'équipementier sportif Spalding met en vente un modèle spécialement conçu pour le basket-ball, avec un système de ventouses pour éviter de glisser. Des modèles en toile et en caoutchouc ont ensuite été créés, parfois sur les conseils de joueurs comme Chuck Taylor, qui contribua au développement des Converse. Les Chuck Taylor All Star et les Keds sont les chaussures les plus utilisées dans les années 1960 et 1970. À partir des années 1980 apparaît la forme actuelle des chaussures de basket-ball, avec une forme montante cachant la malléole médiale afin d\'éviter les risques de torsion de la cheville : Nike et Adidas dominent alors le marché. Les plus grands joueurs sont sponsorisés par des fabricants de baskets, tel Michael Jordan avec Nike: ce dernier a d\'ailleurs développé sa propre collection de baskets nommée Air Jordan. Si les chaussures de basket-ball se sont imposées en compétition et sont par exemple obligatoires lors des Jeux olympiques, il est cependant possible de pratiquer le sport en loisir avec de simples baskets.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Dans les matchs officiels, chaque joueur porte un maillot numéroté. La règle FIBA imposait les numéros de 4 à 15 (ce n\'est plus forcément le cas) lors des compétitions internationales, soit douze numéros (autant qu\'il y a de joueurs dans une équipe). Toutefois, en NBA, les joueurs peuvent choisir n\'importe quel numéro de 0 à 99 compris (le 00 existe aussi). Ainsi, en général et dans la mesure du possible, les joueurs de NBA conservent le même numéro durant toute leur carrière, même en changeant d\'équipe, sauf quand un joueur le possède déjà ou quand celui-ci est retiré. Lorsque certains joueurs marquent l\'histoire de leur franchise, il arrive que celle-ci décide de retirer leur numéro pour leur rendre hommage. Ainsi, le célèbre numéro 23 porté par Michael Jordan aux Bulls de Chicago a été rendu indisponible dans cette franchise après son départ.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":75,\"width\":656,\"height\":878,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Carmelo_Anthony_Nov_2013-765x1024.jpg\" alt=\"\" class=\"wp-image-75\" width=\"656\" height=\"878\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le joueur américain Carmelo Anthony portant un équipement complet : maillot, short, bandeau et <em>shooting sleeve</em> avec protection au coude sur les deux bras.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Équipement', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-04-30 15:06:56', '2020-04-30 13:06:56', '', 2, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/2-revision-v1/', 0, 'revision', '', 0),
(66, 1, '2020-04-30 13:46:37', '2020-04-30 11:46:37', '<!-- wp:heading -->\n<h2>Matériel</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Le basket-ball se joue généralement dans un endroit couvert, comme un <a href=\"https://fr.wikipedia.org/wiki/Gymnase_(sport)\">gymnase</a>, mais peut aussi être pratiqué sur des aires de jeu en tant que loisir, sous sa variante la plus populaire&nbsp;: le <em><a href=\"https://fr.wikipedia.org/wiki/Streetball\">streetball</a></em> («&nbsp;basket-ball de rue&nbsp;»). Le <a href=\"https://fr.wikipedia.org/wiki/Terrain_de_basket-ball\">terrain</a> est doublement <a href=\"https://fr.wikipedia.org/wiki/Sym%C3%A9trie_axiale\">symétrique</a>, en longueur et en largeur. Ses dimensions varient, selon les pays ou les normes internationales, de 22,50 à 29&nbsp;mètres de long sur 13 à 15&nbsp;mètres de large. Les terrains en extérieur (<em><a href=\"https://fr.wikipedia.org/wiki/Terrain_de_jeux\">playgrounds</a></em>) peuvent être goudronnés ou en <a href=\"https://fr.wikipedia.org/wiki/Terre_battue\">terre battue</a>. Les terrains couverts sont généralement réalisés en <a href=\"https://fr.wikipedia.org/wiki/Parquet_(construction)\">parquet</a>, avec des lattes d\'<a href=\"https://fr.wikipedia.org/wiki/%C3%89rable\">érable</a> disposées dans le sens de la longueur. Le nom et le logo de l\'équipe résidente sont souvent peints sur le cercle central. Les salles accueillant des matchs en compétition possèdent des équipements supplémentaires comme l\'<a href=\"https://fr.wikipedia.org/wiki/Shot_clock\">horloge des 24 secondes</a>, une <a href=\"https://fr.wikipedia.org/wiki/Table_de_marque_(basket-ball)\">table de marque</a> (sur le côté), des tableaux d\'affichage et des compteurs. Aux États-Unis, la plupart comprennent également des écrans suspendus au plafond.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Aux deux extrémités du terrain se trouve un <a href=\"https://fr.wikipedia.org/wiki/Panier_(basket-ball)\">panier</a>, formé par un anneau (ou <em>arceau</em>) métallique situé à 3,05&nbsp;m du sol, en dessous duquel est attaché un filet ouvert en son centre<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-Basketball_equipment_and_history-55\">55</a></sup>. L\'arceau est fixé à un <a href=\"https://fr.wikipedia.org/wiki/Panneau_de_basket-ball\">panneau</a> rectangulaire vertical (la <q>planche</q>) sur lequel la balle peut rebondir lors d\'un tir. Certains arceaux peuvent s\'incliner lorsqu\'un joueur effectue un <a href=\"https://fr.wikipedia.org/wiki/Slam_dunk\">dunk</a> puis revenir en position horizontale (les <a href=\"https://fr.wikipedia.org/wiki/Anneau_inclinable\">anneaux inclinables</a>).</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Sous chaque panier se trouve une zone <a href=\"https://fr.wikipedia.org/wiki/Rectangle\">rectangulaire</a> (<a href=\"https://fr.wikipedia.org/wiki/Trap%C3%A8ze\">trapézoïdale</a> avant octobre 2010) appelée la <a href=\"https://fr.wikipedia.org/wiki/Raquette_(basket-ball)\">raquette</a> (ou zone restrictive). Un arc de cercle situé à 6,25&nbsp;m (6,75&nbsp;m depuis 2010 pour les championnats de <a href=\"https://fr.wikipedia.org/wiki/Championnat_de_France_de_basket-ball\">Pro A</a>, <a href=\"https://fr.wikipedia.org/wiki/Championnat_de_France_de_basket-ball_de_Pro_B\">Pro B</a>, N1 français et basket-ball féminin&nbsp;; 7,23&nbsp;m en NBA) de chaque panier représente la ligne de <a href=\"https://fr.wikipedia.org/wiki/Panier_%C3%A0_trois_points\">tirs à trois points</a>. Sous l\'anneau est tracé un arc de cercle d\'un rayon de 1,25&nbsp;m dans lequel aucun passage en force d\'un attaquant ne sera sifflé par l\'arbitre<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-Dimitri-56\">56</a></sup>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Le <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_basket-ball\">ballon de basket-ball</a> standard est de forme sphérique, et a une masse de 650&nbsp;g et un diamètre de 24&nbsp;cm. Sa pression intérieure est de 0,55 <a href=\"https://fr.wikipedia.org/wiki/Atmosph%C3%A8re_(unit%C3%A9)\">atm</a><sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-57\">57</a></sup>. Initialement, le basket-ball se pratiquait avec un <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_football\">ballon de football</a>, puis des ballons spécifiques de couleur marron. Ce n\'est qu\'à la fin des années 1950 que <a href=\"https://fr.wikipedia.org/wiki/Tony_Hinkle\">Tony Hinkle</a>, désireux de créer une balle plus visible des joueurs et des spectateurs, développe la <a href=\"https://fr.wikipedia.org/wiki/Ballon_de_basket-ball\">balle de couleur orange</a> encore utilisée aujourd\'hui<sup><a href=\"https://fr.wikipedia.org/wiki/Basket-ball#cite_note-:04-7\">7</a></sup>. Constituée de huit pièces de cuir cousues autour d\'une <a href=\"https://fr.wikipedia.org/wiki/Chambre_%C3%A0_air\">chambre à air</a>, il existe en plusieurs tailles&nbsp;: 7 pour les hommes, 6 pour les femmes, et de 5 à 3 pour les jeunes joueurs. Le ballon officiel de la NBA est fabriqué par <a href=\"https://fr.wikipedia.org/wiki/Spalding_(entreprise)\">Spalding</a>, et celui de la FIBA par l\'équipementier japonais <a href=\"https://fr.wikipedia.org/wiki/Molten\">Molten</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":48,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Basketball_court_fiba-586x1024.png\" alt=\"\" class=\"wp-image-48\"/><figcaption>Un terrain de basket-ball selon les règles de la FIBA.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":49,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Lifetime_Basketball_Hoop.jpg\" alt=\"\" class=\"wp-image-49\"/><figcaption>Un panier de basket-ball à l\'extérieur, avec un arceau, un filet et un panneau transparent.</figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading -->\n<h2>Vêtements et accessoires</h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Au tout début du siècle, les joueurs portaient des maillots en <a href=\"https://fr.wikipedia.org/wiki/Tricot\">tricot</a> de <a href=\"https://fr.wikipedia.org/wiki/Laine\">laine</a> et des pantalons en <a href=\"https://fr.wikipedia.org/wiki/Textile\">étoffe</a>. La dureté du jeu et le mauvais état des terrains imposait en outre le port de protections aux genoux, aux coudes et aux tibias. Dès les <a href=\"https://fr.wikipedia.org/wiki/Ann%C3%A9es_1910\">années 1910</a>, le port du maillot se développe et les pantalons en étoffe sont remplacés par des <a href=\"https://fr.wikipedia.org/wiki/Short\">shorts</a>. Dans les <a href=\"https://fr.wikipedia.org/wiki/Ann%C3%A9es_1960\">années 1960</a>, l\'habillement des joueurs évolue : les maillots deviennent plus légers et sont progressivement réalisés en <a href=\"https://fr.wikipedia.org/wiki/Fibre_synth%C3%A9tique\">fibres synthétiques</a>. À l\'initiative notamment de <a href=\"https://fr.wikipedia.org/wiki/Michael_Jordan\">Michael Jordan</a>, les shorts sont allongés et les maillots rendus plus larges. En outre, certains joueurs portent des gaines au bras effectuant les tirs, ou plus rarement aux doigts : les <em><a href=\"https://fr.wikipedia.org/wiki/Basketball_sleeve\">sleeves</a></em>. D\'autres comme <a href=\"https://fr.wikipedia.org/wiki/Slick_Watts\">Slick Watts</a> ou <a href=\"https://fr.wikipedia.org/wiki/Bill_Walton\">Bill Walton</a> ont rendu populaires les bandeaux, portés autour de la tête ou au poignet. Fabriqués en <a href=\"https://fr.wikipedia.org/wiki/Nylon\">nylon</a> et <a href=\"https://fr.wikipedia.org/wiki/%C3%89lasthanne\">élasthanne</a> extensibles, ils sont destinés à garder les muscles chauds ou éponger la sueur, mais sont aussi utilisés comme un accessoire de style.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Les <a href=\"https://fr.wikipedia.org/wiki/Chaussure_de_basket-ball\">chaussures de basket-ball</a> ont également changé au fil du temps. Au début du siècle, la plupart des joueurs portaient des chaussures de cuir peu confortables. En 1903, l\'équipementier sportif <a href=\"https://fr.wikipedia.org/wiki/Spalding_(entreprise)\">Spalding</a> met en vente un modèle spécialement conçu pour le basket-ball, avec un système de ventouses pour éviter de glisser. Des modèles en toile et en caoutchouc ont ensuite été créés, parfois sur les conseils de joueurs comme <a href=\"https://fr.wikipedia.org/wiki/Chuck_Taylor\">Chuck Taylor</a>, qui contribua au développement des <a href=\"https://fr.wikipedia.org/wiki/Converse_(chaussure)\">Converse</a>. Les <a href=\"https://fr.wikipedia.org/wiki/Chuck_Taylor_All_Star\">Chuck Taylor All Star</a> et les <a href=\"https://fr.wikipedia.org/wiki/Keds\">Keds</a> sont les chaussures les plus utilisées dans les années 1960 et <a href=\"https://fr.wikipedia.org/wiki/Ann%C3%A9es_1970\">1970</a>. À partir des <a href=\"https://fr.wikipedia.org/wiki/Ann%C3%A9es_1980\">années 1980</a> apparaît la forme actuelle des chaussures de basket-ball, avec une forme montante cachant la <a href=\"https://fr.wikipedia.org/wiki/Mall%C3%A9ole_m%C3%A9diale\">malléole médiale</a> afin d\'éviter les risques de torsion de la <a href=\"https://fr.wikipedia.org/wiki/Cheville_(anatomie)\">cheville</a> : <a href=\"https://fr.wikipedia.org/wiki/Nike\">Nike</a> et <a href=\"https://fr.wikipedia.org/wiki/Adidas\">Adidas</a> dominent alors le marché. Les plus grands joueurs sont sponsorisés par des fabricants de baskets, tel Michael Jordan avec Nike: ce dernier a d\'ailleurs développé sa propre collection de baskets nommée <a href=\"https://fr.wikipedia.org/wiki/Nike_Air_Jordan\">Air Jordan</a>. Si les chaussures de basket-ball se sont imposées en compétition et sont par exemple obligatoires lors des Jeux olympiques, il est cependant possible de pratiquer le sport en loisir avec de simples <a href=\"https://fr.wikipedia.org/wiki/Chaussure_de_sport\">baskets</a>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Dans les matchs officiels, chaque joueur porte un maillot numéroté. La règle FIBA impose les numéros de 4 à 15 lors des compétitions internationales, soit douze numéros (autant qu\'il y a de joueurs dans une équipe). Toutefois, en NBA, les joueurs peuvent choisir n\'importe quel numéro de 0 à 99 compris (le 00 existe aussi). Ainsi, en général et dans la mesure du possible, les joueurs de NBA conservent le même numéro durant toute leur carrière, même en changeant d\'équipe, sauf quand un joueur le possède déjà ou quand celui-ci est retiré. Lorsque certains joueurs marquent l\'histoire de leur <a href=\"https://fr.wikipedia.org/wiki/Franchise_(sport)\">franchise</a>, il arrive que celle-ci décide de <a href=\"https://fr.wikipedia.org/wiki/Maillot_retir%C3%A9\">retirer leur numéro</a> pour leur rendre hommage. Ainsi, le célèbre numéro 23 porté par Michael Jordan aux <a href=\"https://fr.wikipedia.org/wiki/Bulls_de_Chicago\">Bulls de Chicago</a> a été rendu indisponible dans cette franchise après son départ.</p>\n<!-- /wp:paragraph -->', 'Équipement', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-04-30 13:46:37', '2020-04-30 11:46:37', '', 2, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/2-revision-v1/', 0, 'revision', '', 0),
(67, 1, '2020-04-30 13:55:11', '2020-04-30 11:55:11', '<!-- wp:paragraph -->\n<p><span style=\"color:#dbe8ed\" class=\"has-inline-color\">L</span><span style=\"color:#d5f1fc\" class=\"has-inline-color\">\'histoire du basket-ball féminin débute en 1892 au <em>Smith College</em> (Massachusetts), lorsque la professeure d\'éducation physique Senda Berenson Abbott adapte les règles du jeu pour les femmes. Ainsi, elle interdit d\'arracher le ballon à l\'adversaire ou de dribbler au sol plus de trois fois, afin de ne pas <q>développer une tendance à la nervosité et perdre la grâce, la dignité et l\'estime de soi</q>. Peu après avoir été embauchée, elle rencontre Naismith afin d\'en apprendre davantage sur le basket-ball. Convaincue de l\'intérêt de ce sport et des valeurs qu\'il peut véhiculer, elle organise le premier match universitaire féminin au <em>Smith College</em> le 21 mars 1893&nbsp;: les élèves en première année (<em>freshmen</em>) jouent contre les deuxièmes années (<em>sophomores</em>). Le sport s\'implante dans plusieurs universités pour femmes, dont Wellesley, Vassar et Bryn Mawr College. Le 4 avril 1896, l\'équipe de Stanford affronte celle de Berkeley dans un match à neuf contre neuf, qui voit la victoire de Stanford par 2–1.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1895, Clara Gregory Baer publie le premier recueil des règles du basket-ball féminin, alors appelé basquette. Les règles de Berenson sont publiées pour la première fois en 1899, et celle-ci réalise la première édition du <em>Women\'s Basketball Guide</em> d\'Albert Spalding en 1901. La pratique féminine est alors très mal considérée&nbsp;: devant le développement du sport dans les lycées, de nombreuses études tentent de prouver les effets du basket-ball sur la moralité des jeunes filles et prônent son interdiction. Les joueuses portent le corset ainsi que de longues robes, qui les font fréquemment trébucher. Le tir devait être effectué à une seule main&nbsp;: tirer à deux mains était jugé disgracieux car il mettait la poitrine en avant. Les joueuses des <em>Edmonton Grads</em>, une équipe canadienne qui réalise des tournées entre 1915 et 1940, n\'étaient pas payées et devaient impérativement rester célibataires.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">De premières stars féminines émergent aux États-Unis, comme Mildred Didrickson des Golden Cyclones et l\'équipe des All American Red Heads. Cette dernière se produit en spectacle à la manière des Globetrotters de Harlem et joue parfois contre des équipes masculines, avec les règles destinées aux hommes. Elles ont cependant pour obligation de se maquiller et de soigner leur apparence. Dès 1924, la Fédération sportive féminine internationale organise une compétition de basket-ball. Les <em>Edmonton Grads</em> dominent le basket-ball féminin jusqu\'aux années 1940&nbsp;: elles jouent contre toutes les équipes qui acceptent de les défier et remportent 522&nbsp;victoires pour seulement 20&nbsp;défaites. Elles remportent également le tournoi de démonstration du basket-ball féminin aux Jeux olympiques de 1924, 1928, 1932 et 1936.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball féminin accède à plus de reconnaissance dans la seconde moitié du <abbr title=\"20ᵉ siècle\">XX<sup>e</sup></abbr>&nbsp;siècle, avec notamment la création du championnat du monde de basket-ball féminin en 1953 et du championnat d\'Afrique en 1966. Le sport prend son essor aux États-Unis après l\'adoption du Titre IX, qui interdit toute discrimination sur la base du sexe dans les programmes d\'éducation soutenus par l’État, et permet la constitution de nombreuses équipes universitaires&nbsp;: un championnat NCAA féminin est créé en 1982. En 1976, le basket-ball féminin devient un sport olympique. L\'équipe des États-Unis (7) et celle d\'URSS/Russie (3) se partagent les dix titres mis en jeu. En 1985, Senda Berenson, Bertha Teague et Margaret Wade deviennent les premières femmes à être intronisées au <em>Basketball Hall of Fame</em>. La professionnalisation du basket-ball féminin se renforce en 1997 avec la création de la Women\'s National Basketball Association (WNBA), sur le modèle de la NBA. Elle voit rapidement émerger des joueuses vedettes telles que Lisa Leslie, Tina Thompson, Sue Bird, Diana Taurasi ou Candace Parker. Les matchs de la ligue sont diffusés sur la chaîne de télévision ESPN depuis 2009 et participent au développement de la popularité du basket-ball féminin.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":42,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Smith-College-Class-1902-basketball-team-1024x585.jpg\" alt=\"\" class=\"wp-image-42\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">L\'équipe féminine de basket-ball du Smith College en 1902.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":43,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-20130607_-_France-Canada_-_040-1024x682.jpg\" alt=\"\" class=\"wp-image-43\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">La joueuse française Céline Dumerc (en bleu) lors d\'un match face au Canada, le 7 juin 2013.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Basket-ball féminin', '', 'inherit', 'closed', 'closed', '', '41-revision-v1', '', '', '2020-04-30 13:55:11', '2020-04-30 11:55:11', '', 41, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/41-revision-v1/', 0, 'revision', '', 0);
