(68, 1, '2020-04-30 14:06:48', '2020-04-30 12:06:48', '<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Achèvement de la professionnalisation</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La NBA gagne en visibilité et est diffusée dans un nombre croissant de pays, dont la France à partir de 1985. De nouveaux talents émergent dans les années 1970, comme Kareem Abdul-Jabbar (meilleur marqueur de l\'histoire de la NBA), Elvin Hayes, Moses</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">Malone, Robert Parish ou Bernard King, ainsi que dans les années 1980 où débutent entre autres Hakeem Olajuwon, John Stockton, Karl Malone, Dominique Wilkins et Patrick Ewing. Toutefois, trois joueurs dominent la décennie et contribuent à accroître la popularité du basketball dans le monde : Larry Bird, Magic Johnson et surtout Michael Jordan, considéré comme le plus grand joueur de l\'histoire. À partir des années 1990, quelques équipes parviennent à remettre en cause la domination des Lakers de Los Angeles et des Celtics de Boston sur le basketball américain, comme les Bulls de Chicago emmenés par Jordan (six titres entre 1991 et 1998) et les Spurs de San Antonio (cinq titres de 1999 à 2014). De nouvelles stars font leur apparition : David Robinson, Gary Payton, Jason Kidd, Steve Nash, Dirk Nowitzki, Tim Duncan, Kobe Bryant ou encore Shaquille O\'Neal, connu pour son physique impressionnant et ses facéties sur le terrain.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La professionnalisation du basket-ball se poursuit dans les années 1970 et ne s\'achève véritablement qu\'en 1990. En 1989, la FIBA cesse d\'exclure les joueurs professionnels de ses compétitions, et des joueurs professionnels sont pour la première fois admis aux Jeux olympiques de 1992. Néanmoins, la pratique amateur continue de se développer : en 2012, vingt-six millions d\'Américains pratiquent le basketball (dont quinze millions de manière occasionnelle). En juin 2015, la Fédération française de basket-ball annonce une progression importante du nombre de licenciés, avec un record de plus de 600 000, dont 36 % de femmes. Au début des années 2010, le basket-ball est l\'un des sports les plus pratiqués au monde, avec plus de 100 millions de licenciés et plus de 450 millions de pratiquants occasionnels.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Mondialisation et contestation de la domination américaine</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Depuis la création du sport, les États-Unis ont dominé les compétitions internationales masculines et féminines, quoique concurrencés par les équipes de Yougoslavie (puis de Serbie) et d\'Union soviétique. L\'équipe américaine a notamment remporté l\'or olympique à quatorze reprises, sur dix-huit olympiades où le basketball figure au programme. La première <em>Dream Team</em> (« Équipe de rêve ») américaine, composée notamment de Michael Jordan, Magic Johnson, Charles Barkley et Scottie Pippen, entre en compétition lors des Jeux olympiques de Barcelone et remporte le titre avec un écart moyen de 42 points sur ses adversaires. Elle est ainsi considérée comme la meilleure équipe de l\'histoire. Toutefois, avec la popularité croissante du basket-ball dans le monde, de nouvelles équipes nationales gagnent en niveau et parviennent à contester la suprématie américaine. L\'équipe américaine, bien que composée intégralement de joueurs évoluant en NBA, finit sixième lors des championnats du monde en 2002 derrière la Yougoslavie, l\'Argentine, l\'Allemagne, la Nouvelle-Zélande et l\'Espagne. Lors des Jeux olympiques de 2004 à Athènes, les États-Unis n\'obtiennent que la médaille de bronze, après des défaites contre Porto Rico, la Lituanie et l\'Argentine. Ils perdent également contre la Grèce en demi-finales des championnats du monde en 2006. Selon le classement établi par la FIBA en date du 3 octobre 2015, l\'équipe américaine demeure la meilleure au monde, suivie par l\'Espagne, la Lituanie, l\'Argentine, la France, la Serbie, la Russie, la Turquie, le Brésil et la Grèce.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Depuis les années 1990, une « globalisation » du basket-ball semble se mettre en place, avec la création de nombreux championnats et ligues à travers le monde. Aux championnats les plus anciens, créés avant les années 1970 (Pro A, Lega Basket, ESAKE, TBL, BBL, Liga ACB) s\'ajoutent de nouvelles ligues professionnelles, essentiellement en Asie où le sport est en plein essor. La première ligue professionnelle d\'Asie, la <em>Philippine Basketball Association</em> (PBA), organise son premier match le 9 avril 1975 à Quezon City, dans la banlieue de Manille. La <em>National Basketball League</em> est fondée en 1979 regroupe sept équipes australiennes et une équipe néo-zélandaise ; une ligue féminine est créée en 1981. Des ligues sont créées partout dans le monde dans les années 2000, comme la Bj League au Japon (2005), la NBB au Brésil (2008) et la VTB United League en Russie et Europe de l\'Est (2008). Toutefois, c\'est la <em>Chinese Basketball Association</em> qui connaît le plus fort développement et attire même d\'anciens joueurs NBA, comme Metta World Peace, Stephon Marbury ou Tracy McGrady. Au Canada, bien que le hockey sur glace demeure le sport le plus pratiqué et médiatisé, le nombre de licenciés et de matchs diffusés ne cesse de croître depuis une dizaine d\'années</span>.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Face au développement international du basketball, la NBA s\'est peu à peu ouverte aux meilleurs joueurs étrangers non formés aux</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">États-Unis. Parmi les premiers figurent des Yougoslaves comme Dražen Petrović, Toni Kukoč et Vlade Divac, ou des Lituaniens (Arvydas Sabonis, Šarūnas Marčiulionis). Une vingtaine de joueurs français a foulé les parquets de la ligue américaine : Tariq</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">Abdul-Wahad fut le premier, en 1997, suivi par d\'autres comme Nicolas Batum, Joakim Noah, Mickaël Piétrus, Kevin Séraphin, Johan Petro, Boris Diaw ou encore Tony Parker, quatre fois champion NBA avec les Spurs de San Antonio. La ligue recrute aussi plusieurs joueurs africains : Manute Bol, Michael Olowokandi, DeSagana Diop, Luc Mbah a Moute, Hasheem Thabeet ou Bismack Biyombo.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Des joueurs russes (Timofeï Mozgov, Andreï Kirilenko), espagnols (les frères Pau et Marc Gasol), allemands (Dirk Nowitzki, Detlef Schrempf), italiens (Andrea Bargnani, Marco Belinelli), suisses (Thabo Sefolosha, Clint Capela), argentins (Manu Ginóbili, Andrés Nocioni) et brésiliens (Anderson Varejão et Nenê) font également leur apparition. Quelques Australiens (Luc Longley, Andrew Bogut) sont aussi parvenus à intégrer un club américain. Enfin, depuis les années 2000 et le gain de popularité du basketball en Asie, la NBA a accueilli quelques joueurs chinois ou d\'origine chinoise : Yi Jianlian, Wang Zhizhi, Jeremy Lin et surtout le géant Yao Ming, figure de proue de l\'expansion du basket-ball en Chine, où le basket-ball est devenu le deuxième sport le plus pratiqué après le tennis de table.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":37,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Jordan_by_Lipofsky_16577.jpg\" alt=\"\" class=\"wp-image-37\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Michael Jordan sautant au panier pour réaliser un dunk. Durant sa carrière longue de près de</span> <span style=\"color:#08ffff\" class=\"has-inline-color\">vingt ans (1984-2003), ses actions spectaculaires et ses cinq titres de meilleur joueur de la saison (MVP) ont fait de lui le basketteur le plus célèbre au monde.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":38,\"width\":271,\"height\":193,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-Gasol_Brothers_at_the_2012_Summer_Olympics-1024x731.jpg\" alt=\"\" class=\"wp-image-38\" width=\"271\" height=\"193\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Les frères Marc et Pau Gasol sous le maillot de l\'équipe d\'Espagne, lors des Jeux olympiques de 2012 à Londres.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":39,\"width\":269,\"height\":218,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Yao_Ming_2310550443.jpg\" alt=\"\" class=\"wp-image-39\" width=\"269\" height=\"218\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le joueur chinois Yao Ming en décembre 2006, sous le maillot des Rockets de Houston. De 2002 à 2011, il dispute neuf saisons en NBA et contribue à l\'expansion du basket-ball en Asie.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->', 'Depuis les années 1970', '', 'inherit', 'closed', 'closed', '', '34-revision-v1', '', '', '2020-04-30 14:06:48', '2020-04-30 12:06:48', '', 34, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/34-revision-v1/', 0, 'revision', '', 0),
(69, 1, '2020-04-30 14:09:56', '2020-04-30 12:09:56', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Peu après sa création, le basket-ball s\'étend progressivement en dehors des États-Unis et du Canada et atteint l\'Europe, où il se développe rapidement. En 1909 se tient le premier match international de basketball, opposant le Mayak Saint-Pétersbourg (à domicile) à une équipe de YMCA américaine. Le premier grand évènement européen se déroule en 1919 à Joinville-le-Pont durant les Jeux interalliés : les États-Unis, emmenés par Marty Friedman, l\'emportent contre la France en finale. Le jeu gagne en popularité dans ces deux pays.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le 18 juin 1932, la Fédération internationale de basket-ball amateur (FIBA) est fondée à Genève par l\'Argentine, la Tchécoslovaquie, la Grèce, l\'Italie, la Lettonie, le Portugal, la Roumanie et la Suisse. À l\'origine, cette fédération ne supervise que les équipes d\'amateurs. Elle joue un rôle fondamental dans l\'inscription du basketball au programme des Jeux olympiques d\'été de 1936 à Berlin. Les matchs y sont disputés en extérieur, sur un terrain en terre battue. Le premier titre olympique est remporté par l\'équipe nationale américaine, avec entre autres Sam Balter, Ralph Bishop et Francis Johnson, contre l\'équipe du Canada. Le 22 août 1951, à Berlin-Ouest, une rencontre est disputée devant plus de 75 000 spectateurs, ce qui en ferait la plus importante fréquentation pour un match de basket-ball.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le premier championnat du monde de basket-ball est organisé en Argentine en 1950, et trois ans plus tard a lieu le premier championnat du monde de basket-ball féminin à Santiago du Chili. L\'épreuve féminine ne devient olympique qu\'en 1976, lors des Jeux olympiques de Montréal, grâce notamment à l\'action du secrétaire général de la FIBA Renato William Jones.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":31,\"width\":411,\"height\":265,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/1280px-Jeux_interalliés_1919_basket-ball_01-1024x664.jpg\" alt=\"\" class=\"wp-image-31\" width=\"411\" height=\"265\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Rencontre entre les États-Unis et la France lors des Jeux Interralliés de 1919.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":32,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Equipe_de_France_1953.jpg\" alt=\"\" class=\"wp-image-32\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Équipe de France de basket-ball féminin 1953.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Implantation en Europe et compétitions internationales', '', 'inherit', 'closed', 'closed', '', '30-revision-v1', '', '', '2020-04-30 14:09:56', '2020-04-30 12:09:56', '', 30, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/30-revision-v1/', 0, 'revision', '', 0),
(72, 1, '2020-04-30 14:44:59', '2020-04-30 12:44:59', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La <em>Young Men\'s Christian Association</em> (YMCA) joue un grand rôle dans la diffusion du basketball à travers les États-Unis et le Canada, mais aussi dans le reste du monde. Le premier match européen est disputé en 1893 à Paris, dans le quartier de Montmartre. À la même époque, des matchs sont organisés à Tianjin (Chine), en Inde, au Japon et en Perse. Dès 1895, le sport est pratiqué dans plusieurs lycées de jeunes filles. Toutefois, la YMCA ne parvient pas à préserver l\'esprit originel du basketball, qui devient de plus en plus violent et est pratiqué par des bandes de jeunes bagarreurs. Pour permettre le respect des règles de jeu, la première ligue professionnelle, la <em>National Basketball League</em>, est fondée aux États-Unis en 1898 avec six équipes. Les premiers champions sont les <em>Trenton Nationals</em>, suivis des <em>New York Wanderers</em>, des <em>Bristol Pile Drivers</em> et des <em>Camden Electrics</em>. La ligue est dissoute en 1904. De nombreux championnats sont alors organisés.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout début du <abbr title=\"20ᵉ siècle\">XX<sup>e</sup></abbr> siècle, le basketball devient peu à peu une activité courante dans de nombreuses universités américaines, notamment grâce à l\'action de James Naismith. Le premier match interuniversitaire est disputé le 9 février 1895 entre l\'université Hamline et l\'école d\'agriculture de l\'université du Minnesota ; cette dernière remporte le match sur le score de 9 points à 3. La première équipe universitaire est fondée en 1896 au <em>Geneva College</em> de Pittsburgh. Naismith lui-même entraîne pendant six ans l\'équipe de l\'université du Kansas, avant de laisser la place à Phog Allen. Amos Alonzo Stagg introduit le basketball à l\'université de Chicago tandis qu\'Adolph Rupp, un ancien élève de Naismith, connaît le succès en tant qu\'entraîneur de l\'université du Kentucky.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Dès 1897, l\'<em>Amateur Athletic Union</em> prend le contrôle de la gestion du basketball à la YMCA. En 1901, de nombreuses universités commencent à financer des matchs, dont l\'université de Chicago, Columbia, le Dartmouth College, l\'université du Minnesota, l\'Académie navale d\'Annapolis, l\'université du Colorado et Yale. Le premier match universitaire au Canada a lieu le 6 février 1904 et oppose l\'université McGill à l\'université Queen\'s. En avril 1905, des représentants de quinze universités créent le <em>Basket Ball Rule Committee</em> (<q>Comité de règlementation du basket-ball</q>) afin de superviser le basketball universitaire. La même année, sur la suggestion du président Theodore Roosevelt qui estimait que les blessures étaient trop fréquentes dans le football américain, se forme l’<em>Intercollegiate Athletic Association</em>. Elle absorbe le comité en 1909, et devient en 1910 la NCAA - la principale fédération américaine de sport universitaire actuelle.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Peu avant le début de la Première Guerre mondiale, la NCAA et l’<em>Amateur Athletic Union</em> se disputent ainsi le contrôle des règles</span> <span style=\"color:#d5f1fc\" class=\"has-inline-color\">du jeu. Après l\'entrée en guerre des États-Unis en 1917, les forces armées américaines contribuent à la diffusion du basketball sur le continent européen : plusieurs entraîneurs sportifs étaient présents aux côtés des troupes. Naismith a lui-même passé deux ans en France avec la YMCA à cette époque.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":19,\"width\":810,\"height\":642,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Kansas_U_team_1899.jpg\" alt=\"\" class=\"wp-image-19\" width=\"810\" height=\"642\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">L\'équipe de l\'université du Kansas en 1899, avec leur entraîneur James Naismith (rang du haut, à droite).</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Développement aux États-Unis et au Canada', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2020-04-30 14:44:59', '2020-04-30 12:44:59', '', 18, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/18-revision-v1/', 0, 'revision', '', 0),
(71, 1, '2020-04-30 14:42:26', '2020-04-30 12:42:26', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">La <em>National Basketball League</em>, fondée en 1898 et dissoute en 1904, est le précurseur des nombreuses ligues professionnelles créées aux États-Unis et dans le reste du monde tout au long du siècle. Hormis la <em>Eastern Basket Ball League</em>, fondée en 1909, les principales ligues professionnelles sont créées au début des années 1920 : la <em>Metropolitan Basketball League</em> (1921) et l\'<em>American Basketball League</em> (1925). En 1922 est créée l\'équipe des Rens de Dayton (également appelée New York Renaissance), composée uniquement d\'Afro-Américains. Leurs principaux rivaux étaient les Original Celtics, considérés comme les <q>pères du basketball</q> et présentés comme les champions du monde de la discipline. À l\'image des Harlem Globetrotters, fondés en 1926, ceux-ci organisaient des tournées dans le pays à la manière d\'un cirque. Les Celtics dominent le basketball américain de 1922 à 1928, année de leur dissolution.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le 6 juin 1946 est créée la <em>Basketball Association of America</em> (BAA) : son premier match oppose les Huskies de Toronto, à domicile, aux Knickerbockers de New York. Après trois saisons, en 1949, la ligue fusionne avec la <em>National Basketball League</em> pour former la <em>National Basketball Association</em> (NBA). Dès les années 1950 apparaissent les premières stars du basketball, dont le pivot George Mikan et le meneur Bob Cousy. Les Lakers de Minneapolis (qui s\'installent à Los Angeles en 1960) et les Celtics de Boston assoient leur domination sur la NBA en remportant seize titres à eux deux de 1949 à 1970. Les deux équipes s\'opposent alors dans une rivalité qui les voit s\'affronter à dix reprises en finales entre 1959 et 1987.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les années 1960 voient éclore plusieurs joueurs aujourd\'hui légendaires : l\'arrière des Lakers Jerry West ; le meneur Oscar Robertson ; le pivot des Celtics Bill Russell, onze fois champion NBA et qui révolutionna la manière de pratiquer la défense; et Wilt Chamberlain, qui détient encore aujourd\'hui de nombreux records de statistiques. Le 2 mars 1962, il inscrit 100 points lors d\'un match entre les Warriors de Philadelphie et les Knicks de New York.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1967, l\'<em>American Basketball Association</em> (ABA) est lancée pour tenter de rivaliser avec la NBA, qui connaît un pic de popularité. Celle-ci suscite l\'intérêt du public en proposant un nouveau style de jeu et des règles différentes. La balle est tricolore (rouge, blanc, bleu), le jeu est plus agressif et spectaculaire, et le tir à trois points est créé. Julius Erving est alors le joueur le plus célèbre de cette ligue, grâce à un style aérien où le saut et le jeu au-dessus du panier sont aussi importants que le tir. Toutefois, les faibles recettes et le succès déclinant de la ligue la contraignent à être absorbée par la NBA : ses quatre meilleures équipes (les Nets de New York, les Nuggets de Denver, les Pacers de l\'Indiana et les Spurs de San Antonio) y sont incorporées, et certains éléments sont conservés, comme le tir à trois points. Après 1970, la NBA est sans conteste la ligue de basketball la plus importante, tant en termes de popularité que de budget ou de niveau de jeu.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":28,\"width\":644,\"height\":873,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Wilt_Chamberlain_Bill_Russell_2-755x1024.jpg\" alt=\"\" class=\"wp-image-28\" width=\"644\" height=\"873\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Bill Russell (à gauche) en défense sur Wilt Chamberlain. De 1959 à 1969, ces deux pivots s\'opposent et donnent lieu à l\'une des plus grandes rivalités de l\'histoire du basket-ball.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Création des premières ligues professionnelles américaines', '', 'inherit', 'closed', 'closed', '', '27-revision-v1', '', '', '2020-04-30 14:42:26', '2020-04-30 12:42:26', '', 27, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/27-revision-v1/', 0, 'revision', '', 0),
(73, 1, '2020-04-30 14:48:30', '2020-04-30 12:48:30', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball est inventé en décembre 1891 par James Naismith, professeur d\'éducation physique canado-américain au <em>Springfield College</em>, dans l\'État du Massachusetts (États-Unis). Lors d\'une journée de pluie, Naismith tente d\'assurer malgré tout son cours de sport, et essaie de développer un sport d\'intérieur pour maintenir la condition physique de ses élèves entre les saisons de football américain et de baseball, pendant les longs hivers de la Nouvelle-Angleterre. Il souhaite leur trouver une activité où les contacts physiques sont restreints, afin d\'éviter les risques de blessure.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Après avoir écarté certains jeux trop violents ou peu appropriés à une pratique en salle, il reprend l\'idée d\'un ancien jeu de balle maya (le <em>Pok-ta-pok</em>) et place deux caisses de pêches sur les rampes du gymnase, à 3,05 mètres de hauteur (dix pieds). Le but du jeu est de faire pénétrer un ballon dans ces caisses en bois pour marquer un <q>panier</q>. Contrairement aux paniers actuels, la caisse de pêches dispose d\'un fond : la balle devait donc être récupérée manuellement après chaque <q>panier</q> inscrit. Afin d\'éviter d\'avoir à rechercher systématiquement la balle, le fond du panier est évidé pour pouvoir l\'extraire avec une longue perche. Naismith établit rapidement treize règles principales (les Treize règles originelles) pour rendre le jeu praticable ; la majorité sont encore en vigueur. Ces règles comportent notamment l\'interdiction de courir en tenant la balle (marcher) et de <q>donner des coups d\'épaule, de tenir, de pousser ou de faire tomber de quelconque manière</q> l\'adversaire. Elles définissent en outre la durée d\'une partie : quatre quarts-temps de quinze minutes, avec une pause de cinq minutes entre elles.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Ce sport est baptisé basket-ball, ce qui signifie littéralement en anglais « ballon panier ». Il est d\'abord pratiqué avec un ballon de football, puis avec des balles de couleur brune. Le tout premier match public de basket-ball est joué le 11 mars 1892 entre des élèves d\'une classe d\'étudiants de la <em>Springfield Christian Training Association</em> et leurs enseignants. Les étudiants gagnent 5-1 ; le seul panier marqué par les enseignants est celui du célèbre entraîneur de football américain Amos Alonzo Stagg. La même année, le jeu est adapté pour être joué par des femmes. Le premier match féminin se déroule en 1893 au <em>Smith College</em> de Northampton, dans le Massachusetts. Dès 1897-1898, le nombre de joueurs par équipe est fixé à cinq. À l\'occasion d\'une démonstration au Y.M.C.A. de New York en avril 1892, la discipline gagne une première mention dans The New York Times. Il est présenté comme <q>un nouveau sport de balle, un substitut du football sans ses aspects brutaux</q>. Les premiers articles sur ce sport en France datent de 1897. Dans ce dernier pays, il est d\'abord plutôt considéré comme un sport féminin et se fait encore appeler « balle au panier ».</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">En 1906, les caisses en bois sont finalement remplacées par des anneaux en métal fixés à des panneaux. La balle passe ainsi à travers un arceau et retombe au sol lorsqu\'un panier est inscrit. Le panneau sert quant à lui à éviter que la balle n\'atterrisse dans les tribunes, et permet d\'effectuer des tirs avec rebond. Dans son journal, découvert en 2006 par sa petite-fille, James Naismith fait part de ses appréhensions quant au jeu qu\'il a inventé, et indique qu\'il y a introduit certaines règles d\'un jeu enfantin médiéval, le <em>Duck on a Rock</em>.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au début de son histoire, le basket-ball est surtout porté sur le jeu offensif et la défense est reléguée au second plan. La défense est alors la phase passive du basket-ball, où les joueurs attendent l\'échec de l\'adversaire ; elle a depuis acquis un rôle comparable à celui de l\'attaque. Par ailleurs, la passe et le tir étaient les seules manières de déplacer la balle vers le panier. En effet, le dribble n\'existait pas dans le basket-ball originel, hormis lors d\'une éventuelle passe à un coéquipier avec rebond au sol : il était rendu difficile par la forme asymétrique des premiers ballons. Il est devenu essentiel dans le jeu à partir des années 1950, lorsque les ballons manufacturés eurent une forme régulière et les qualités de rebond nécessaires.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le sport prend diverses appellations en fonction des pays. En espagnol, il est nommé <em>baloncesto</em> (Espagne) ou <em>básquetbol</em> (Argentine); en italien <em>pallacanestro</em> ; et en tchèque <em>košíková</em>.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":22,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Dr._James_Naismith-1.jpg\" alt=\"\" class=\"wp-image-22\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">James Naismith, inventeur du basketball, avec un ballon et un panier.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":23,\"width\":376,\"height\":529,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Firstbasketball.jpg\" alt=\"\" class=\"wp-image-23\" width=\"376\" height=\"529\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le premier terrain de basket-ball au <em>Springfield College</em>.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Histoire du basket-ball', '', 'inherit', 'closed', 'closed', '', '1-revision-v1', '', '', '2020-04-30 14:48:30', '2020-04-30 12:48:30', '', 1, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/1-revision-v1/', 0, 'revision', '', 0),
(77, 1, '2020-04-30 15:10:42', '2020-04-30 13:10:42', '<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Matériel</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le basket-ball se joue généralement dans un endroit couvert, comme un gymnase, mais peut aussi être pratiqué sur des aires de jeu en tant que loisir, sous sa variante la plus populaire&nbsp;: le <em>streetball</em> («&nbsp;basket-ball de rue&nbsp;»). Le terrain est doublement symétrique, en longueur et en largeur. Ses dimensions varient, selon les pays ou les normes internationales, de 22,50 à 29&nbsp;mètres de long sur 13 à 15&nbsp;mètres de large. Les terrains en extérieur (<em>playgrounds</em>) peuvent être goudronnés ou en terre battue. Les terrains couverts sont généralement réalisés en parquet, avec des lattes d\'érable disposées dans le sens de la longueur. Le nom et le logo de l\'équipe résidente sont souvent peints sur le cercle central. Les salles accueillant des matchs en compétition possèdent des équipements supplémentaires comme l\'horloge des 24 secondes, une table de marque (sur le côté), des tableaux d\'affichage et des compteurs. Aux États-Unis, la plupart comprennent également des écrans suspendus au plafond.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Aux deux extrémités du terrain se trouve un panier, formé par un anneau (ou <em>arceau</em>) métallique situé à 3,05&nbsp;m du sol, en dessous duquel est attaché un filet ouvert en son centre. L\'arceau est fixé à un panneau rectangulaire vertical (la <q>planche</q>) sur lequel la balle peut rebondir lors d\'un tir. Certains arceaux peuvent s\'incliner lorsqu\'un joueur effectue un dunk puis revenir en position horizontale (les anneaux inclinables).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Sous chaque panier se trouve une zone rectangulaire appelée la raquette (ou zone restrictive). Un arc de cercle situé à 6,25&nbsp;m (6,75&nbsp;m depuis 2010 pour les championnats de Pro A, Pro B, N1 français et basket-ball féminin&nbsp;; 7,23&nbsp;m en NBA) de chaque panier représente la ligne de tirs à trois points. Sous l\'anneau est tracé un arc de cercle d\'un rayon de 1,25&nbsp;m dans lequel aucun passage en force d\'un attaquant ne sera sifflé par l\'arbitre.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le ballon de basket-ball standard est de forme sphérique, et a une masse de 650&nbsp;g et un diamètre de 24&nbsp;cm. Sa pression intérieure est de 0,55 atm. Initialement, le basket-ball se pratiquait avec un ballon de football, puis des ballons spécifiques de couleur marron. Ce n\'est qu\'à la fin des années 1950 que Tony Hinkle, désireux de créer une balle plus visible des joueurs et des spectateurs, développe la balle de couleur orange encore utilisée aujourd\'hui. Constituée de huit pièces de cuir cousues autour d\'une chambre à air, il existe en plusieurs tailles&nbsp;: 7 pour les hommes, 6 pour les femmes, et de 5 à 3 pour les jeunes joueurs. Le ballon officiel de la NBA est fabriqué par Spalding, et celui de la FIBA par l\'équipementier japonais Molten.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":48,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/800px-Basketball_court_fiba-586x1024.png\" alt=\"\" class=\"wp-image-48\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un terrain de basket-ball selon les règles de la FIBA.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":49,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Lifetime_Basketball_Hoop.jpg\" alt=\"\" class=\"wp-image-49\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Un panier de basket-ball à l\'extérieur, avec un arceau, un filet et un panneau transparent.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Vêtements et accessoires</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au tout début du siècle, les joueurs portaient des maillots en tricot de laine et des pantalons en étoffe. La dureté du jeu et le mauvais état des terrains imposait en outre le port de protections aux genoux, aux coudes et aux tibias. Dès les années 1910, le port du maillot se développe et les pantalons en étoffe sont remplacés par des shorts. Dans les années 1960, l\'habillement des joueurs évolue&nbsp;: les maillots deviennent plus légers et sont progressivement réalisés en fibres synthétiques. À l\'initiative notamment de Michael Jordan, les shorts sont allongés et les maillots rendus plus larges. En outre, certains joueurs portent des gaines au bras effectuant les tirs, ou plus rarement aux doigts&nbsp;: les <em>sleeves</em>. D\'autres comme Slick Watts ou Bill Walton ont rendu populaires les bandeaux, portés autour de la tête ou au poignet. Fabriqués en nylon et élasthanne extensibles, ils sont destinés à garder les muscles chauds ou éponger la sueur, mais sont aussi utilisés comme un accessoire de style.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les chaussures de basket-ball ont également changé au fil du temps. Au début du siècle, la plupart des joueurs portaient des chaussures de cuir peu confortables. En 1903, l\'équipementier sportif Spalding met en vente un modèle spécialement conçu pour le basket-ball, avec un système de ventouses pour éviter de glisser. Des modèles en toile et en caoutchouc ont ensuite été créés, parfois sur les conseils de joueurs comme Chuck Taylor, qui contribua au développement des Converse. Les Chuck Taylor All Star et les Keds sont les chaussures les plus utilisées dans les années 1960 et 1970. À partir des années 1980 apparaît la forme actuelle des chaussures de basket-ball, avec une forme montante cachant la malléole médiale afin d\'éviter les risques de torsion de la cheville&nbsp;: Nike et Adidas dominent alors le marché. Les plus grands joueurs sont sponsorisés par des fabricants de baskets, tel Michael Jordan avec Nike: ce dernier a d\'ailleurs développé sa propre collection de baskets nommée Air Jordan. Si les chaussures de basket-ball se sont imposées en compétition et sont par exemple obligatoires lors des Jeux olympiques, il est cependant possible de pratiquer le sport en loisir avec de simples baskets.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Dans les matchs officiels, chaque joueur porte un maillot numéroté. La règle FIBA imposait les numéros de 4 à 15 (ce n\'est plus forcément le cas) lors des compétitions internationales, soit douze numéros (autant qu\'il y a de joueurs dans une équipe). Toutefois, en NBA, les joueurs peuvent choisir n\'importe quel numéro de 0 à 99 compris (le 00 existe aussi). Ainsi, en général et dans la mesure du possible, les joueurs de NBA conservent le même numéro durant toute leur carrière, même en changeant d\'équipe, sauf quand un joueur le possède déjà ou quand celui-ci est retiré. Lorsque certains joueurs marquent l\'histoire de leur franchise, il arrive que celle-ci décide de retirer leur numéro pour leur rendre hommage. Ainsi, le célèbre numéro 23 porté par Michael Jordan aux Bulls de Chicago a été rendu indisponible dans cette franchise après son départ.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":75,\"width\":656,\"height\":878,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Carmelo_Anthony_Nov_2013-765x1024.jpg\" alt=\"\" class=\"wp-image-75\" width=\"656\" height=\"878\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Le joueur américain Carmelo Anthony portant un équipement complet&nbsp;: maillot, short, bandeau et <em>shooting sleeve</em> avec protection au coude sur les deux bras.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Équipement', '', 'inherit', 'closed', 'closed', '', '2-revision-v1', '', '', '2020-04-30 15:10:42', '2020-04-30 13:10:42', '', 2, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/2-revision-v1/', 0, 'revision', '', 0),
