(78, 1, '2020-04-30 16:39:35', '2020-04-30 14:39:35', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les durées de jeu et les dimensions des lignes du terrain varient souvent en fonction et des championnats et des ligues organisatrices&nbsp;: le règlement présenté ci-dessous comprend les normes internationales (<a href=\"https://fr.wikipedia.org/wiki/F%C3%A9d%C3%A9ration_internationale_de_basket-ball\">FIBA</a>) et nord-américaines (<a href=\"https://fr.wikipedia.org/wiki/National_Basketball_Association\">NBA</a>). La FIBA a toutefois annoncé son intention de se rapprocher progressivement des normes américaines.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">L\'objectif du jeu est de marquer davantage de points que ses adversaires, en inscrivant des paniers tout en empêchant l\'autre équipe de le faire. Un panier inscrit vaut deux points, ou trois s\'il résulte d\'un tir effectué derrière la ligne des trois points (6,75&nbsp;m d\'après la FIBA&nbsp;; 7,24&nbsp;m en NBA). Le lancer franc, accordé par l\'arbitre après certaines fautes, n\'accorde qu\'un seul point.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Règles du jeu</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Un match se déroule en quatre périodes (appelées «&nbsp;quarts-temps&nbsp;») de dix minutes selon les règles <a href=\"https://fr.wikipedia.org/wiki/F%C3%A9d%C3%A9ration_internationale_de_basket-ball\">FIBA</a>, et quatre périodes de douze minutes selon les règles <a href=\"https://fr.wikipedia.org/wiki/National_Basketball_Association\">NBA</a>. Le championnat universitaire américain (<a href=\"https://fr.wikipedia.org/wiki/Championnat_NCAA_de_basket-ball\">NCAA</a>) utilise quant à lui deux périodes de vingt minutes. Une pause de quinze minutes est accordée à la mi-temps dans les trois règlements, et les équipes changent de panier pour la seconde partie du jeu. Le chronomètre est arrêté à chaque coup de sifflet de l\'arbitre (en cas de faute ou de sortie par exemple)&nbsp;: la durée réelle du match excède donc beaucoup le temps de jeu règlementaire et atteint généralement deux heures. Le temps de jeu étant effectif, il n\'y a pas de temps additionnel comme au football&nbsp;; une sonnerie retentit au moment où la dernière seconde de chaque période s\'est écoulée, mais un tir réussi après la sonnerie peut être accordé si le joueur a lâché le ballon avant que la sonnerie ne retentisse (<em>buzzer beater</em>).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Seuls cinq joueurs de chaque équipe peuvent être présents simultanément sur le terrain. Chaque équipe peut remplacer un ou plusieurs joueurs pendant les arrêts de jeu et les temps morts. Un nombre limité de temps morts est autorisé, à la demande de l\'entraîneur. Leur durée est comprise entre vingt et cent secondes (en NBA). L\'entraîneur se trouve au bord du terrain et donne des instructions stratégiques à ses joueurs. Le banc accueille les joueurs remplaçants, ainsi que les entraîneurs assistants et d\'autres membres du personnel de l\'équipe.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au début du match, l\'engagement est effectué par l\'arbitre sous la forme d\'un entre-deux. Pour cela, un joueur de chaque équipe (généralement le plus grand, celui qui saute le plus haut ou un compromis des deux) se place face à son adversaire, derrière la ligne du milieu de terrain, en direction du panier où il doit attaquer. L\'arbitre lance alors la balle au-dessus des deux joueurs et ceux-ci doivent pousser le ballon avec la main pour qu\'un de leurs équipiers l\'attrape. C\'est à ce moment-là que le match commence.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">À l\'issue de la rencontre, l\'équipe ayant inscrit le plus de points remporte le match. En cas d\'égalité, on joue alors cinq minutes de prolongation pour départager les deux équipes, et ce quelle que soit la compétition en cours. S\'il y a à nouveau égalité au terme de la prolongation, on rejoue une autre prolongation. Il n\'y a ainsi jamais de match nul au basket-ball (sauf en cas de phase finale aller/retour, où il peut y avoir match nul au match aller ou retour, le vainqueur se décidant au cumul des points sur les deux matchs).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=QGGLH1EtA9Y\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=QGGLH1EtA9Y\n</div><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Exemples de Buzzer beater</span></figcaption></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Règlement', '', 'publish', 'closed', 'closed', '', 'reglement', '', '', '2020-04-30 17:22:53', '2020-04-30 15:22:53', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?page_id=78', 0, 'page', '', 0),
