(88, 1, '2020-04-30 20:20:47', '2020-04-30 18:20:47', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les rencontres professionnelles de basket-ball sont supervisées par trois arbitres. En NBA, l\'arbitrage est effectué par un arbitre présent sur le terrain (nommé <em>crew chief</em>) et deux arbitres de touche. La <a href=\"https://fr.wikipedia.org/wiki/FIBA\">FIBA</a> utilise une organisation différente avec un arbitre dit <q>de queue</q> (le plus proche du centre du terrain), un dit <q>de tête</q> (sous le panier) et un troisième dit <q>central</q> (entre ses deux collègues). Les officiels de la table de marque sont chargés de compter les points inscrits, de gérer le chronomètre de jeu, de noter les fautes individuelles et d\'équipe commises ainsi que les remplacements effectués. Ils gèrent également la flèche de possession alternée et le chronomètre des tirs (ou horloge des 24 secondes) ainsi que les drapeaux signalant que la prochaine faute d\'une équipe entraînera deux lancers francs.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les joueurs doivent manipuler le ballon avec les mains exclusivement. Celui-ci peut être déplacé en étant lancé, passé entre deux joueurs, roulé au sol ou dévié par la main. En revanche, il est interdit de le toucher avec une partie quelconque de la jambe de manière délibérée ou de le frapper du poing : cela constitue une violation qui entraîne la perte de possession du ballon.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Lorsqu\'un joueur est en possession du ballon, il doit dribbler, c\'est-à-dire faire constamment rebondir le ballon sur le sol avec une main, pour pouvoir se déplacer avec. Si le joueur qui possède le ballon prend plus de deux appuis sans dribbler, ou s\'il fait un saut complet en conservant le ballon à la retombée, il est alors sanctionné par un marcher (en anglais : <em>traveling</em>), et le ballon est rendu à l\'équipe adverse par une remise en jeu. Lorsqu\'un joueur reprend son dribble après l\'avoir arrêté, ou récupère le ballon après l\'avoir lâché sans que celui-ci n\'ait rien touché, il est sanctionné par une reprise de dribble (<em>double dribble</em> en anglais). De même, un joueur qui a le ballon n\'a pas le droit de poser sa main sous le ballon au cours de son dribble, ce qui constitue un porter de ballon (<em>carry</em>). La main doit en effet toujours être en contact avec l\'hémisphère supérieur du ballon. Dans les deux cas, la balle est rendue à l\'adversaire.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Le ballon est hors-jeu dès qu’il rebondit sur ou en dehors des limites du terrain (les lignes de touche ne font pas partie du terrain), ou lorsqu\'il est touché par un joueur qui mord ou dépasse les limites du terrain. Contrairement au football, ce n’est pas la position absolue du joueur ou du ballon qui compte, mais le rebond ou l\'appui : un joueur peut ainsi plonger en dehors du terrain et sauver la balle, du moment qu\'il saute depuis l\'intérieur du terrain et qu\'il la lâche avant de toucher le sol en dehors du terrain. Si une équipe se trouve en zone avant (moitié de terrain adverse) avec le ballon, et que ce dernier vient à revenir en zone arrière sans toucher un adversaire (par une passe ou un appui dans sa propre moitié de terrain), l\'arbitre siffle un retour en zone (<em>backcourt violation</em>). Le ballon est rendu à l\'adversaire à l\'endroit le plus proche de la violation, en dehors des limites du terrain. Pour être considéré en zone avant il faut le ballon et les deux appuis du joueur qui contrôle la balle aient traversé la ligne médiane.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Afin de favoriser un jeu offensif, des règles de temps de possession du ballon ont progressivement été imposées. Les joueurs disposent de 8 secondes (NBA, FIBA) ou 10 secondes (NCAA) pour franchir leur moitié de terrain en attaque. Les attaquants doivent en outre effectuer un tir avant 24 secondes, mesurées par l\'horloge des 24 secondes, depuis 1954 pour la NBA. La règle est adaptée à 30 secondes par la FIBA, qui passe aussi à 24 secondes en 1999. La NCAA choisit 35 secondes avant de passer à 30 pour la saison 2015-2016.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Un joueur en attaque ne peut rester plus de trois secondes d\'affilée dans la raquette à partir du moment ou son équipe dépasse le milieu de terrain. Les 3 secondes ne sont plus comptabilisées dès qu\'un joueur tente un tir au panier. Lors d\'une remise en jeu, l’équipe attaquante dispose de 5 secondes pour effectuer celle-ci. Un joueur qui possède le ballon et qui arrête de dribbler dispose de 5 secondes pour s\'en débarrasser (par une passe, un tir, ou en la faisant habilement toucher par un adversaire) si le joueur adverse le soumet à une pression défensive (action de défense individuelle rapprochée).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les règles connaissent régulièrement des évolutions importantes comme avec l’introduction la règle des 24 secondes (1954 en NBA, 1956 par la FIBA d\'abord avec 30 secondes), du panier à trois points en 1984, puis en 2010 un nouveau tracé du terrain faisant notamment passer la ligne des tirs primés à 6,75 m (22′ 2″).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les règles changent au fil du temps, parfois en réaction à l\'influence d\'un joueur. Ainsi le <em>goaltending</em> – changer la trajectoire de la balle lorsque celle-ci se trouve dans la zone cylindrique située au-dessus de l’arceau – n’est sanctionné qu\'à partir de 1956 que parce que Bill Russell l\'utilisait trop facilement en NCAA. La même année, il est définitivement interdit de franchir la ligne des lancers francs avant le tir car Wilt Chamberlain détournait l\'exercice en prenant trois pas d’élan pour transformer son tir en lay-up. À partir du 29 mars 1967 et jusqu\'en 1976, la NCAA bannit le dunk pour minorer la domination de Lew Alcindor (Kareem Abdul-Jabbar).</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Enfin, l\'interférence (en) (<em>goaltending</em>) est une violation du règlement qui se manifeste dans plusieurs cas : si un joueur touche la balle alors qu\'elle est sur le cercle, par-dessus ou par-dessous le panier ; qu\'elle a touché la planche mais pas le cercle ; qu\'elle décrit une trajectoire descendante vers le panier ; ou si un joueur abaisse volontairement l\'arceau pour empêcher le tir de rentrer. Si l\'équipe en attaque commet la faute, le panier est annulé, mais il est accordé si l\'équipe défensive commet la faute même si le ballon ne pénètre pas dans le panier.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:columns -->\n<div class=\"wp-block-columns\"><!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":85,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Nalini_Hawkins_2011.jpg\" alt=\"\" class=\"wp-image-85\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Une joueuse en train de dribbler pour avancer sur le terrain.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column -->\n\n<!-- wp:column -->\n<div class=\"wp-block-column\"><!-- wp:image {\"id\":86,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/NBA_shot_clock.jpg\" alt=\"\" class=\"wp-image-86\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">Une horloge des 24 secondes affichant un temps restant de dix secondes pour l\'équipe en attaque.</span></figcaption></figure>\n<!-- /wp:image --></div>\n<!-- /wp:column --></div>\n<!-- /wp:columns -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=eEjJi1lOgAw\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=eEjJi1lOgAw\n</div></figure>\n<!-- /wp:core-embed/youtube -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=s2ioIuMu0mE\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=s2ioIuMu0mE\n</div></figure>\n<!-- /wp:core-embed/youtube -->', 'Violations', '', 'inherit', 'closed', 'closed', '', '84-revision-v1', '', '', '2020-04-30 20:20:47', '2020-04-30 18:20:47', '', 84, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/2020/04/30/84-revision-v1/', 0, 'revision', '', 0),
(89, 1, '2020-04-30 20:34:21', '2020-04-30 18:34:21', '<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Au basket-ball, les contacts avec le porteur de balle sont généralement proscrits. Toute tentative de désavantager l\'adversaire par un contact physique constitue une violation des règles du jeu et est sanctionnée par une faute personnelle. En cas de choc, c\'est généralement le défenseur qui est sanctionné, sauf lorsque ce dernier est immobile et que le joueur attaquant le percute au niveau du torse, auquel cas l\'attaquant est sanctionné par un passage en force ; la balle est alors rendue à l\'autre équipe. En cas de faute du défenseur sur dribble (contact avec le bras, obstruction), la balle est remise à l’équipe attaquante au niveau où la faute a été commise, en dehors des limites du terrain. Lorsqu\'un joueur a commis cinq fautes personnelles (six en NBA et WNBA) au cours du match, il est alors remplacé et n\'a plus le droit de rejouer jusqu\'à la fin du match.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Quand une faute personnelle est commise sur un joueur qui tire ou a l\'intention de tirer, ce joueur doit alors tirer le nombre de lancers francs correspondant à la valeur du tir : deux ou trois s\'il s\'agit d\'un tir à trois points. Il n\'en tire qu\'un seul lorsque le panier est réussi et accordé. Si un joueur doit tirer plusieurs lancers francs, les autres joueurs ne pourront tenter d\'attraper le rebond qu\'à l\'issue du dernier lancer. Le tir est à refaire si un défenseur rentre dans la raquette avant que le ballon ne quitte les mains du tireur ou il est annulé lorsque le tireur « mord » (touche) la ligne des lancers francs avec son pied. À chaque quart-temps, lorsqu’une équipe totalise quatre fautes (NBA, FIBA), l’équipe adverse tire alors automatiquement des lancers francs à chaque nouvelle faute défensive adverse : elle se trouve alors dans une situation de <q>bonus</q>. Une faute commise par un attaquant, appelée <q>faute offensive</q>, ne donne jamais lieu à des lancers-francs.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Un contact physique violent, rugueux ou non nécessaire est appelé faute flagrante (en NBA) ou <q>faute antisportive</q>. Dans ce cas, l\'équipe qui a subi la faute tire un lancer franc puis effectue une remise en jeu au milieu de terrain.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les fautes techniques peuvent être prononcées par l\'arbitre pour des comportements d\'anti-jeu (mais sans contact physique, ce qui correspondrait à une faute antisportive), des insultes ou un manque de fair-play. L\'entraineur peut également en recevoir s\'il n\'a pas inscrit le nom d\'un joueur sur la feuille de match, s\'il a lui-même un comportement irrespectueux ou si un joueur situé sur son banc en fait de même. Elles donnent lieu à un lancer, qui peut être tiré par n\'importe quel joueur de l\'équipe présent sur le terrain.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Dans les championnats sous l\'égide de la FIBA, une faute qui entraîne l\'exclusion du joueur est appelé faute disqualifiante. Elle peut être directement attribuée à un joueur pour un comportement extrême, en cas de bagarre, ou si un joueur remplaçant pénètre dans le terrain de jeu pendant une bagarre.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":90,\"width\":401,\"height\":469,\"sizeSlug\":\"large\"} -->\n<figure class=\"wp-block-image size-large is-resized\"><img src=\"http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/wp-content/uploads/2020/04/Basketball_foul.jpg\" alt=\"\" class=\"wp-image-90\" width=\"401\" height=\"469\"/><figcaption><span style=\"color:#08ffff\" class=\"has-inline-color\">L\'arbitre indique qu\'une faute a été commise par le joueur au sol.</span></figcaption></figure>\n<!-- /wp:image -->\n\n<!-- wp:core-embed/youtube {\"url\":\"https://www.youtube.com/watch?v=PYpzcxrnd9I\",\"type\":\"video\",\"providerNameSlug\":\"youtube\",\"className\":\"wp-embed-aspect-16-9 wp-has-aspect-ratio\"} -->\n<figure class=\"wp-block-embed-youtube wp-block-embed is-type-video is-provider-youtube wp-embed-aspect-16-9 wp-has-aspect-ratio\"><div class=\"wp-block-embed__wrapper\">\nhttps://www.youtube.com/watch?v=PYpzcxrnd9I\n</div></figure>\n<!-- /wp:core-embed/youtube -->', 'Fautes', '', 'publish', 'closed', 'closed', '', 'fautes', '', '', '2020-04-30 20:34:32', '2020-04-30 18:34:32', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?page_id=89', 0, 'page', '', 0),
