(93, 1, '2020-04-30 20:43:22', '2020-04-30 18:43:22', '<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Nouvelles règles FIBA (2014)</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>À partir du 1<sup>er</sup> octobre 2014, la FIBA modifie six règles :</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:list {\"ordered\":true} -->\n<ol><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">dans le demi-cercle juste sous le panier, une ligne augmente la protection de l\'attaquant ;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">nouveau tracé de ligne à trois points et zone restrictive (raquette) au format NBA ;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">dans les deux dernières minutes, chaque équipe ne peut prendre qu\'un maximum de deux temps-morts ;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">sur un rebond offensif, l\'horloge des 24 secondes reprend à 14 secondes ;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">en cas de faute défensive alors qu\'il reste moins de 14 secondes de possession pour l\'équipe adverse, le chronomètre des tirs est aussi remis à 14 secondes ;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">après une faute technique, un seul lancer franc est accordé, plus la remise en jeu au milieu du terrain par l\'équipe non-sanctionnée ;</span></li><li><span style=\"color:#d5f1fc\" class=\"has-inline-color\">la seconde faute technique est disqualifiante.</span></li></ol>\n<!-- /wp:list -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Règles spécifiques en NCAA</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">À compter de la saison 2015-2016, la NCAA féminine se rapproche des règles FIBA en passant aux quarts-temps de 10 minutes au lieu de deux mi-temps de 20 minutes, avec quatre temps-morts médias au lieu de huit. La pénalité (deux lancers-francs, au lieu d\'un lancer-franc et un second si le premier est réussi) s\'applique après la cinquième faute d’équipe dans chaque période. La règle des 10 secondes pour amener la balle en zone avant s\'applique strictement au lieu de repartir à zéro en cas d\'arrêt du jeu. Enfin, après un temps-mort décidé par l\'équipe ayant la possession de la balle, notamment après un panier encaissé, la remise en jeu est effectuée au milieu du terrain, ce qui favorise l\'équipe offensive. Toutefois, l\'équipe attaquante a toujours au plus 35 secondes pour tenter un tir. Quelques semaines plus tard, la NCAA masculine décide d\'abandonner la règle des 35 secondes pour passer à 30 dès la saison 2015-2016.</span></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading -->\n<h2><span style=\"color:#00a39e\" class=\"has-inline-color\">Règles spécifiques en NBA</span></h2>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p><span style=\"color:#d5f1fc\" class=\"has-inline-color\">Les rencontres NBA se disputent en quatre périodes de 12 minutes au lieu de 10 dans les règles FIBA et l\'élimination des joueurs est effective à la sixième faute. Les règles diffèrent d\'avec la FIBA sur des points secondaires, comme l\'interférence (en) (<em>goaltending</em>) pour laquelle il est interdit de toucher la balle alors qu\'elle est sur le cercle, contrairement aux dispositions de la FIBA. La règle des trois secondes en défense interdit à un joueur de rester plus de trois secondes dans la raquette sans défendre directement sur un attaquant, ce qui limite la défense de zone. La dimension des terrains NBA est de 28,65 x 15,24 mètres contre 28 x 15 mètres pour la FIBA. Depuis la saison 2016-2017, afin d\'éviter l\'abus du hack-a-player, si une faute intentionnelle est effectuée sur un joueur dans les deux dernières minutes d\'un quart-temps, un lancer-franc bonus est offert à l\'équipe ayant subi le hack. Ce lancer-franc bonus peut-être tiré par n\'importe quel membre de l\'équipe présent sur le terrain.</span></p>\n<!-- /wp:paragraph -->', 'Quelques règles supplémentaires', '', 'publish', 'closed', 'closed', '', 'quelques-regles-supplementaires', '', '', '2020-04-30 20:43:23', '2020-04-30 18:43:23', '', 0, 'http://phpweb/DWWM_Lo%C3%AFc/wordpressSiteBasket/?page_id=93', 0, 'page', '', 0),
